ml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:388:\"Souhaitons la bienvenue  WordPress&#160;6.5 &#160;Regina&#160;. Le nom de cette version a t inspir par le dynamisme de la violoniste de jazz reconnue Regina Carter. Cette artiste renomme et grande pdagogue a tir profit de ses fondamentaux techniques classiques et de sa grande connaissance du jazz pour se forger la rputation de transcender les possibilits [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:70202:\"\n<figure class=\"wp-block-image size-large\"><a href=\"https://fr.wordpress.org/files/2024/04/Release-Edition-Inline-Image.png\"><img fetchpriority=\"high\" decoding=\"async\" width=\"1024\" height=\"683\" src=\"https://fr.wordpress.org/files/2024/04/Release-Edition-Inline-Image-1024x683.png\" alt=\"\" class=\"wp-image-3041\" srcset=\"https://fr.wordpress.org/files/2024/04/Release-Edition-Inline-Image-1024x683.png 1024w, https://fr.wordpress.org/files/2024/04/Release-Edition-Inline-Image-300x200.png 300w, https://fr.wordpress.org/files/2024/04/Release-Edition-Inline-Image-768x512.png 768w, https://fr.wordpress.org/files/2024/04/Release-Edition-Inline-Image-1536x1024.png 1536w, https://fr.wordpress.org/files/2024/04/Release-Edition-Inline-Image-2048x1365.png 2048w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure>\n\n\n\n<p>Souhaitons la bienvenue  WordPress&nbsp;6.5 &nbsp;Regina&nbsp;. Le nom de cette version a t inspir par le dynamisme de la violoniste de jazz reconnue <a href=\"https://fr.wikipedia.org/wiki/Regina_Carter\">Regina Carter</a>. Cette artiste renomme et grande pdagogue a tir profit de ses fondamentaux techniques classiques et de sa grande connaissance du jazz pour se forger la rputation de transcender les possibilits du violon.</p>\n\n\n\n<p>N&rsquo;hsitez pas  <a href=\"https://open.spotify.com/playlist/37i9dQZF1DZ06evO1WEiVo?si=534335c984804713\">dcouvrir les sonorits du violon de Regina</a> pendant que vous jetterez un il aux nouveauts de WordPress&nbsp;6.5 <img src=\"https://s.w.org/images/core/emoji/15.0.3/72x72/1f3bb.png\" alt=\"\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> </p>\n\n\n\n<p>Cette dernire version de WordPress s&rsquo;est consacre  l&rsquo;amlioration de nombreux dtails de lexprience dadministration et de personnalisation de votre site. De la bibliothque de polices  la gestion des rvisions au sein de lditeur de site, en passant par les nombreuses amliorations de performances, WordPress&nbsp;6.5 apportera beaucoup  votre site.</p>\n\n\n\n<p>&nbsp;&nbsp;Regina&nbsp; apporte galement plusieurs outils de dveloppement ayant pour objectif de transformer la faon dont les dveloppeuses et dveloppeurs interagissent avec lditeur afin dtendre le systme de blocs. L&rsquo;API de gestion des interactions ouvre un nouveau champ de possibilits tandis que lAPI <em><bdo lang=\"en\" dir=\"ltr\">Block Bindings</bdo></em> permet de raliser des connexions dynamiques entre les blocs et les champs personnaliss (ou tout autre type de donne dynamique). Et ce ne sont que deux exemples des nombreuses volutions techniques de cette version.</p>\n\n\n\n<div class=\"wp-block-buttons is-layout-flex wp-block-buttons-is-layout-flex\">\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link wp-element-button\" href=\"https://fr.wordpress.org/download/\">Tlcharger WordPress 6.5 &nbsp;Regina&nbsp;</a></div>\n</div>\n\n\n\n<h2 class=\"wp-block-heading\">Les nouveauts de WordPress&nbsp;6.5</h2>\n\n\n\n<h3 class=\"wp-block-heading\">Grez les polices dcriture de votre site</h3>\n\n\n\n<p>La nouvelle bibliothque de polices vous permet de contrler la typographie de votre site sans avoir  mettre les mains dans le code. Installez, supprimez et activez sans effort vos polices locales ou les polices Google sur votre site, quel que soit votre thme actif. La possibilit dinclure des collections de polices personnalises offre encore plus de choix aux personnes qui crent et administrent des sites WordPress.</p>\n\n\n\n<figure class=\"wp-block-image size-large\"><img decoding=\"async\" src=\"https://wordpress.org/news/files/2024/03/Font-Manager-1024x666.png\" alt=\"A stylized view of the font manager; part of the new Font Library feature in WordPress 6.5.\" class=\"wp-image-17147\" /></figure>\n\n\n\n<h3 class=\"wp-block-heading\">Davantage dinformations sur vos rvisions de styles</h3>\n\n\n\n<p>Travaillez sur vos projets de cration avec une vision plus complte de ce qui a t fait et de ce sur quoi vous pouvez vous appuyer. Obtenez des dtails tels que l&rsquo;horodatage de chaque modification, des rsums rapides et une liste pagine avec toutes les rvisions enregistres. Consultez les rvisions du guide de styles pour voir les changements effectus. Des rvisions sont galement dsormais disponibles pour les modles et les lments de modles.</p>\n\n\n\n<figure class=\"wp-block-image size-large\"><img decoding=\"async\" src=\"https://wordpress.org/news/files/2024/03/Revisions-1024x666.png\" alt=\"A closer look at some of the comprehensive details now available for revisions. \" class=\"wp-image-17149\" /></figure>\n\n\n\n<h3 class=\"wp-block-heading\">Des nouveaux contrles de mise en page et de mise en forme</h3>\n\n\n\n<ul>\n<li>Contrlez les options de taille, de rptition et de point de focalisation afin dajouter un intrt visuel et cratif  vos mises en page.</li>\n\n\n\n<li>Rglez les proportions de taille dimage du bloc Bannire et ajoutez facilement des superpositions de couleurs se basant sur une couleur automatiquement extraite de limage choisie.</li>\n\n\n\n<li>En activant le support des ombres portes, vous pouvez crer des mises en page avec une profondeur visuelle ou ajouter un peu de personnalit  votre design.</li>\n</ul>\n\n\n\n<figure class=\"wp-block-image size-large\"><img decoding=\"async\" src=\"https://wordpress.org/news/files/2024/03/design-tools-1024x666.png\" alt=\"A stylized close up of setting a focal point on a minimalist background image featuring a pale blue sky and contrasting dark grey building. \" class=\"wp-image-17150\" /></figure>\n\n\n\n<h3 class=\"wp-block-heading\">Dcouvrez les nouvelles vues de donnes</h3>\n\n\n\n<p>Retrouvez et organisez vos donnes comme vous le souhaitez avec des vues de donnes pour les pages, les modles de pages, les compositions et les lments de modles. Affichez-les sous forme de tableau ou de grille avec la possibilit dafficher ou de masquer les champs et de faire des modifications groupes.</p>\n\n\n\n<figure class=\"wp-block-image size-large\"><img decoding=\"async\" src=\"https://wordpress.org/news/files/2024/03/Data-Views-1024x666.png\" alt=\"A snapshot of the UI that lets you choose your data view. \" class=\"wp-image-17151\" /></figure>\n\n\n\n<h3 class=\"wp-block-heading\">Un glisser-dposer plus fluide</h3>\n\n\n\n<p>Vous verrez la diffrence lorsque vous dplacerez des lments, grce  des indices visuels utiles tels que les objets immdiatement dplacs dans la vue liste ou le glissement fluide vers nimporte quel endroit de votre espace de travail.</p>\n\n\n\n<figure class=\"wp-block-image size-large\"><img decoding=\"async\" src=\"https://wordpress.org/news/files/2024/03/drag-and-drop-1024x666.png\" alt=\"\" class=\"wp-image-17152\" /></figure>\n\n\n\n<h3 class=\"wp-block-heading\">Amlioration des rglages des liens</h3>\n\n\n\n<p>Crez et grez facilement les liens avec une exprience de gestion plus intuitive&nbsp;: une interface dutilisation simplifie et un raccourci pour copier les liens.</p>\n\n\n\n<figure class=\"wp-block-image size-large\"><img decoding=\"async\" src=\"https://wordpress.org/news/files/2024/03/ink-controls-1024x666.png\" alt=\"\" class=\"wp-image-17153\" /></figure>\n\n\n\n<h2 class=\"wp-block-heading\">Quelques nouveauts pour le dveloppement sur WP&nbsp;6.5</h2>\n\n\n\n<h3 class=\"wp-block-heading\">Ajoutez des interactions aux blocs avec lAPI de gestion des interactions</h3>\n\n\n\n<p>LAPI de gestion des interactions offre aux dveloppeurs et dveloppeuses une mthode norme pour construire des expriences dinterfaces interactives avec des blocs. Elle simplifie le processus en rduisant les dpendances  des outils externes, tout en conservant des performances optimales. Utilisez-la pour crer des expriences utilisateur mmorables, par exemple en rcuprant instantanment les rsultats de recherche ou en permettant aux internautes dinteragir avec le contenu en temps rel.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Connectez les blocs aux champs personnaliss ou autres contenus dynamiques</h3>\n\n\n\n<p>Liez les attributs des blocs de base aux champs personnaliss et utilisez la valeur des champs personnaliss sans crer de blocs personnaliss. Grce  lAPI &nbsp;Block Bindings&nbsp;, les dveloppeurs/dveloppeuses peuvent tendre cette fonctionnalit en liant les blocs  nimporte quel contenu dynamique, mme au-del des champs personnaliss. Si des donnes sont stockes ailleurs, les blocs peuvent facilement pointer vers cette nouvelle source en quelques lignes de code seulement.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Ajoutez les outils de gestion de lapparence aux thmes classiques</h3>\n\n\n\n<p>Amliorez lexprience de conception des designers et crateurs utilisant des thmes classiques. Optez pour cela pour lactivation du support des options despacement, de bordure, de typographie et de couleur, mme sans utiliser theme.json. Une fois le support activ, plus doutils seront automatiquement ajouts au fur et  mesure de leur disponibilit.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Dcouvrez les amliorations de lexprience de gestion des extensions</h3>\n\n\n\n<p>Il existe  prsent un moyen plus simple de grer les dpendances des extensions. Les auteurs et les autrices dextensions peuvent fournir un nouvel en-tte&nbsp;<code>Requires Plugins</code>&nbsp;avec la liste des slugs, spars par des virgules, des extensions ncessaires donnant aux utilisateurs et utilisatrices, des liens pour installer et activer ces extensions au pralable.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Amliorations des performances</h3>\n\n\n\n<p>Cette version comprend plus de 110 amliorations de performance, avec une augmentation impressionnante de la vitesse et de lefficacit de lditeur de bloc et lditeur de site. Le chargement, la saisie et la navigation dans lditeur de site sont deux fois plus rapides que sur la version 6.4.</p>\n\n\n\n<p>Les sites traduits bnficient dune amlioration de 25% de leur temps de chargement sur cette version.</p>\n\n\n\n<p>Le support du format dimages AVIF a aussi t ajout.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Amliorations de laccessibilit</h3>\n\n\n\n<p>Cette version comprend plus de 65 amliorations en matire daccessibilit sur toute la plateforme, la rendant plus accessible que jamais. Cette mise  jour apporte des corrections aux rglages de contraste,  la focalisation du curseur, aux sous-menus et au positionnement des lments, parmi bien dautres, qui aident  amliorer lexprience WordPress pour tout le monde.</p>\n\n\n\n<h2 class=\"wp-block-heading\">En savoir plus sur WordPress 6.5</h2>\n\n\n\n<p>Explorez le&nbsp;<a href=\"https://fr.wordpress.org/2024/03/16/guide-des-changements-techniques-de-wordpress-6-5/\">Guide des changements techniques de WordPress 6.5</a> pour dcouvrir les changements de cette version avec les notes dtailles des dveloppeurs et dveloppeuses qui vous aident  construire avec WordPress.</p>\n\n\n\n<p>Vous pouvez suivre le <a href=\"https://developer.wordpress.org/news/\">blog daide au dveloppement avec WordPress (en anglais)</a> pour suivre l&rsquo;volution technique de WordPress et consulter des tutoriels sur les fonctionnalits du CMS.</p>\n\n\n\n<p><a href=\"https://learn.wordpress.org/\"><em>Learn WordPress</em></a>&nbsp;est une ressource gratuite pour les personnes qui utilisent WordPress, quelles soient dbutantes ou exprimentes.&nbsp;<em>Learn</em>&nbsp;contient des vidos pratiques sur lutilisation de diverses fonctionnalits de WordPress, des&nbsp;<a href=\"https://learn.wordpress.org/online-workshops/\">vnements interactifs</a>&nbsp;pour explorer des sujets en profondeur, et des plans de cours pour approfondir des domaines spcifiques de WordPress.</p>\n\n\n\n<p>Pour plus dinformations techniques sur WordPress 6.5 comme par exemple les fichiers modifis, les mises  jour de paquets ou les bugs corrigs consultez la <a href=\"https://wordpress.org/documentation/wordpress-version/version-6-5/\">notice technique de WP&nbsp;6.5 (en anglais)</a>.</p>\n\n\n\n<h2 class=\"wp-block-heading\">Lquipe de direction de WordPress&nbsp;6.5</h2>\n\n\n\n<p>Voici lquipe qui a coordonn le dveloppement et la sortie de cette nouvelle version de WordPress&nbsp;:</p>\n\n\n\n<ul>\n<li>Direction gnrale&nbsp;: <a href=\"https://profiles.wordpress.org/matt/\">Matt Mullenweg</a></li>\n\n\n\n<li>Coordination gnrale&nbsp;: <a href=\"https://profiles.wordpress.org/akshayar/\">Akshaya Rane</a>, <a href=\"https://profiles.wordpress.org/priethor/\">Hctor Prieto</a> et <a href=\"https://profiles.wordpress.org/marybaum/\">Mary Baum</a></li>\n\n\n\n<li>Direction technique ct Cur&nbsp;: <a href=\"https://profiles.wordpress.org/davidbaumwald/\">David Baumwald</a> et <a href=\"https://profiles.wordpress.org/swissspidy/\">Pascal Birchler</a></li>\n\n\n\n<li>Direction technique ct Gutenberg&nbsp;: <a href=\"https://profiles.wordpress.org/get_dave/\">David Smith</a> et <a href=\"https://profiles.wordpress.org/youknowriad/\">Riad Benguella</a></li>\n\n\n\n<li>Gestion de projet technique ct Cur&nbsp;: <a href=\"https://profiles.wordpress.org/chaion07/\">Ahmed Kabir Chaion</a>, <a href=\"https://profiles.wordpress.org/audrasjb/\">Jb Audras</a> et <a href=\"https://profiles.wordpress.org/rajinsharwar/\">Rajin Sharwar</a></li>\n\n\n\n<li>Gestion de projet technique ct Gutenberg&nbsp;: <a href=\"https://profiles.wordpress.org/annezazu/\">Anne McCarthy</a> et <a href=\"https://profiles.wordpress.org/fabiankaegy/\">Fabian Kgy</a></li>\n\n\n\n<li>Direction du design&nbsp;: <a href=\"https://profiles.wordpress.org/benjamin_zekavica/\">Benjamin Zekavica</a> et <a href=\"https://profiles.wordpress.org/richtabor/\">Rich Tabor</a></li>\n\n\n\n<li>Direction marketing et communication&nbsp;: <a href=\"https://profiles.wordpress.org/dansoschin/\">Dan Soschin</a> et <a href=\"https://profiles.wordpress.org/laurlittle/\">Lauren Stein</a></li>\n\n\n\n<li>Responsable de la documentation&nbsp;: <a href=\"https://profiles.wordpress.org/estelaris/\">Estela Rueda</a>, <a href=\"https://profiles.wordpress.org/leonnugraha/\">Leonardus Nugraha</a> et <a href=\"https://profiles.wordpress.org/stevenlinx/\">Steven Lin</a></li>\n\n\n\n<li>Responsables des performances&nbsp;: <a href=\"https://profiles.wordpress.org/joemcgill/\">Joe McGill</a> et <a href=\"https://profiles.wordpress.org/mukesh27/\">Mukesh Panchal</a></li>\n\n\n\n<li>Responsables des tests&nbsp;: <a href=\"https://profiles.wordpress.org/oglekler/\">Olga Gleckler</a>, <a href=\"https://profiles.wordpress.org/lumiblog/\">Patrick Lumumba</a> et <a href=\"https://profiles.wordpress.org/vipuljnext/\">Vipul Ghori</a></li>\n\n\n\n<li>Responsable des thmes natifs&nbsp;: <a href=\"https://profiles.wordpress.org/poena/\">Carolina Nymark</a></li>\n</ul>\n\n\n\n<h2 class=\"wp-block-heading\">Merci aux contributeurs et contributrices</h2>\n\n\n\n<p>WordPress 6.5 naurait pas pu sortir sans la contribution passionne de <strong>702 personnes provenant dau moins 57 pays diffrents</strong> et de <strong>plus de 200 entreprises</strong>.</p>\n\n\n\n<p>Un remerciement tout spcial pour les 702 personnes qui ont contribu au cur de WordPres