://profiles.wordpress.org/viliamkopecky/\">viliamkopecky</a>  <a href=\"https://profiles.wordpress.org/vipuljnext/\">Vipul Ghori</a>  <a href=\"https://profiles.wordpress.org/vivekawsm/\">vivekawsm</a>  <a href=\"https://profiles.wordpress.org/vladimiraus/\">vladimiraus</a>  <a href=\"https://profiles.wordpress.org/vortfu/\">vortfu</a>  <a href=\"https://profiles.wordpress.org/vrajadas/\">Vraja Das</a>  <a href=\"https://profiles.wordpress.org/wasiur195/\">Wasiur Rahman</a>  <a href=\"https://profiles.wordpress.org/welaunchio/\">welaunchio</a>  <a href=\"https://profiles.wordpress.org/westonruter/\">Weston Ruter</a>  <a href=\"https://profiles.wordpress.org/whsajid/\">WHSajid</a>  <a href=\"https://profiles.wordpress.org/wpcorner/\">WP Corner</a>  <a href=\"https://profiles.wordpress.org/xlthlx/\">xlthlx</a>  <a href=\"https://profiles.wordpress.org/yansern/\">Yan Sern</a>  <a href=\"https://profiles.wordpress.org/yguyon/\">Yannis Guyon</a>  <a href=\"https://profiles.wordpress.org/fierevere/\">Yui</a>  <a href=\"https://profiles.wordpress.org/yuliyan/\">Yuliyan Slavchev</a>  <a href=\"https://profiles.wordpress.org/yuvrajsinh2211/\">Yuvrajsinh Sisodiya</a>  <a href=\"https://profiles.wordpress.org/tollmanz/\">Zack Tollman</a>  <a href=\"https://profiles.wordpress.org/zanematthew/\">Zane Matthew</a>  <a href=\"https://profiles.wordpress.org/zieladam/\">zieladam</a>  <a href=\"https://profiles.wordpress.org/zunaid321/\">Zunaid Amin</a>  <a href=\"https://profiles.wordpress.org/chesio/\">eslav Przywara</a></p>\n\n\n\n<h3 class=\"wp-block-heading\">Merci aux personnes ayant contribu  traduire WordPress&nbsp;6.5 en franais</h3>\n\n\n\n<p>WordPress est un projet international et la version 6.5 est dj compltement disponible dans plus de 70 langues diffrentes.</p>\n\n\n\n<p>Nous souhaitons remercier ici les personnes ayant particip  la traduction de WordPress 6.5 en franais&nbsp;:</p>\n\n\n\n<p class=\"has-black-color has-text-color has-background has-link-color has-small-font-size wp-elements-8cdcb5afade623b468d619641b760664\" style=\"background:linear-gradient(150deg,rgb(207,202,190) 0%,rgb(234,233,231) 100%)\"><a href=\"https://profiles.wordpress.org/jdy68\">Jenny Dupuy</a>, <a href=\"https://profiles.wordpress.org/wolforg\">Didier Demory</a>, <a href=\"https://profiles.wordpress.org/audrasjb\">Jb Audras</a>, <a href=\"https://profiles.wordpress.org/fxbenard\">fxbenard</a>, <a href=\"https://profiles.wordpress.org/xibe\">Xavier Borderie</a>, <a href=\"https://profiles.wordpress.org/beryldlg\">BryldeLaGrandire</a>, <a href=\"https://profiles.wordpress.org/bonaldi\">Bonaldi</a>, <a href=\"https://profiles.wordpress.org/btpub\">BrunoTritsch</a>, <a href=\"https://profiles.wordpress.org/cauzyolo\">cauzyolo</a>, <a href=\"https://profiles.wordpress.org/charlie67p\">charlie67p</a>, <a href=\"https://profiles.wordpress.org/clementpolito\">ClmentPolito</a>, <a href=\"https://profiles.wordpress.org/coralietixeront\">coralietixeront</a>, <a href=\"https://profiles.wordpress.org/ebrockway\">EBrockway</a>, <a href=\"https://profiles.wordpress.org/milouze\">Emil1</a>, <a href=\"https://profiles.wordpress.org/emlebrun\">Emilie LEBRUN</a>, <a href=\"https://profiles.wordpress.org/scoco\">EmilienM.</a>, <a href=\"https://profiles.wordpress.org/frmo\">Frmo</a>, <a href=\"https://profiles.wordpress.org/gaeldenysiak\">GaelDenysiak</a>, <a href=\"https://profiles.wordpress.org/gaellebesson\">gaellebesson</a>, <a href=\"https://profiles.wordpress.org/wplmillet\">LaurentMILLET</a>, <a href=\"https://profiles.wordpress.org/webaxones\">LocAntignac</a>, <a href=\"https://profiles.wordpress.org/oellin\">Magali</a>, <a href=\"https://profiles.wordpress.org/nuryko\">Marianna</a>, <a href=\"https://profiles.wordpress.org/marineevain\">Marine EVAIN</a>, <a href=\"https://profiles.wordpress.org/maxpertici\">MaximePertici</a>, <a href=\"https://profiles.wordpress.org/nandow\">nandow</a>, <a href=\"https://profiles.wordpress.org/nicolasricher\">NicolasRicher</a>, <a href=\"https://profiles.wordpress.org/mrbalou06\">Pascal T</a>, <a href=\"https://profiles.wordpress.org/nekojonez\">Pieterjan Deneys</a>, <a href=\"https://profiles.wordpress.org/larrach\">RachelPeter</a>, <a href=\"https://profiles.wordpress.org/spaceshipone\">Timothe Brosille</a>, <a href=\"https://profiles.wordpress.org/tobifjellner\">tobifjellner(Tor-Bjorn Fjellner)</a>, <a href=\"https://profiles.wordpress.org/virgar\">VirginieGarnier</a> et<a href=\"https://profiles.wordpress.org/whaze\">whaze</a>.</p>\n\n\n\n<p>Nhsitez pas &nbsp;<a href=\"https://fr.wordpress.org/team/handbook/\">rejoindre les quipes de contribution francophones&nbsp;!</a></p>\n\n\n\n<hr class=\"wp-block-separator has-alpha-channel-opacity\" />\n\n\n\n<p class=\"has-small-font-size\">Article publi par&nbsp;<a href=\"https://profiles.wordpress.org/audrasjb/\">Jb Audras</a>. Merci  <a href=\"https://profiles.wordpress.org/jdy68/\">Jenny Dupuy</a> pour sa relecture.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:57:\"\n		\n		\n		\n		\n		\n				\n		\n\n					\n										\n					\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"Guide des changements techniques de WordPress6.5\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:86:\"https://fr.wordpress.org/2024/03/16/guide-des-changements-techniques-de-wordpress-6-5/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 16 Mar 2024 00:04:09 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Nouvelles versions de WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=2999\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:399:\"Ce guide dcrit les principaux changements techniques que vous trouverez sur WordPress&#160;6.5, dont la sortie est prvue le 26 mars 2024. Sur Trac (l&#8217;outil de tickets utiliss par le cur de WordPress, environ 344 tickets on t clturs&#160;: 99 d&#8217;entre eux concernent des amliorations et des nouvelles fonctionnalits, 210 concernent des corrections de bugs, et [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:31466:\"\n<p class=\"has-very-light-gray-to-cyan-bluish-gray-gradient-background has-background\">Ce guide dcrit les principaux changements techniques que vous trouverez sur WordPress&nbsp;6.5, dont la sortie est prvue le 26 mars 2024.</p>\n\n\n\n<p>Sur Trac (l&rsquo;outil de tickets utiliss par le cur de WordPress, environ <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;milestone=6.5&amp;group=component&amp;col=id&amp;col=summary&amp;col=owner&amp;col=type&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\" target=\"_blank\" rel=\"noreferrer noopener\">344 tickets</a> on t clturs&nbsp;: <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=enhancement&amp;type=feature+request&amp;milestone=6.5&amp;max=500&amp;col=id&amp;col=summary&amp;col=type&amp;col=status&amp;col=milestone&amp;col=owner&amp;col=priority&amp;order=priority\" target=\"_blank\" rel=\"noreferrer noopener\">99 d&rsquo;entre eux concernent des amliorations et des nouvelles fonctionnalits</a>, <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=defect+(bug)&amp;milestone=6.5&amp;max=500&amp;col=id&amp;col=summary&amp;col=type&amp;col=status&amp;col=milestone&amp;col=owner&amp;col=priority&amp;order=priority\" target=\"_blank\" rel=\"noreferrer noopener\">210 concernent des corrections de bugs</a>, et <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=task+(blessed)&amp;milestone=6.5&amp;max=500&amp;col=id&amp;col=summary&amp;col=type&amp;col=status&amp;col=milestone&amp;col=owner&amp;col=priority&amp;order=priority\" target=\"_blank\" rel=\"noreferrer noopener\">35 d&rsquo;autres tches diverses et varies</a>. Cette fois, il y a eu <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;focuses=~performance&amp;milestone=6.5&amp;group=component&amp;col=id&amp;col=summary&amp;col=status&amp;col=focuses&amp;col=owner&amp;col=type&amp;col=priority&amp;order=priority\" target=\"_blank\" rel=\"noreferrer noopener\">20 tickets qui se sont concentrs sur les performances</a>, <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;focuses=~accessibility&amp;milestone=6.5&amp;group=component&amp;col=id&amp;col=summary&amp;col=status&amp;col=focuses&amp;col=owner&amp;col=type&amp;col=priority&amp;order=priority\" target=\"_blank\" rel=\"noreferrer noopener\">19 sur l&rsquo;accessibilit</a> et <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;focuses=~coding-standards&amp;milestone=6.5&amp;group=component&amp;col=id&amp;col=summary&amp;col=status&amp;col=focuses&amp;col=owner&amp;col=type&amp;col=priority&amp;order=priority\" target=\"_blank\" rel=\"noreferrer noopener\">23 sur la modernisation du code source et sur l&rsquo;application des standards de programmation du CMS</a>.</p>\n\n\n\n<p>Les <a href=\"https://github.com/WordPress/gutenberg/commits/wp/6.5\">versions du projet Gutenberg inclues dans WP 6.5</a> contiennent 373 volutions, 515 corrections de bugs et 65 amliorations de l&rsquo;accessibilit.</p>\n\n\n\n<p>Les volutions apportes sur la version 6.5 s&rsquo;talent sur <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;milestone=6.5&amp;group=component&amp;col=id&amp;col=summary&amp;col=status&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=priority&amp;order=priority\">40 composants du cur WP</a>. Vous trouverez dans cet article une liste des changements les plus importants.</p>\n\n\n\n<p>Tous les liens de cet article pointent vers des notes de dveloppement rdiges en anglais. Lobjectif est de fournir un panorama gnral des changements techniques apports par cette version, en franais, puis de diriger les personnes qui souhaitent en savoir plus vers les notes de dveloppement en anglais.</p>\n\n\n\n<p>Pour en savoir plus sur la feuille de route et le calendrier de sortie de WP&nbsp;6.5, consultez cette page : <a href=\"https://make.wordpress.org/core/6-5/\">https://make.wordpress.org/core/6-5/</a></p>\n\n\n\n<h2 class=\"wp-block-heading has-black-color has-text-color has-link-color wp-elements-8cdcb5afade623b468d619641b760664\" id=\"high-impact-changes\">Prrequis techniques pour faire tourner WordPress&nbsp;6.5</h2>\n\n\n\n<p>La version minimale supporte de MySQL est passe de 5.0  5.5.5 (<a href=\"https://core.trac.wordpress.org/ticket/60036\">ticket #60036</a>).</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"tlSiCOHR47\"><a href=\"https://make.wordpress.org/core/2023/12/08/raising-the-minimum-version-of-mysql-required-in-wordpress-6-5/\">Raising the minimum version of MySQL required in WordPress 6.5</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Raising the minimum version of MySQL required in WordPress 6.5&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2023/12/08/raising-the-minimum-version-of-mysql-required-in-wordpress-6-5/embed/#?secret=RQN3EtHRSy#?secret=tlSiCOHR47\" data-secret=\"tlSiCOHR47\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\" id=\"major-features-dev-notes\">Fonctionnalits majeures apportes par WP&nbsp;6.5</h2>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"block-editor\">Changements concernant lditeur</h3>\n\n\n\n<p>WordPress 6.5 implmente 10 versions de Gutenberg&nbsp;: <a href=\"https://make.wordpress.org/core/2023/10/11/whats-new-in-gutenberg-16-8-11-october/\">16.8</a>, <a href=\"https://make.wordpress.org/core/2023/10/25/whats-new-in-gutenberg-16-9-25-october-2/\">16.9</a>, <a href=\"https://make.wordpress.org/core/2023/11/10/whats-new-in-gutenberg-17-0-9-november/\">17.0</a>, <a href=\"https://make.wordpress.org/core/2023/11/22/whats-new-in-gutenberg-17-1-22-november/\">17.1</a>, <a href=\"https://make.wordpress.org/core/2023/12/06/whats-new-in-gutenberg-17-2-6-december/\">17.2</a>, <a href=\"https://make.wordpress.org/core/2023/12/20/whats-new-in-gutenberg-17-3-20-december/\">17.3</a>, <a href=\"https://make.wordpress.org/core/2024/01/04/whats-new-in-gutenberg-17-4-03-january/\">17.4</a>, <a href=\"https://make.wordpress.org/core/2024/01/17/whats-new-in-gutenberg-17-5-17-january-2024/\">17.5</a>, <a href=\"https://make.wordpress.org/core/2024/01/31/whats-new-in-gutenberg-17-6-31-january/\">17.6</a> et <a href=\"https://make.wordpress.org/core/2024/02/14/whats-new-in-gutenberg-17-7-14th-february/\">17.7</a>. Vous trouverez de nouvelles fonctionnalits, de nouvelles API et de nombreuses amliorations comme par exemple l&rsquo;API de gestion des interactions, la bibliothque de polices ou l&rsquo;API <em><bdo lang=\"en\" dir=\"ltr\">Block Bindings</bdo></em> qui permet de charger dynamiquement du contenu dans les blocs.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"zTGJeIG79x\"><a href=\"https://make.wordpress.org/core/2024/03/04/interactivity-api-dev-note/\">Interactivity API in 6.5</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Interactivity API in 6.5&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2024/03/04/interactivity-api-dev-note/embed/#?secret=BP3bfBzPe0#?secret=zTGJeIG79x\" data-secret=\"zTGJeIG79x\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"aeHTn70nhm\"><a href=\"https://make.wordpress.org/core/2024/03/14/new-feature-font-library/\">New Feature: Font Library</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;New Feature: Font Library&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2024/03/14/new-feature-font-library/embed/#?secret=t8LR8aiZf0#?secret=aeHTn70nhm\" data-secret=\"aeHTn70nhm\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"wXhMjnlZWs\"><a href=\"https://make.wordpress.org/core/2024/03/06/new-feature-the-block-bindings-api/\">New Feature: The Block Bindings API</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;New Feature: The Block Bindings API&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2024/03/06/new-feature-the-block-bindings-api/embed/#?secret=9LDqQR1jOn#?secret=wXhMjnlZWs\" data-secret=\"wXhMjnlZWs\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"kSOEJXANFd\"><a href=\"https://make.wordpress.org/core/2024/03/04/block-metadata-viewscriptmodule-field-in-6-5/\">Block metadata viewScriptModule field in 6.5</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Block metadata viewScriptModule field in 6.5&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2024/03/04/block-metadata-viewscriptmodule-field-in-6-5/embed/#?secret=yRl8NrcZXE#?secret=kSOEJXANFd\" data-secret=\"kSOEJXANFd\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"fgr7Eh9WG0\"><a href=\"https://make.wordpress.org/core/2024/03/04/updates-to-block-hooks-in-6-5/\">Updates to Block Hooks in 6.5</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Updates to Block Hooks in 6.5&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2024/03/04/updates-to-block-hooks-in-6-5/embed/#?secret=xqHNQnC5pX#?secret=fgr7Eh9WG0\" data-secret=\"fgr7Eh9WG0\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"i7jW1A2sTY\"><a href=\"https://make.wordpress.org/core/2024/02/29/performance-improvements-for-registering-block-variations-with-callbacks/\">Performance improvements for registering block variations with callbacks</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Performance improvements for registering block variations with callbacks&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2024/02/29/performance-improvements-for-registering-block-variations-with-callbacks/embed/#?secret=wBSi3tRFIE#?secret=i7jW1A2sTY\" data-secret=\"i7jW1A2sTY\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"7oIfaxmlW9\"><a href=\"https://make.wordpress.org/core/2024/03/05/unification-of-the-site-and-post-editors-in-6-5/\">Unification of the site and post editors in 6.5</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Unification of the site and post editors in 6.5&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2024/03/05/unification-of-the-site-and-post-editors-in-6-5/embed/#?secret=1EIvfu7nj1#?secret=7oIfaxmlW9\" data-secret=\"7oIfaxmlW9\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"6EIPP73tAr\"><a href=\"https://make.wordpress.org/core/2024/03/09/miscellaneous-editor-changes-in-wordpress-6-5/\">Miscellaneous Editor changes in WordPress 6.5</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Miscellaneous Editor changes in WordPress 6.5&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2024/03/09/miscellaneous-editor-changes-in-wordpress-6-5/embed/#?secret=WtvUY2vLJl#?secret=6EIPP73tAr\" data-secret=\"6EIPP73tAr\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"html-api\">API processeur HTML</h3>\n\n\n\n<p>WordPress 6.5 apporte des changements significatifs de l&rsquo;API HTML. Le processeur de balises a reu une attention particulire et un plus grand nombre d&rsquo;lments HTML sont maintenant supports. Si vous utilisez la classe <code>WP_HTML_Tag_Processor</code>, alors il y a plusieurs changements dont vous devriez prendre connaissance.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"BN0e1F8yMe\"><a href=\"https://make.wordpress.org/core/2024/03/04/updates-to-the-html-api-in-6-5/\">Updates to the HTML API in 6.5</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Updates to the HTML API in 6.5&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2024/03/04/updates-to-the-html-api-in-6-5/embed/#?secret=ln9KARtfky#?secret=BN0e1F8yMe\" data-secret=\"BN0e1F8yMe\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"i18n\">Internationalisation</h3>\n\n\n\n<p><a href=\"https://wordpress.org/plugins/performant-translations/\" target=\"_blank\" rel=\"noreferrer noopener\">L&rsquo;extension &nbsp;<em><bdo lang=\"en\" dir=\"ltr\">Performant Translations</bdo></em> </a> a t intgre au cur de WordPress. Ce nouveau systme de gestion des traductions est bien plus rapide et bien moins gourmand en mmoire que l&rsquo;ancien, grce au nouveau format <code>.l10n.php</code>. Tous les formats disponibles restent supports&nbsp;: le nouveau format <code>.l10n.php</code>, mais aussi les formats classiques bass sur des fichiers <code>.mo</code> et <code>.po</code>. Deux nouveau filtres font leur entre dans le cur du CMS&nbsp;: <code>translation_file_format</code> et <code>load_translation_file</code>.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"KT4MEhfgP4\"><a href=\"https://make.wordpress.org/core/2024/02/27/i18n-improvements-6-5-performant-translations/\">I18N Improvements in 6.5 (Performant Translations)</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;I18N Improvements in 6.5 (Performant Translations)&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2024/02/27/i18n-improvements-6-5-performant-translations/embed/#?secret=fbxqrebUJq#?secret=KT4MEhfgP4\" data-secret=\"KT4MEhfgP4\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"media\">Gestion des mdias</h3>\n\n\n\n<p>La prise en charge du format d&rsquo;image AVIF a t ajoute dans WP 6.5. AVIF est un format moderne qui peut tre jusqu&rsquo; 50&nbsp;% moins lourd que JPEG, avec la mme qualit d&rsquo;image. Vous pouvez maintenant tlverser, modifier, redimensionner et enregistrer ce format d&rsquo;image, s&rsquo;il est pris en charge par votre hbergement web. La faon de travailler avec des fichiers AVIF reste la mme que pour les autres formats d&rsquo;images dj supports. En revanche si vous utilisez un rseau multisite il y a quelques spcificits  connatre. Nous vous conseillons dans ce cas de jeter un il  la FAQ disponible sur cette note de dveloppement.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"682RAd31H2\"><a href=\"https://make.wordpress.org/core/2024/02/23/wordpress-6-5-adds-avif-support/\">WordPress 6.5 adds AVIF support</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;WordPress 6.5 adds AVIF support&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2024/02/23/wordpress-6-5-adds-avif-support/embed/#?secret=dxdpDKfjp5#?secret=682RAd31H2\" data-secret=\"682RAd31H2\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"script-loader\">Chargement des ressources</h3>\n\n\n\n<p>L&rsquo;API de gestion des scripts apporte la prise en charge native des <em>Modules JavaScript</em> et fournit deux modules utilisables dans le cas de <a href=\"https://make.wordpress.org/core/2024/03/04/interactivity-api-dev-note/\">l&rsquo;API de gestion des interactions</a>.</p>\n\n\n\n<p>qu&rsquo;un</p>\n\n\n\n<p></p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"SDLOPVPvCc\"><a href=\"https://make.wordpress.org/core/2024/03/04/script-modules-in-6-5/\">Script Modules in 6.5</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Script Modules in 6.5&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2024/03/04/script-modules-in-6-5/embed/#?secret=vjQsNq4gMQ#?secret=SDLOPVPvCc\" data-secret=\"SDLOPVPvCc\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"upgrade-install\">Gestion des mises  jour</h3>\n\n\n\n<p><a href=\"https://wordpress.org/plugins/wp-plugin-dependencies/\">L&rsquo;extension <em><bdo lang=\"en\" dir=\"ltr\">Plugin Dependencies</bdo></em></a> fait enfin son entre dans le cur du CMS. Elle permet de grer les dpendances entre extensions, par exemple pour indiquer qu&rsquo;une extension dpend de l&rsquo;activation d&rsquo;une autre extension et d&rsquo;en informer les personnes charges de l&rsquo;administration du site directement sur l&rsquo;interface d&rsquo;admin.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"4svgv5uY7m\"><a href=\"https://make.wordpress.org/core/2024/03/05/introducing-plugin-dependencies-in-wordpress-6-5/\">Introducing Plugin Dependencies in WordPress 6.5</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Introducing Plugin Dependencies in WordPress 6.5&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2024/03/05/introducing-plugin-dependencies-in-wordpress-6-5/embed/#?secret=tPhoOCr57d#?secret=4svgv5uY7m\" data-secret=\"4svgv5uY7m\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<details class=\"wp-block-details is-layout-flow wp-block-details-is-layout-flow\"><summary>Plus d&rsquo;informations sur la gestion des dpendances d&rsquo;extensions (cliquer pour dplier le contenu)</summary>\n<p>Les dpendances d&rsquo;une extension peuvent tre dclares en utilisant le nouvel entte <code>Requires Plugins</code> sur le fichier principal de l&rsquo;extension. L&rsquo;entte doit contenir une liste de slugs d&rsquo;extensions spars par une virgule.</p>\n\n\n\n<p>Exemple&nbsp;:</p>\n\n\n\n<pre class=\"wp-block-code\"><code>/**<br> * Plugin Name: Ma super extension<br> * Requires Plugins: une-extension-cool, une-autre-extension<br> */</code></pre>\n\n\n\n<p>Conditions d&rsquo;utilisation&nbsp;:</p>\n\n\n\n<ul>\n<li>Les extensions hberges sur WordPress.org ne peuvent que dclarer des dpendances aussi hberges sur WordPress.org</li>\n\n\n\n<li>Les extensions qui ne sont pas hberges sur WordPress.org peuvent dclarer des dpendances hberges sur WordPress.org ou n&rsquo;importe o ailleurs</li>\n</ul>\n\n\n\n<p>La dclaration de dpendances ncessite de respecter les prrequis suivants&nbsp;:</p>\n\n\n\n<ul>\n<li>Pour les extensions dclarant une dpendance&nbsp;:\n<ul>\n<li>Elles ne peuvent pas tre installes avant que les dpendances ne soient installes</li>\n\n\n\n<li>Elles ne peuvent pas tre actives avant que les dpendances ne soient actives</li>\n</ul>\n</li>\n\n\n\n<li>Pour les extensions qui sont des dpendances d&rsquo;autres extensions&nbsp;:\n<ul>\n<li>Elles ne peuvent pas tre dsactives avant que les extensions qui en dpendent ne soient dsactives</li>\n\n\n\n<li>Elles ne peuvent pas tre supprimes tant que les extensions qui en dpendent sont toujours installes sur le site</li>\n</ul>\n</li>\n</ul>\n\n\n\n<p>Les fonctionnalits suivantes <strong>ne sont pas encore prises en charge</strong>&nbsp;:</p>\n\n\n\n<ul>\n<li>Gestion des versions</li>\n\n\n\n<li>Dclaration des extensions indispensables (&nbsp;<em><bdo lang=\"en\" dir=\"ltr\">Must-Use</bdo></em>&nbsp;, ou &nbsp;<em><bdo lang=\"en\" dir=\"ltr\">mu-plugins</bdo></em>&nbsp;) en tant que dpendances</li>\n\n\n\n<li>Thmes ncessitant des extensions spcifiques</li>\n\n\n\n<li>Dsactivation automatique des extensions dpendant d&rsquo;autres extensions qui ont t supprimes</li>\n</ul>\n\n\n\n<p>Un nouveau filtre <code>wp_plugin_dependencies_slug</code> a t introduit afin de permettre d&rsquo;altrer les slugs des dpendances.</p>\n\n\n\n<p>Une nouvelle classe PHP <code>WP_Plugin_Dependencies</code> a t introduite avec une API contenant plusieurs mthodes publiques.</p>\n\n\n\n<p>L&rsquo;interface de l&rsquo;cran de gestion des extensions a t modifie afin d&rsquo;afficher les dpendances des extensions. L&rsquo;interface des fiches des extensions qui sont dpendantes d&rsquo;autres extensions a t modifie pour afficher leurs dpendances, avec des liens vers des fentres modales pour les installer/activer en premier.</p>\n\n\n\n<p>La redirection automatique depuis l&rsquo;cran <strong>Extensions &gt; Ajouter</strong> n&rsquo;est plus disponible pour les dveloppeuses et dveloppeurs d&rsquo;extensions, qui ne pourront donc plus directement rediriger par exemple vers un cran de configuration aprs activation de leur extension depuis cet cran.</p>\n</details>\n\n\n\n<h2 class=\"wp-block-heading\" id=\"additional-changes\">Autres changements</h2>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"external-libraries\">Bibliothques tierces</h3>\n\n\n\n<p>Les bibliothques tierces suivantes ont t mises  jour&nbsp;:</p>\n\n\n\n<ul>\n<li>getID3 a t mises  jour vers la version 1.9.23 (<a href=\"https://core.trac.wordpress.org/ticket/59683\">ticket #59683</a>)</li>\n\n\n\n<li>PHPMailer a t mise  jour vers la version 6.9.1 (<a href=\"https://core.trac.wordpress.org/ticket/59966\">ticket #59966</a>)</li>\n\n\n\n<li><code>@wordpress/scripts</code> en version 17 arrte le support des versions de Node.js non maintenues. La plus vieille version de Node.js encore supporte est la version 18 (cf. note de dveloppement&nbsp;: <a href=\"https://make.wordpress.org/core/2024/03/09/miscellaneous-editor-changes-in-wordpress-6-5/\" data-type=\"link\" data-id=\"https://make.wordpress.org/core/2024/03/09/miscellaneous-editor-changes-in-wordpress-6-5/\" target=\"_blank\" rel=\"noreferrer noopener\"><bdo lang=\"en\" dir=\"ltr\">Misc Editor Dev Changes</bdo></a>)</li>\n</ul>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"themes\">Thmes</h3>\n\n\n\n<p>Les thmes classiques (non bass sur des blocs) peuvent maintenant proposer l&rsquo;accs aux outils d&rsquo;apparence (<a href=\"https://core.trac.wordpress.org/ticket/60118\">ticket #60118</a>).</p>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"media-1\">Bibliothque de mdias</h3>\n\n\n\n<p>La gestion des images JEPG progressives a t active. Un nouveau filtre <code>image_save_progressive</code> a t ajout, afin de contrler si les tailles d&rsquo;images intermdiaires sont enregistres en format progressif ou non (s&rsquo;il est disponible). Par dfaut, le rendu progressif est dsactiv, ce qui correspond au fonctionnement pass (<a href=\"https://core.trac.wordpress.org/ticket/21668\">ticket #21668</a>).</p>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"permalinks\">Permaliens</h3>\n\n\n\n<p>Prise en charge de la gestion des permaliens sur les serveurs <em>Caddy</em> (<a href=\"https://core.trac.wordpress.org/ticket/41877\">ticket #41877</a>).</p>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"rest-api\">API REST</h3>\n\n\n\n<p>Un champ <code>featured_media</code> pour les vignettes de publications a t ajout au point de terminaison <code>wp/v2/media</code> de lAPI REST (<a href=\"https://core.trac.wordpress.org/ticket/41692\">ticket #41692</a>).</p>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"site-health\">Sant du site</h3>\n\n\n\n<p>L&rsquo;identifiant du site courant a t ajout aux informations de dboguage pour les installations multisite (<a href=\"https://core.trac.wordpress.org/ticket/60081\">ticket #60081</a>).</p>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"upgrade-install-1\">Gestion des mises  jours</h3>\n\n\n\n<p>Lors des mises  jour multiples, une vrification des mises  jour des thmes est maintenant effectue afin de vrifier que le thme est bien compatible avec la version de WordPress et de PHP utilise. Cette vrification tait dj en place pour les extensions, mais pas encore pour les thmes (<a href=\"https://core.trac.wordpress.org/ticket/59758\">ticket #59758</a>).</p>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"miscellaneous-developer-changes\">Autres modifications</h3>\n\n\n\n<p>Consultez la note de dveloppement listant les autres modifications plus mineures sur WordPress&nbsp;6.5. Certaines modifications peuvent vous concerner.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"g7PUJV073d\"><a href=\"https://make.wordpress.org/core/2024/03/08/miscellaneous-developer-changes-in-wordpress-6-5/\">Miscellaneous developer changes in WordPress 6.5</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Miscellaneous developer changes in WordPress 6.5&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2024/03/08/miscellaneous-developer-changes-in-wordpress-6-5/embed/#?secret=Ho1X2giOH7#?secret=g7PUJV073d\" data-secret=\"g7PUJV073d\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\" id=\"new-modified-hooks\">Nouveaux filtres et crochets d&rsquo;action, ou modifications sur les <bdo lang=\"en\" dir=\"ltr\"><em>hooks</em></bdo> existants</h2>\n\n\n\n<p>Pour une liste complte de tous les filtres et crochets d&rsquo;actions modifis ou ajouts sur WP6.5, veuillez consulter le lien suivant (note : il ne sera disponible qu&rsquo;aprs la sortie de la version): <a href=\"https://developer.wordpress.org/reference/since/6.5.0/\">https://developer.wordpress.org/reference/since/6.5.0/</a></p>\n\n\n\n<h3 class=\"wp-block-heading\" id=\"new-filter-hooks\">Nouveaux filtres</h3>\n\n\n\n<ul>\n<li><code>new_admin_email_subject</code> (<a href=\"https://core.trac.wordpress.org/ticket/59250\">ticket #59250</a>)</li>\n\n\n\n<li><code>wp_is_rest_endpoint</code> (<a href=\"https://core.trac.wordpress.org/ticket/42061\">ticket #42061</a>)</li>\n\n\n\n<li><code>image_save_progressive</code> (<a href=\"https://core.trac.wordpress.org/ticket/21668\">ticket #21668</a>)</li>\n\n\n\n<li><code>wp_admin_canonical_url</code> (<a href=\"https://core.trac.wordpress.org/ticket/59545\">ticket #59545</a>)</li>\n\n\n\n<li><code>wp_plugin_dependencies_slug</code> (<a href=\"https://core.trac.wordpress.org/ticket/22316\">ticket #22316</a>)</li>\n\n\n\n<li><code>hooked_block</code> (<a href=\"https://core.trac.wordpress.org/ticket/59572\">ticket #59572</a>)</li>\n\n\n\n<li><code>hooked_block_{$block_type}</code> (<a href=\"https://core.trac.wordpress.org/ticket/59572\">ticket #59572</a>)</li>\n\n\n\n<li><code>get_block_type_variations</code> (<a href=\"https://core.trac.wordpress.org/ticket/59969\">ticket #59969</a>)</li>\n\n\n\n<li><code>translation_file_format</code> (<a href=\"https://core.trac.wordpress.org/ticket/59656\">ticket #59656</a>)</li>\n\n\n\n<li><code>load_translation_file</code> (<a href=\"https://core.trac.wordpress.org/ticket/59656\">ticket #59656</a>)</li>\n</ul>\n\n\n\n<p class=\"has-very-light-gray-to-cyan-bluish-gray-gradient-background has-background\">Que vous dveloppiez des thmes ou des extensions, pensez  tester et retester votre code pour vous assurer de sa compatibilit avec ces changements. Vous pouvez utiliser&nbsp;<a href=\"https://fr.wordpress.org/plugins/wordpress-beta-tester/\" target=\"_blank\" rel=\"noreferrer noopener\">lextension &nbsp;<em><bdo lang=\"en\" dir=\"ltr\">Beta Tester</bdo></em>&nbsp;</a>&nbsp;sur un site de test pour vrifier la compatibilit de vos dveloppements avec la version de test&nbsp;<a href=\"https://wordpress.org/news/2024/03/wordpress-6-5-release-candidate-2/\">WordPress 6.5&nbsp;<em><bdo lang=\"en\" dir=\"ltr\">Release Candidate</bdo></em>&nbsp;2</a>.&nbsp;Nous comptons sur vous pour vrifier que votre code fonctionne correctement avec le cur du CMS, pour le bien des millions dutilisateurs et utilisatrices de WordPress&nbsp;<img src=\"https://s.w.org/images/core/emoji/15.0.3/72x72/2665.png\" alt=\"\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p class=\"has-small-font-size\">Ce guide a t traduit et radapt  partir du<a href=\"https://make.wordpress.org/core/2024/03/15/wordpress-6-5-field-guide/\"><em><bdo lang=\"en\" dir=\"ltr\">Field Guide</bdo></em>de WP 6.5</a>par<a href=\"https://profiles.wordpress.org/audrasjb/\">Jb Audras</a>.<br>Merci  <a href=\"https://profiles.wordpress.org/altitudedev/\">Florian Prache</a> et <a href=\"https://profiles.wordpress.org/jdy68/\">Jenny Dupuy</a> pour leur relecture.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:60:\"\n		\n		\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:39:\"WordCamp Europe  Turin  Juin 2024\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"https://fr.wordpress.org/2023/12/26/wordcamp-europe-turin-juin-2024/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 26 Dec 2023 13:55:04 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:11:\"vnement\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:4:\"wceu\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=2952\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:363:\"Le prochain WordCamp Europe aura lieu du 13 au 15 juin  Turin en Italie. Nous vous invitons  vous y rendre pour rencontrer dautres personnes des communauts europennes et vivre une exprience intressante et enrichissante. Dailleurs, vous pouvez y participer de plusieurs manires, en tant que&#160;: Et si vous grez un meetup local et [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Jenny Dupuy\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:5769:\"\n<p>Le prochain <strong>WordCamp Europe</strong> aura lieu du <strong>13 au 15 juin  Turin en Italie</strong>. Nous vous invitons  vous y rendre pour rencontrer dautres personnes des communauts europennes et vivre une exprience intressante et enrichissante.</p>\n\n\n\n<div class=\"wp-block-group is-layout-constrained wp-block-group-is-layout-constrained\">\n<p>Dailleurs, vous pouvez y participer de plusieurs manires, en tant que&nbsp;:</p>\n\n\n\n<ul>\n<li><a href=\"https://europe.wordcamp.org/2024/volunteers/call-for-volunteers/\">bnvole</a> (date limite de candidature : 28 fvrier 2024)&nbsp;;</li>\n\n\n\n<li>ou <a href=\"https://europe.wordcamp.org/2024/sponsors/call-for-sponsors/\">sponsor</a>&nbsp;;</li>\n\n\n\n<li>ou <a href=\"https://europe.wordcamp.org/2024/media-partners/call-for-media-partners/\">partenaire de communication</a> (postulez jusquau 9 fvrier 2024)&nbsp;;</li>\n\n\n\n<li>ou encore comme <a href=\"https://europe.wordcamp.org/2024/speakers/call-for-speakers/\">orateur ou oratrice</a> (soumettez vos sujets de confrences jusquau 15 janvier 2024).</li>\n</ul>\n\n\n\n<figure class=\"wp-block-gallery has-nested-images columns-2 is-cropped wp-block-gallery-3 is-layout-flex wp-block-gallery-is-layout-flex\">\n<figure class=\"wp-block-image size-large is-style-default\"><a href=\"https://europe.wordcamp.org/2024/volunteers/call-for-volunteers/\"><img decoding=\"async\" width=\"1024\" height=\"538\" src=\"https://fr.wordpress.org/files/2023/12/Call-for-Volunteers-WC-Turin-1024x538.jpg\" alt=\"\" class=\"wp-image-2966\" srcset=\"https://fr.wordpress.org/files/2023/12/Call-for-Volunteers-WC-Turin-1024x538.jpg 1024w, https://fr.wordpress.org/files/2023/12/Call-for-Volunteers-WC-Turin-300x158.jpg 300w, https://fr.wordpress.org/files/2023/12/Call-for-Volunteers-WC-Turin-768x403.jpg 768w, https://fr.wordpress.org/files/2023/12/Call-for-Volunteers-WC-Turin.jpg 1200w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure>\n\n\n\n<figure class=\"wp-block-image size-large is-style-default\"><a href=\"https://europe.wordcamp.org/2024/sponsors/call-for-sponsors/\"><img decoding=\"async\" width=\"1024\" height=\"538\" src=\"https://fr.wordpress.org/files/2023/12/Call-for-Sponsors-WC-Turin-1024x538.png\" alt=\"\" class=\"wp-image-2964\" srcset=\"https://fr.wordpress.org/files/2023/12/Call-for-Sponsors-WC-Turin-1024x538.png 1024w, https://fr.wordpress.org/files/2023/12/Call-for-Sponsors-WC-Turin-300x158.png 300w, https://fr.wordpress.org/files/2023/12/Call-for-Sponsors-WC-Turin-768x403.png 768w, https://fr.wordpress.org/files/2023/12/Call-for-Sponsors-WC-Turin.png 1200w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure>\n\n\n\n<figure class=\"wp-block-image size-large is-style-default\"><a href=\"https://europe.wordcamp.org/2024/media-partners/call-for-media-partners/\"><img loading=\"lazy\" decoding=\"async\" width=\"1024\" height=\"538\" src=\"https://fr.wordpress.org/files/2023/12/Call-for-Media-Partners-WC-Turin-1024x538.jpg\" alt=\"\" class=\"wp-image-2963\" srcset=\"https://fr.wordpress.org/files/2023/12/Call-for-Media-Partners-WC-Turin-1024x538.jpg 1024w, https://fr.wordpress.org/files/2023/12/Call-for-Media-Partners-WC-Turin-300x158.jpg 300w, https://fr.wordpress.org/files/2023/12/Call-for-Media-Partners-WC-Turin-768x403.jpg 768w, https://fr.wordpress.org/files/2023/12/Call-for-Media-Partners-WC-Turin.jpg 1200w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure>\n\n\n\n<figure class=\"wp-block-image size-large is-style-default\"><a href=\"https://europe.wordcamp.org/2024/call-for-2025-host-city/\"><img loading=\"lazy\" decoding=\"async\" width=\"1024\" height=\"538\" src=\"https://fr.wordpress.org/files/2023/12/Call-for-Host-City-WC-Turin-1024x538.jpg\" alt=\"\" class=\"wp-image-2967\" srcset=\"https://fr.wordpress.org/files/2023/12/Call-for-Host-City-WC-Turin-1024x538.jpg 1024w, https://fr.wordpress.org/files/2023/12/Call-for-Host-City-WC-Turin-300x158.jpg 300w, https://fr.wordpress.org/files/2023/12/Call-for-Host-City-WC-Turin-768x403.jpg 768w, https://fr.wordpress.org/files/2023/12/Call-for-Host-City-WC-Turin.jpg 1200w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure>\n\n\n\n<figure class=\"wp-block-image size-large\"><a href=\"https://europe.wordcamp.org/2024/speakers/call-for-speakers/\"><img loading=\"lazy\" decoding=\"async\" width=\"1024\" height=\"538\" src=\"https://fr.wordpress.org/files/2023/12/Call-for-Speakers-WC-Turin-1024x538.jpg\" alt=\"\" class=\"wp-image-2962\" srcset=\"https://fr.wordpress.org/files/2023/12/Call-for-Speakers-WC-Turin-1024x538.jpg 1024w, https://fr.wordpress.org/files/2023/12/Call-for-Speakers-WC-Turin-300x158.jpg 300w, https://fr.wordpress.org/files/2023/12/Call-for-Speakers-WC-Turin-768x403.jpg 768w, https://fr.wordpress.org/files/2023/12/Call-for-Speakers-WC-Turin.jpg 1200w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure>\n</figure>\n\n\n\n<p>Et si vous grez un meetup local et souhaitez proposer votre ville comme <a href=\"https://europe.wordcamp.org/2024/call-for-2025-host-city/\">prochaine ville hte</a> pour le <strong>WordCamp Europe 2025</strong>, lappel  candidature est ouvert jusquau 14 fvrier 2024.</p>\n</div>\n\n\n\n<p>Concernant les confrences, <strong>lquipe organisatrice souhaite recevoir une grande varit de candidatures</strong>, y compris de personnes issues de groupes habituellement sous-reprsents, afin doffrir aux participants un programme diversifi. Notez quun programme de mentorat est disponible pour les personnes slectionnes qui le dsirent. Donc nhsitez pas  postuler&nbsp;!</p>\n\n\n\n<p>Au final, il vous suffit de choisir comment vous souhaitez participer  ce prochain WordCamp Europe via les liens proposs ci-dessus, et vous ne serez plus qu quelques clics de votre dpart pour Turin ! Lancez-vous, vous ne le regretterez pas</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:60:\"\n		\n		\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:3:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"Alerte au phishing usurpant lidentit de WordPress.org\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:91:\"https://fr.wordpress.org/2023/12/05/alerte-au-phishing-usurpant-lidentite-de-wordpress-org/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 05 Dec 2023 08:50:26 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:9:\"Securit\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:13:\"WordPress.org\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=2934\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:445:\"L&#8217;quipe de scurit de WordPress a t notifie d&#8217;une campagne de phishing (ou hameonnage) usurpant l&#8217;identit de comptes officiels WordPress.org. Ces campagnes de phishing utilisent comme nom d&#8217;expditeur WordPress Team ou WordPress Security Team et tentent de faire croire  l&#8217;existence d&#8217;une faille de scurit dans le cur du CMS, et renvoient vers un site [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:6698:\"\n<p>L&rsquo;quipe de scurit de WordPress a t notifie d&rsquo;une campagne de <em><bdo lang=\"en\" dir=\"ltr\">phishing</bdo></em> (ou hameonnage) usurpant l&rsquo;identit de comptes officiels WordPress.org.</p>\n\n\n\n<p>Ces campagnes de <bdo lang=\"en\" dir=\"ltr\"><em>phishing</em></bdo> utilisent comme nom d&rsquo;expditeur WordPress Team ou WordPress Security Team et tentent de faire croire  l&rsquo;existence d&rsquo;une faille de scurit dans le cur du CMS, et renvoient vers un site ressemblant au rpertoire d&rsquo;extensions WordPress.org, sur lequel se trouve une extension  tlcharger permettant de corriger la faille de scurit.</p>\n\n\n\n<p>Il s&rsquo;agit d&rsquo;une arnaque: l&rsquo;extension est une <em><bdo lang=\"en\" dir=\"ltr\">backdoor</bdo></em>, c&rsquo;est  dire qu&rsquo;elle installe une porte drobe permettant  une personne malveillante de se crer un compte d&rsquo;administration sur votre site. </p>\n\n\n\n<p class=\"has-background\" style=\"background-color:#ffecb7\"><strong>L&rsquo;quipe de scurit de WordPress n&rsquo;envoie jamais d&rsquo;<bdo lang=\"en\" dir=\"ltr\">e-mail</bdo> vous demandant d&rsquo;installer une extension ou un thme sur votre site, et ne vous demande jamais votre identifiant ni votre mot de passe.</strong></p>\n\n\n\n<p>Si vous recevez un <bdo lang=\"en\" dir=\"ltr\">e-mail</bdo> prtendant provenir de WordPress avec des instructions similaires  celles dcrites ci-dessus, ne tenez pas compte de celui-ci et indiquez si possible  votre fournisseur <bdo lang=\"en\" dir=\"ltr\">e-mail</bdo> qu&rsquo;il s&rsquo;agit d&rsquo;une escroquerie.</p>\n\n\n\n<p>Les <bdo lang=\"en\" dir=\"ltr\">e-mails</bdo> officiels du projet WordPress prsentent toujours les caractristiques suivantes:</p>\n\n\n\n<ul>\n<li>ils proviennent d&rsquo;un domaine <code>@wordpress.org</code> ou <code>@wordpress.net</code></li>\n\n\n\n<li>ils indiquent la mention <em><bdo lang=\"en\" dir=\"ltr\">Signed by: wordpress.org</bdo></em> dans la section des dtails de l&rsquo;<bdo lang=\"en\" dir=\"ltr\">e-mail</bdo></li>\n</ul>\n\n\n\n<p>L&rsquo;quipe de scurit de WordPress ne communique qu&rsquo;aux endroits suivants:</p>\n\n\n\n<ul>\n<li>le blog <bdo lang=\"en\" dir=\"ltr\">Making WordPress Secure</bdo> situ sur l&rsquo;URL <a href=\"https://make.wordpress.org/security\">make.wordpress.org/security</a></li>\n\n\n\n<li>le site principal <bdo lang=\"en\" dir=\"ltr\">WordPress News</bdo> situ sur les URLs <a href=\"https://wordpress.org/news\">wordpress.org/news</a> ou <a href=\"https://fr.wordpress.org/news/\">fr.wordpress.org/news</a> (pour les actualits en franais)</li>\n</ul>\n\n\n\n<p>L&rsquo;quipe de gestion des extensions WordPress ne communique jamais directement avec les personnes ayant install une extension, mais peut envoyer des <bdo lang=\"en\" dir=\"ltr\">e-mails</bdo> aux propritaires d&rsquo;extensions hberges sur WordPress.org. Ces courriels sont toujours envoys  partir de l&rsquo;adresse <code>plugins@wordpress.org</code> et sont signs, comme indiqu ci-dessus.</p>\n\n\n\n<p>Le dpt officiel des extensions WordPress est situ  l&rsquo;adresse <code>wordpress.org/plugins</code> avec des versions internationalises sur des sous-domaines pour chaque langue, tel que <code>fr.wordpress.org/plugins</code>. Un sous-domaine peut contenir un trait d&rsquo;union, mais un point apparatra toujours juste avant <code>wordpress.org</code>.</p>\n\n\n\n<p>WordPress tant le systme de gestion de contenu le plus utilis, ce type d&rsquo;escroquerie par hameonnage se produit occasionnellement. Prenez garde lorsque vous recevez un <bdo lang=\"en\" dir=\"ltr\">e-mail</bdo> vous proposant d&rsquo;installer un thme ou une extension, ou vous renvoyant vers un formulaire de connexion ressemblant au site officiel, il s&rsquo;agit potentiellement d&rsquo;une arnaque.</p>\n\n\n\n<p>Quelques captures d&rsquo;une des campagnes de hameonnage en cours de diffusion (cliquer sur les images pour les ouvrir dans un nouvel onglet):</p>\n\n\n\n<figure class=\"wp-block-image size-medium\"><a href=\"https://fr.wordpress.org/files/2023/12/c3bff9f57ed91503.png\" target=\"_blank\" rel=\"noreferrer noopener\"><img loading=\"lazy\" decoding=\"async\" width=\"300\" height=\"295\" src=\"https://fr.wordpress.org/files/2023/12/c3bff9f57ed91503-300x295.png\" alt=\"\" class=\"wp-image-2936\" srcset=\"https://fr.wordpress.org/files/2023/12/c3bff9f57ed91503-300x295.png 300w, https://fr.wordpress.org/files/2023/12/c3bff9f57ed91503.png 769w\" sizes=\"(max-width: 300px) 100vw, 300px\" /></a><figcaption class=\"wp-element-caption\">Capture d&rsquo;cran d&rsquo;un email d&rsquo;arnaque visant  vous renvoyer vers un faux rpertoire d&rsquo;extensions WordPress.org. On remarquera que WordPress est crit sans son P majuscule.</figcaption></figure>\n\n\n\n<figure class=\"wp-block-image size-medium\"><a href=\"https://fr.wordpress.org/files/2023/12/f2d09cf6f87d0af0.png\"><img loading=\"lazy\" decoding=\"async\" width=\"300\" height=\"249\" src=\"https://fr.wordpress.org/files/2023/12/f2d09cf6f87d0af0-300x249.png\" alt=\"\" class=\"wp-image-2937\" srcset=\"https://fr.wordpress.org/files/2023/12/f2d09cf6f87d0af0-300x249.png 300w, https://fr.wordpress.org/files/2023/12/f2d09cf6f87d0af0-768x638.png 768w, https://fr.wordpress.org/files/2023/12/f2d09cf6f87d0af0.png 830w\" sizes=\"(max-width: 300px) 100vw, 300px\" /></a><figcaption class=\"wp-element-caption\">Capture d&rsquo;cran du faux rpertoire d&rsquo;extensions: on remarquera qu&rsquo;outre la mauvaise criture de WordPress, l&rsquo;URL du site n&rsquo;est pas exactement celle de wordpress.org.</figcaption></figure>\n\n\n\n<figure class=\"wp-block-image size-medium\"><a href=\"https://fr.wordpress.org/files/2023/12/d48a53997052d445.png\" target=\"_blank\" rel=\"noreferrer noopener\"><img loading=\"lazy\" decoding=\"async\" width=\"300\" height=\"202\" src=\"https://fr.wordpress.org/files/2023/12/d48a53997052d445-300x202.png\" alt=\"\" class=\"wp-image-2938\" srcset=\"https://fr.wordpress.org/files/2023/12/d48a53997052d445-300x202.png 300w, https://fr.wordpress.org/files/2023/12/d48a53997052d445-1024x690.png 1024w, https://fr.wordpress.org/files/2023/12/d48a53997052d445-768x517.png 768w, https://fr.wordpress.org/files/2023/12/d48a53997052d445.png 1283w\" sizes=\"(max-width: 300px) 100vw, 300px\" /></a><figcaption class=\"wp-element-caption\">Le code contenu dans l&rsquo;extension propose au tlchargement permet en ralit de crer un compte d&rsquo;administration permettant  une personne tierce de prendre le contrle de votre site. </figcaption></figure>\n\n\n\n<p class=\"has-small-font-size\"><em>Source des captures d&rsquo;cran: @rmceoin@infosec.exchange</em></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"WordPress 6.4 Shirley\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"https://fr.wordpress.org/2023/11/07/wordpress-6-4-shirley/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"https://fr.wordpress.org/2023/11/07/wordpress-6-4-shirley/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 07 Nov 2023 20:00:13 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Nouvelles versions de WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=2892\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:111:\"Dcouvrez WordPress 6.4, nomme Shirley en l\'honneur de l\'artiste de jazz emblmatique Shirley Horn.\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:77605:\"\n<figure class=\"wp-block-image size-large\"><a href=\"https://fr.wordpress.org/files/2023/11/wp64-shirley.png\"><img loading=\"lazy\" decoding=\"async\" width=\"1024\" height=\"683\" src=\"https://fr.wordpress.org/files/2023/11/wp64-shirley-1024x683.png\" alt=\"\" class=\"wp-image-2924\" srcset=\"https://fr.wordpress.org/files/2023/11/wp64-shirley-1024x683.png 1024w, https://fr.wordpress.org/files/2023/11/wp64-shirley-300x200.png 300w, https://fr.wordpress.org/files/2023/11/wp64-shirley-768x512.png 768w, https://fr.wordpress.org/files/2023/11/wp64-shirley-1536x1024.png 1536w, https://fr.wordpress.org/files/2023/11/wp64-shirley.png 2048w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure>\n\n\n\n<p>Dcouvrez WordPress 6.4, nomme <strong>Shirley</strong> en l&rsquo;honneur de l&rsquo;artiste de jazz emblmatique <a href=\"https://fr.wikipedia.org/wiki/Shirley_Horn\">Shirley Horn</a>.</p>\n\n\n\n<p>Sa voix distinctive et sa connexion extraordinaire au piano l&rsquo;ont tablie comme l&rsquo;une des principales musiciennes de jazz de sa gnration. Le parcours de Shirley Horn, de la scne jazz de <bdo lang=\"en\" dir=\"ltr\">Washington D.C</bdo>.  la scne internationale, tmoigne de son dvouement et de sa persvrance. Son influence s&rsquo;est tendue bien au-del des limites du jazz traditionnel, brisant les frontires et inspirant les publics du monde entier.<br><br>Lanons <a href=\"https://www.youtube.com/channel/UCS3pUiY9OmzB6bPta3-4ArQ/playlists\">quelques tubes</a> de Shirley Horn et musique, apprenons en davantage sur cette nouvelle version majeure de WordPress.</p>\n\n\n\n<p>Chaque version de WordPress renforce votre libert crative, et WordPress 6.4 n&rsquo;y fait pas exception. Les nouvelles fonctionnalits et les amliorations apportes  ldition,  la conception et  lcriture de votre site permettent  vos ides de prendre forme de manire transparente. Amliorez la construction de votre site avec la flexibilit et la puissance de WordPress 6.4.</p>\n\n\n\n<blockquote class=\"wp-block-quote is-layout-flow wp-block-quote-is-layout-flow\">\n<p>La plupart des fonctionnalits et amliorations prsentes dans WordPress 6.4 appartiennent  la catgorie des volutions &nbsp;petites mais puissantes&nbsp;. En parallle de la belle flexibilit du nouveau thme <bdo lang=\"en\" dir=\"ltr\">Twenty Twenty-Four</bdo>, ces changements aideront les personnes crant du contenu ou dveloppant leurs propres fonctionnalits  gagner du temps pour se concentrer sur la valeur ajoute de leur cur de mtier.</p>\n<cite>Josepha Haden Chomphosy, Directrice excutive du projet <bdo lang=\"en\" dir=\"ltr\">open-source</bdo> WordPress.</cite></blockquote>\n\n\n\n<div class=\"wp-block-buttons is-layout-flex wp-block-buttons-is-layout-flex\">\n<div class=\"wp-block-button has-custom-font-size has-medium-font-size\"><a class=\"wp-block-button__link has-black-color has-text-color has-background has-link-color wp-element-button\" href=\"https://fr.wordpress.org/download/\" style=\"border-radius:0px;background:linear-gradient(150deg,rgb(207,202,190) 0%,rgb(234,233,231) 100%)\">Tlcharger WordPress 6.4</a></div>\n</div>\n\n\n\n<h2 class=\"wp-block-heading\">Les nouveauts de WordPress 6.4</h2>\n\n\n\n<h3 class=\"wp-block-heading\">Dcouvrez <bdo lang=\"en\" dir=\"ltr\">Twenty Twenty-Four</bdo></h3>\n\n\n\n<p>Dcouvrez les dernires avances en matire ddition de sites avec&nbsp;<a href=\"https://make.wordpress.org/core/2023/08/24/introducing-twenty-twenty-four/\">Twenty Twenty-Four</a>. Conu pour trois cas dutilisation distincts, la polyvalence du nouveau thme par dfaut en fait un choix idal pour presque tous les types de sites web. Plongez dans sa collection de modles et de compositions et ouvrez vous un monde de possibilits cratives en quelques ajustements.</p>\n\n\n\n<p>Gagnez en efficacit avec sa collection de <a href=\"https://2024.wordpress.net/index.php/patterns/\">35 modles de pages et compositions</a> et dbloquez en quelques clics tout un monde de possibilits cratives. La flexibilit remarquable de <bdo lang=\"en\" dir=\"ltr\">Twenty Twenty-Four</bdo> lui permet de s&rsquo;adapter  presque n&rsquo;importe quel type de site.</p>\n\n\n\n<div class=\"wp-block-buttons is-layout-flex wp-block-buttons-is-layout-flex\">\n<div class=\"wp-block-button has-custom-font-size has-medium-font-size\"><a class=\"wp-block-button__link has-black-color has-text-color has-background has-link-color wp-element-button\" href=\"http://2024.wordpress.net/\" style=\"border-radius:0px;background:linear-gradient(150deg,rgb(207,202,190) 0%,rgb(234,233,231) 100%)\">Voir la dmo de Twenty Twenty-Four</a></div>\n</div>\n\n\n\n<div style=\"height:20px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<figure class=\"wp-block-image\"><img decoding=\"async\" src=\"https://i0.wp.com/wordpress.org/news/files/2023/11/tt4.png?resize=1024%2C666&amp;ssl=1\" alt=\"Cropped screenshots of the Twenty Twenty-Four theme, showing its diverse use cases for photographers, bloggers, and small businesses.\" class=\"wp-image-16274\" /></figure>\n\n\n\n<h3 class=\"wp-block-heading\">Profitez des amliorations apportes  la rdaction de contenu</h3>\n\n\n\n<p>De&nbsp;<a href=\"https://make.wordpress.org/core/2023/10/05/core-editor-improvement-ensuring-excellence-in-the-writing-experience/\">nouvelles amliorations</a>&nbsp;garantissent la fluidit de votre parcours de cration de contenus. Vous trouverez de nouveaux raccourcis clavier dans la Vue en liste, une fusion de liste amliore et un meilleur contrle des rglages de lien. Une barre doutils remanie et cohrente pour les blocs Navigation, Liste et Citation vous permet de travailler efficacement avec les outils dont vous avez besoin.</p>\n\n\n\n<figure class=\"wp-block-image\"><img decoding=\"async\" src=\"https://i0.wp.com/wordpress.org/news/files/2023/11/writing.png?resize=1024%2C666&amp;ssl=1\" alt=\"Screenshot of a Quote block showing its improved toolbar and the text &quot;tudes has saved us thousands of hours of work and has unlock insights we never thought possible.&quot;\" class=\"wp-image-16275\" /></figure>\n\n\n\n<h3 class=\"wp-block-heading\">Obtenez plus de rsultats avec la palette de commandes</h3>\n\n\n\n<p>Profitez dun&nbsp;<a href=\"https://make.wordpress.org/core/2023/09/12/core-editor-improvement-commanding-the-command-palette/\">nouveau design et dun plus grand nombre de commandes (en anglais)</a>&nbsp;pour trouver ce que vous cherchez, effectuer des tches de manire efficace et gagner du temps lors de vos crations.</p>\n\n\n\n<figure class=\"wp-block-image\"><img decoding=\"async\" src=\"https://i0.wp.com/wordpress.org/news/files/2023/11/commands.png?resize=1024%2C666&amp;ssl=1\" alt=\"Screenshot of the refreshed UI of the Command Palette. It displays a search bar with the words &quot;Search for commands&quot; and a variety of shortcuts listed below, including &quot;Add new page,&quot; &quot;Preview in a new tab,&quot; and &quot;Patterns.&quot;\" class=\"wp-image-16276\" /></figure>\n\n\n\n<h3 class=\"wp-block-heading\">Catgorisez et filtrez les compositions</h3>\n\n\n\n<p>Organisez vos compositions synchronises ou standards (non synchronises) avec des catgories. Explorez le filtrage avanc dans la section Compositions de loutil dinsertion pour les retrouver plus intuitivement.</p>\n\n\n\n<figure class=\"wp-block-image\"><img decoding=\"async\" src=\"https://i0.wp.com/wordpress.org/news/files/2023/11/categorize-patterns-1.png?resize=1024%2C666&amp;ssl=1\" alt=\"Screenshot of the Site Editor\'s patterns view which shows a list of patterns with custom categories, such as &quot;About,&quot; &quot;Banners,&quot; and &quot;Call to Action,&quot; patterns.\" class=\"wp-image-16278\" /></figure>\n\n\n\n<h3 class=\"wp-block-heading\">Dveloppez votre crativit avec davantage doutils de conception</h3>\n\n\n\n<p>Faites preuve de crativit avec de nouvelles images darrire-plan dans les blocs Groupe et veillez  ce que les dimensions des images soient cohrentes avec les proportions de taille des espaces rservs.</p>\n\n\n\n<p>Vous souhaitez ajouter des boutons  votre bloc Navigation&nbsp;? Vous pouvez dsormais le faire en toute simplicit, sans CSS personnalis. Si vous travaillez avec des compositions synchronises, les rglages dalignement restent intacts pour une exprience de cration de compositions transparente.</p>\n\n\n\n<figure class=\"wp-block-image\"><img decoding=\"async\" src=\"https://i0.wp.com/wordpress.org/news/files/2023/11/design-tools.png?resize=1024%2C666&amp;ssl=1\" alt=\"Decorative image with text &quot;Background images in Group blocks.&quot;\" class=\"wp-image-16279\" /></figure>\n\n\n\n<h3 class=\"wp-block-heading\">Ajoutez un effet de visionneuse aux images</h3>\n\n\n\n<p>Activez la fonctionnalit visionneuse (en anglais <em><bdo lang=\"en\" dir=\"ltr\">lightbox</bdo></em>) pour des images interactives en plein cran dun simple clic. Appliquez-la globalement ou  des images spcifiques pour personnaliser lexprience de visualisation.</p>\n\n\n\n<figure class=\"wp-block-image\"><img decoding=\"async\" src=\"https://i0.wp.com/wordpress.org/news/files/2023/11/lightbox.png?resize=1024%2C666&amp;ssl=1\" alt=\"Decorative photo of a triangular building structure with a &quot;click to expand&quot; icon on the right top corner.\" class=\"wp-image-16280\" /></figure>\n\n\n\n<h3 class=\"wp-block-heading\">Renommez les blocs Groupe</h3>\n\n\n\n<p>Dfinissez des noms personnaliss pour vos blocs Groupe pour facilement organiser et diffrencier les parties de votre contenu. Ces noms seront visibles dans la Vue en liste.</p>\n\n\n\n<figure class=\"wp-block-image\"><img decoding=\"async\" src=\"https://i0.wp.com/wordpress.org/news/files/2023/11/rename.png?resize=1024%2C666&amp;ssl=1\" alt=\"Screenshot of the List View tool. It shows a Group block renamed as &quot;Hero Area&quot; with inner Group blocks also with custom names, such as &quot;Content,&quot; &quot;Images,&quot; and &quot;Call to action.&quot;\" class=\"wp-image-16281\" /></figure>\n\n\n\n<h3 class=\"wp-block-heading\">Prvisualisez les images depuis la vue en liste</h3>\n\n\n\n<p>Les nouveaux aperus des mdias pour les blocs Galerie et Image dans la vue en liste vous permettent de visualiser et de localiser dun coup dil les images de votre contenu.</p>\n\n\n\n<figure class=\"wp-block-image\"><img decoding=\"async\" src=\"https://i0.wp.com/wordpress.org/news/files/2023/11/list-view-images.png?resize=1024%2C666&amp;ssl=1\" alt=\"Screenshot of the List View tool, showing the new image previews for the Image and Gallery blocks.\" class=\"wp-image-16282\" /></figure>\n\n\n\n<h3 class=\"wp-block-heading\">Partagez des compositions entre sites</h3>\n\n\n\n<p>Besoin dutiliser vos compositions personnalises sur un autre site&nbsp;? Rien de plus simple&nbsp;! Importez et exportez-les sous forme de fichiers JSON  partir de la vue des compositions de lditeur de site.</p>\n\n\n\n<figure class=\"wp-block-image\"><img decoding=\"async\" src=\"https://i0.wp.com/wordpress.org/news/files/2023/11/exporting-patterns.png?resize=1024%2C666&amp;ssl=1\" alt=\"Screenshot showing the &quot;Import pattern from JSON files&quot; option from the Site Editor\'s patterns view.\" class=\"wp-image-16283\" /></figure>\n\n\n\n<h3 class=\"wp-block-heading\">Prsentation des crochets de bloc</h3>\n\n\n\n<p>Les <a href=\"https://make.wordpress.org/core/2023/10/15/introducing-block-hooks-for-dynamic-blocks/\">crochets de bloc (documentation technique en anglais)</a> sont une nouvelle fonctionnalit puissante qui permet aux extensions dinsrer automatiquement des blocs dans le contenu dun autre bloc. Il sagit de recommandations qui rendent votre travail avec les blocs plus intuitif. Un nouveau panneau &nbsp;Extensions&nbsp; vous permet de les adapter  vos besoins&nbsp; : ajoutez, supprimez et rorganisez les crochets de bloc  votre guise.</p>\n\n\n\n<figure class=\"wp-block-image\"><img decoding=\"async\" src=\"https://i0.wp.com/wordpress.org/news/files/2023/11/block-hooks.png?resize=1024%2C666&amp;ssl=1\" alt=\"Cropped screenshot showing a mini shopping cart (in a red dotted circle) inserted into a navigation menu by Block Hooks.\" class=\"wp-image-16284\" /></figure>\n\n\n\n<h3 class=\"wp-block-heading\">Performances</h3>\n\n\n\n<p>WordPress 6.4 comprend plus de 100 mises  jour de performances pour une exprience plus rapide et plus efficace. Les amliorations se concentrent sur les performances de chargement des modles pour les thmes bass sur des blocs et les thmes classiques, lutilisation des stratgies de chargement de script &nbsp;defer&nbsp; et &nbsp;async&nbsp; dans le cur, les blocs et les thmes, et loptimisation des options charges automatiquement.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Accessibilit</h3>\n\n\n\n<p>Chaque version sengage  rendre WordPress accessible  toutes et tous. La version 6.4 apporte des amliorations  laffichage en liste et la prise en charge de lattribut <code>aria-label</code> pour le bloc Navigation, parmi dautres points forts. Linterface dadministration inclut des amliorations dans le placement des boutons, le contexte des lments de menu permettant dajouter du contenu, et les messages affichs aux synthses vocales sur lcran de Sant du site.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Autres lments notables</h3>\n\n\n\n<ul>\n<li>Mme si WordPress 6.4 est compatible avec toutes les versions suprieures ou gales  PHP 7.0,  nous&nbsp;<a href=\"https://wordpress.org/news/2023/10/wordpress-6-4s-php-compatibility/\">recommendons d&rsquo;utiliser WordPress 6.4 avec PHP 8.1 ou 8.2 (en anglais)</a>.</li>\n\n\n\n<li>WordPress 6.4&nbsp;<a href=\"https://make.wordpress.org/core/2023/10/16/changes-to-attachment-pages/\">dsactivera maintenant les pages de fichiers attachs (communiqu en anglais)</a>&nbsp;pour toutes les nouvelles installations.</li>\n</ul>\n\n\n\n<h2 class=\"wp-block-heading\">En savoir plus sur WordPress&nbsp;6.4</h2>\n\n\n\n<p><a href=\"https://learn.wordpress.org/\">Learn WordPress</a>&nbsp;est une ressource gratuite pour les personnes qui utilisent WordPress, quelles soient dbutantes ou exprimentes.&nbsp;Learn&nbsp;contient des vidos pratiques sur lutilisation de diverses fonctionnalits de WordPress, des&nbsp;<a href=\"https://learn.wordpress.org/online-workshops/\">vnements interactifs</a>&nbsp;pour explorer des sujets en profondeur, et des plans de cours pour approfondir des domaines spcifiques de WordPress.</p>\n\n\n\n<p>Explorez le&nbsp;<a href=\"https://fr.wordpress.org/2023/10/30/guide-des-changements-techniques-de-wordpress-6-4/\">Guide des changements techniques de WordPress 6.4</a>. Dcouvrez les changements de cette version avec les notes dtailles des dveloppeurs et dveloppeuses qui vous aident  construire avec WordPress.</p>\n\n\n\n<p><a href=\"https://wordpress.org/support/wordpress-version/version-6-4/\">Lisez les notes de version de WordPress 6.4</a>&nbsp;pour obtenir des informations sur linstallation, les amliorations, les problmes corrigs, les contributeurs et contributrices de la version, les ressources dapprentissage et la liste des modifications apportes aux fichiers.</p>\n\n\n\n<h2 class=\"wp-block-heading\">Lquipe de direction de WordPress&nbsp;6.4</h2>\n\n\n\n<p>La version 6.4 de WordPress 6.4 a t dirige par une quipe entirement compose de personnes appartenant  des genres sous-reprsents dans le milieu &nbsp;tech&nbsp;, ce qui est une faon pour le projet WordPress de souligner l&rsquo;importance de donner une voix  la diversit dans l&rsquo;cosystme <bdo lang=\"en\" dir=\"ltr\">open-source</bdo>.</p>\n\n\n\n<p>Voici lquipe qui a coordonn le dveloppement et la sortie de cette nouvelle version de WordPress&nbsp;:</p>\n\n\n\n<ul>\n<li><strong>Direction gnrale&nbsp;:</strong>&nbsp;<a href=\"https://profiles.wordpress.org/chanthaboune/\">Josepha Haden Chomphosy</a></li>\n\n\n\n<li><strong>Coordination&nbsp;:</strong>&nbsp;<a href=\"https://profiles.wordpress.org/cbringmann/\">Chlo Bringmann</a>,&nbsp;<a href=\"https://profiles.wordpress.org/metalandcoffee/\">Ebonie Butler</a>,&nbsp;<a href=\"https://profiles.wordpress.org/akshayar/\">Akshaya Rane</a>,&nbsp;<a href=\"https://profiles.wordpress.org/francina/\">Francesca Marano</a>, avec l&rsquo;appui de <a href=\"https://profiles.wordpress.org/thewebprincess/\">Dee Teal</a>,&nbsp;<a href=\"https://profiles.wordpress.org/jaimieolmstead/\">Jaimie Olmstead</a>,&nbsp;<a href=\"https://profiles.wordpress.org/jyolsna/\">Jyolsna J E</a>,&nbsp;<a href=\"https://profiles.wordpress.org/marybaum/\">Mary Baum</a></li>\n\n\n\n<li><strong>Direction technique Cur&nbsp;:</strong>&nbsp;<a href=\"https://profiles.wordpress.org/mikeschroder/\">Mike Schroder</a>,&nbsp;<a href=\"https://profiles.wordpress.org/hellofromtonya/\">Tonya Mork</a>, avec l&rsquo;appui de&nbsp;<a href=\"https://profiles.wordpress.org/pypwalters/\">Stephanie Walters</a></li>\n\n\n\n<li><strong>Direction technique de lditeur de blocs&nbsp;:&nbsp;</strong><a href=\"https://profiles.wordpress.org/mikachan/\">Sarah Norris</a>,&nbsp;<a href=\"https://profiles.wordpress.org/siobhyb/\">Siobhan Bamber</a>,&nbsp;<a href=\"https://profiles.wordpress.org/karmatosed/\">Tammie Lister</a>, avec l&rsquo;appui de <a href=\"https://profiles.wordpress.org/68kheart/\">Devan Ferguson</a>,&nbsp;<a href=\"https://profiles.wordpress.org/battelfred/\">Frdrique Battel</a>,&nbsp;<a href=\"https://profiles.wordpress.org/jessicagoddard/\">Jessica Goddard</a>,&nbsp;<a href=\"https://profiles.wordpress.org/1happyplace/\">Katie Ayres</a>,&nbsp;<a href=\"https://profiles.wordpress.org/martatorre/\">Marta Torre</a>,&nbsp;<a href=\"https://profiles.wordpress.org/ngreennc/\">Nyasha Green</a>,&nbsp;<a href=\"https://profiles.wordpress.org/poojabhimani/\">Pooja Bhimani</a></li>\n\n\n\n<li><strong>Gestion de projet ct Cur WP&nbsp;:</strong>&nbsp;<a href=\"https://profiles.wordpress.org/nicolefurlan/\">Nicole Furlan</a>,&nbsp;<a href=\"https://profiles.wordpress.org/oglekler/\">Olga Gleckler</a></li>\n\n\n\n<li><strong>Gestion de projet ct diteur</strong>&nbsp;:&nbsp;<a href=\"https://profiles.wordpress.org/annezazu/\">Anne McCarthy</a>,&nbsp;<a href=\"https://profiles.wordpress.org/bph/\">Birgit Pauli-Haack</a>, avec l&rsquo;appui de&nbsp;<a href=\"https://profiles.wordpress.org/emilyatmobtown/\">Emily Leffler Schulman</a></li>\n\n\n\n<li><strong>Direction de la documentation&nbsp;:</strong>&nbsp;<a href=\"https://profiles.wordpress.org/webcommsat/\">Abha Thakor</a>,&nbsp;<a href=\"https://profiles.wordpress.org/femkreations/\">Femy Praseeth</a>,&nbsp;<a href=\"https://profiles.wordpress.org/611shabnam/\">Mushrit Shabnam</a>, avec l&rsquo;appui de <a href=\"https://profiles.wordpress.org/itsjustdj/\">D.J. Billings</a>,&nbsp;<a href=\"https://wordpress.org/support/users/codente/\">Jamie VanRaalte</a>,&nbsp;<a href=\"https://profiles.wordpress.org/newyorkerlaura/\">Laura Byrne</a>,&nbsp;<a href=\"https://profiles.wordpress.org/baxbridge/\">Tiffany Bridge</a>,&nbsp;<a href=\"https://profiles.wordpress.org/planningwrite/\">Winstina Hughes</a></li>\n\n\n\n<li><strong>Direction marketing et communications :</strong>&nbsp;<a href=\"https://profiles.wordpress.org/meher/\">Meher Bala</a>,&nbsp;<a href=\"https://profiles.wordpress.org/rmartinezduque/\">Reyes Martnez</a>,&nbsp;<a href=\"https://profiles.wordpress.org/sereedmedia/\">S Reed</a>, avec l&rsquo;appui de&nbsp;<a href=\"https://profiles.wordpress.org/meaganhanes/\">Meagan Hanes</a>,&nbsp;<a href=\"https://profiles.wordpress.org/michelleames/\">Michelle Frechette</a></li>\n\n\n\n<li><strong>Direction des tests&nbsp;:</strong>&nbsp;<a href=\"https://profiles.wordpress.org/webtechpooja/\">Pooja Derashri</a>, avec l&rsquo;appui de&nbsp;<a href=\"https://profiles.wordpress.org/annebovelett/\">Anne Bovelett</a>,&nbsp;<a href=\"https://profiles.wordpress.org/coachbirgit/\">Birgit Olzem</a></li>\n\n\n\n<li><strong>Direction artistique&nbsp;:</strong>&nbsp;<a href=\"https://profiles.wordpress.org/elmastudio/\">Ellen Bauer</a>,&nbsp;<a href=\"https://profiles.wordpress.org/estelaris/\">Estela Rueda</a>, avec l&rsquo;appui de&nbsp;<a href=\"https://profiles.wordpress.org/allisonplus/\">Allison Tarr</a>,&nbsp;<a href=\"https://profiles.wordpress.org/acirujano/\">Ana Cirujano</a>,&nbsp;<a href=\"https://profiles.wordpress.org/cathibosco1/\">Cathi Bosco</a>,&nbsp;<a href=\"https://profiles.wordpress.org/nudge/\">Sonia Gaballa</a>,&nbsp;<a href=\"https://profiles.wordpress.org/ohia/\">Ohia</a></li>\n\n\n\n<li><strong>Direction des performances&nbsp;:</strong>&nbsp;<a href=\"https://profiles.wordpress.org/clarkeemily/\">Emily Clarke</a>, avec l&rsquo;appui de <a href=\"https://profiles.wordpress.org/linsoftware/\">Linnea Huxford</a></li>\n\n\n\n<li><strong>Direction de l&rsquo;quipe formation&nbsp;:</strong>&nbsp;<a href=\"https://profiles.wordpress.org/courtneypk/\">Courtney P.K.</a>,&nbsp;<a href=\"https://profiles.wordpress.org/courane01/\">Courtney Roberston</a></li>\n\n\n\n<li><strong>Direction du design et du dveloppement du nouveau thme natif&nbsp;:</strong> <a href=\"https://profiles.wordpress.org/luminuu/\">Jessica Lyschik</a>,&nbsp;<a href=\"https://profiles.wordpress.org/onemaggie/\">Maggie Cabrera</a></li>\n</ul>\n\n\n\n<h2 class=\"wp-block-heading\">Merci aux contributeurs et contributrices</h2>\n\n\n\n<p>WordPress 6.4 naurait pas pu sortir sans la contribution passionne de <strong>plus de 600 personnes provenant dau moins 56 pays diffrents</strong>.</p>\n\n\n\n<p>Un remerciement tout spcial pour les 170 personnes qui ont contribu au cur de WordPress pour la premire fois avec WP&nbsp;6.4 <img src=\"https://s.w.org/images/core/emoji/15.0.3/72x72/2665.png\" alt=\"\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p class=\"has-black-color has-text-color has-background has-link-color wp-elements-8cdcb5afade623b468d619641b760664\" style=\"background:linear-gradient(150deg,rgb(207,202,190) 0%,rgb(234,233,231) 100%);font-size:11px\"><a href=\"https://profiles.wordpress.org/6adminit/\">6adminit</a>&nbsp;&nbsp;<a href=\"https://profiles.wordpress.org/aaroncampbell/\">Aaron D. Campbell</a>&nbsp;&nbsp;<a href=\"https://profiles.wordpress.org/jorbin/\">Aaron Jorbin</a>&nbsp;&nbsp;<a href=\"https://profiles.wordpress.org/aaronrobertshaw/\">Aaron Robertshaw</a>&nbsp;&nbsp;<a href=\"https://profiles.wordpress.org/aayusha/\">aayusha</a>&nbsp;&nbsp;<a href=\"https://profiles.wordpress.org/webcommsat/\">Abha Thakor</a>&nbsp;&nbsp;<a href=\"https://profiles.wordpress.org/omarabid/\">Abid Omar</a>&nbsp;&nbsp;<a href=\"https://profiles.wordpress.org/adamsilverstein/\">Adam Silverstein</a>&nbsp;&nbsp;<a href=\"https://profiles.wordpress.org/adhun/\">Adhun Anand</a>&nbsp;&nbsp;<a href=\"https://profiles.wordpress.org/ajmcfadyen/\">admcfajn</a>&nbsp;&nbsp;<a href=\"https://profiles.wordpress.org/adrianduffell/\">adrianduffell</a>&nbsp;&nbsp;<a href=\"https://profiles.wordpress.org/aegkr/\">aegkr</a>&nbsp;&nbsp;<a href=\"https://profiles.wordpress.org/ahardyjpl/\">ahardyjpl</a>&nbsp;&nbsp;<a href=\"https://profiles.wordpress.org/ahmedgeek/\">Ahmed Hussein</a>&nbsp;&nbsp;<a href=\"https://profiles.wordpress.org/chai