files.wordpress.org/jdy68\">Jenny Dupuy</a>, <a href=\"https://profiles.wordpress.org/xibe\">Xavier Borderie</a>, <a href=\"https://profiles.wordpress.org/antoinepaufichet\">Antoine Paufichet</a>, <a href=\"https://profiles.wordpress.org/maigret\">Aurlien Denis</a>, <a href=\"https://profiles.wordpress.org/beryldlg\">Bryl de La Grandire</a>, <a href=\"https://profiles.wordpress.org/bonaldi\">Bonaldi</a>, <a href=\"https://profiles.wordpress.org/btpub\">Bruno Tritsch</a>, <a href=\"https://profiles.wordpress.org/charlie67p\">charlie67p</a>, <a href=\"https://profiles.wordpress.org/clementpolito\">Clment Polito</a>, <a href=\"https://profiles.wordpress.org/coralietixeront\">coralietixeront</a>, <a href=\"https://profiles.wordpress.org/dacobah\">dacobah</a>, <a href=\"https://profiles.wordpress.org/milouze\">Emil1</a>, <a href=\"https://profiles.wordpress.org/emlebrun\">Emilie LEBRUN</a>, <a href=\"https://profiles.wordpress.org/scoco\">Emilien M.</a>, <a href=\"https://profiles.wordpress.org/este1\">este1</a>, <a href=\"https://profiles.wordpress.org/gaeldenysiak\">Gael Denysiak</a>, <a href=\"https://profiles.wordpress.org/guillaumeturpin\">Guillaume TURPIN</a>, <a href=\"https://profiles.wordpress.org/jaz_on\">Jason Rouet</a>, <a href=\"https://profiles.wordpress.org/leprincenoir\">Kantari Samy</a>, <a href=\"https://profiles.wordpress.org/wplmillet\">Laurent MILLET</a>, <a href=\"https://profiles.wordpress.org/webaxones\">Loc Antignac</a>, <a href=\"https://profiles.wordpress.org/oellin\">Magali</a>, <a href=\"https://profiles.wordpress.org/nuryko\">Marianna</a>, <a href=\"https://profiles.wordpress.org/chaton666\">Marie Comet</a>, <a href=\"https://profiles.wordpress.org/marineevain\">Marine EVAIN</a>, <a href=\"https://profiles.wordpress.org/maxpertici\">Maxime Pertici</a>, <a href=\"https://profiles.wordpress.org/nandow\">nandow</a>, <a href=\"https://profiles.wordpress.org/nelsj5r\">Nels</a>, <a href=\"https://profiles.wordpress.org/nicolasricher\">Nicolas Richer</a>, <a href=\"https://profiles.wordpress.org/larrach\">Rachel Peter</a>, <a href=\"https://profiles.wordpress.org/simonjanin\">Simon Janin</a>, <a href=\"https://profiles.wordpress.org/srossignol\">srossignol</a>, <a href=\"https://profiles.wordpress.org/spaceshipone\">Timothe Brosille</a>, <a href=\"https://profiles.wordpress.org/virgar\">Virginie Garnier</a> et <a href=\"https://profiles.wordpress.org/whaze\">whaze</a></p>\n\n\n\n<p>Nhsitez pas &nbsp;<a href=\"https://fr.wordpress.org/team/handbook/\">rejoindre les quipes de contribution francophones&nbsp;!</a></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:63:\"https://fr.wordpress.org/2023/11/07/wordpress-6-4-shirley/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:76:\"\n		\n		\n					\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"Guide des changements techniques de WordPress6.4\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:86:\"https://fr.wordpress.org/2023/10/30/guide-des-changements-techniques-de-wordpress-6-4/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:94:\"https://fr.wordpress.org/2023/10/30/guide-des-changements-techniques-de-wordpress-6-4/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 30 Oct 2023 22:30:28 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:5:\"Guide\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:31:\"Nouvelles versions de WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=2873\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:146:\"WordPress 6.4 sort dans une semaine! Ce guide des changements techniques vous aidera  vous prparer  cette nouvelle version majeure du CMS.\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:29437:\"\n<p>Ce guide dcrit les principaux changements techniques que vous trouverez sur WordPress&nbsp;6.4, dont la sortie est prvue le 7 novembre 2023.</p>\n\n\n\n<figure class=\"wp-block-image size-large\"><a href=\"https://fr.wordpress.org/files/2023/10/wp64-banniere-guide-changements-techniques.png\"><img loading=\"lazy\" decoding=\"async\" width=\"1024\" height=\"572\" src=\"https://fr.wordpress.org/files/2023/10/wp64-banniere-guide-changements-techniques-1024x572.png\" alt=\"\" class=\"wp-image-2874\" srcset=\"https://fr.wordpress.org/files/2023/10/wp64-banniere-guide-changements-techniques-1024x572.png 1024w, https://fr.wordpress.org/files/2023/10/wp64-banniere-guide-changements-techniques-300x168.png 300w, https://fr.wordpress.org/files/2023/10/wp64-banniere-guide-changements-techniques-768x429.png 768w, https://fr.wordpress.org/files/2023/10/wp64-banniere-guide-changements-techniques.png 1492w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure>\n\n\n\n<p><a href=\"https://make.wordpress.org/core/2023/06/05/wordpress-6-4-development-cycle/\">L&rsquo;quipe de direction de WordPress 6.4</a>&nbsp;et les contributrices et contributeurs du projet qui ont travaill sur cette version souhaitent mettre en valeur  travers ce guide les avances majeures proposes, parmi les <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;milestone=6.4&amp;group=component&amp;col=id&amp;col=summary&amp;col=owner&amp;col=type&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">284 tickets</a> traits, dont <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=enhancement&amp;type=feature+request&amp;milestone=6.4&amp;max=500&amp;col=id&amp;col=summary&amp;col=type&amp;col=status&amp;col=milestone&amp;col=owner&amp;col=priority&amp;order=priority\">113 correspondent  des amliorations et nouvelles fonctionnalits</a>, tandis que <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=defect+(bug)&amp;milestone=6.4&amp;max=500&amp;col=id&amp;col=summary&amp;col=type&amp;col=status&amp;col=milestone&amp;col=owner&amp;col=priority&amp;order=priority\">134 tickets sont des corrections de bugs</a>, auxquels s&rsquo;ajoutent <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=task+(blessed)&amp;milestone=6.4&amp;max=500&amp;col=id&amp;col=summary&amp;col=type&amp;col=status&amp;col=milestone&amp;col=owner&amp;col=priority&amp;order=priority\">21 tches diverses</a>.</p>\n\n\n\n<p>Cette version implmente par ailleurs <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;focuses=~performance&amp;milestone=6.4&amp;group=component&amp;col=id&amp;col=summary&amp;col=status&amp;col=focuses&amp;col=owner&amp;col=type&amp;col=priority&amp;order=priority\">64 tickets ayant un focus sur les performances</a> et <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;focuses=~accessibility&amp;milestone=6.4&amp;group=component&amp;col=id&amp;col=summary&amp;col=status&amp;col=focuses&amp;col=owner&amp;col=type&amp;col=priority&amp;order=priority\">17 sur l&rsquo;accessibilit</a>, tandis que <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;focuses=~coding-standards&amp;milestone=6.4&amp;group=component&amp;col=id&amp;col=summary&amp;col=status&amp;col=focuses&amp;col=owner&amp;col=type&amp;col=priority&amp;order=priority\">33 tickets sont lis  la modernisation du code du CMS</a>.</p>\n\n\n\n<p>Le projet Gutenberg inclut quant  lui plus de <a href=\"https://github.com/WordPress/gutenberg/commits/wp/6.4\">1400 <em>pull requests</em></a>, dont 420 correspondent  des amliorations, 445  des correctifs de bugs et 42  des amliorations de l&rsquo;accessibilit.</p>\n\n\n\n<p>Les modifications de WordPress 6.4 se rpartissent dans 45 composants <em>Core</em>, et vous trouverez dans ce communiqu les modifications les plus impactantes, composant par composant.</p>\n\n\n\n<p class=\"has-text-align-center has-white-color has-text-color has-background has-link-color wp-elements-a89acf0ff37db7c1f07fac7756d30da0\" style=\"background:linear-gradient(135deg,rgb(0,0,0) 0%,rgb(57,57,131) 100%)\">En route pour un petit tour dhorizon des<br>nouveauts techniques de WordPress&nbsp;6.4&nbsp;<img src=\"https://s.w.org/images/core/emoji/15.0.3/72x72/1f680.png\" alt=\"\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p>Tous les liens de cet article pointent vers des notes de dveloppement rdiges en anglais.</p>\n\n\n\n<p>Lobjectif est de fournir un panorama gnral des changements techniques apports par cette version, en franais, puis de diriger les personnes qui souhaitent en savoir plus vers les notes de dveloppement en anglais.</p>\n\n\n\n<p class=\"has-white-color has-text-color has-background has-link-color wp-elements-a89acf0ff37db7c1f07fac7756d30da0\" style=\"background:linear-gradient(135deg,rgb(0,0,0) 0%,rgb(57,57,131) 100%)\"> noter: certaines modifications listes ici vont ncessiter des actions de la part des auteurs et autrices de thmes et dextensions, qui devront adapter ou modifier leur code. Si cela vous concerne, veuillez lire consciencieusement les notes de dveloppement listes dans cet article afin de vous assurer que votre code fonctionnera avec WordPress6.4 lorsque cette version sortira le 7novembre 2023.</p>\n\n\n\n<h2 class=\"wp-block-heading\" id=\"Themes\">Changements sur lditeur de blocs</h2>\n\n\n\n<p>WordPress 6.4 implmente 6 versions de l&rsquo;extension Gutenberg&nbsp;: <a href=\"https://make.wordpress.org/core/2023/07/14/whats-new-in-gutenberg-16-2-12-july/\">16.2</a>, <a href=\"https://make.wordpress.org/core/2023/07/26/whats-new-in-gutenberg-16-3-26-july/\">16.3</a>, <a href=\"https://make.wordpress.org/core/2023/08/10/whats-new-in-gutenberg-16-4-9-august/\">16.4</a>, <a href=\"https://make.wordpress.org/core/2023/08/23/whats-new-in-gutenberg-16-5-23-august/\">16.5</a>, <a href=\"https://make.wordpress.org/core/2023/09/06/whats-new-in-gutenberg-16-6-06-september/\">16.6</a>, et <a href=\"https://make.wordpress.org/core/2023/09/28/whats-new-in-gutenberg-16-7-27-september/\">16.7</a>. Vous trouverez une nouvelle API <code>Block Hooks</code> pour filtrer vos blocs, la possibilit de dclarer vos propres catgories de mdias, des modifications sur le paquet <code>@wordpress/components</code>, des mises  jour des composants dinterface et de nombreuses autres modifications.</p>\n\n\n\n<p>L&rsquo;API&nbsp;<code>Block&nbsp;Hooks</code>&nbsp;(<a href=\"https://github.com/WordPress/gutenberg/issues/53987\">#53987</a>) est un mcanisme d&rsquo;extensibilit pour les thmes bass sur des blocs. C&rsquo;est une premire tape pour apporter aux thmes bass sur des blocs le concept bien connu de crochets (en anglais <bdo lang=\"en\" dir=\"ltr\"><em>hooks</em></bdo>) qui permet d&rsquo;tendre les fonctionnalits des thmes classiques avec des filtres et des actions.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"uxDz0K4YaN\"><a href=\"https://make.wordpress.org/core/2023/10/15/introducing-block-hooks-for-dynamic-blocks/\">Introducing Block Hooks for dynamic blocks</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Introducing Block Hooks for dynamic blocks&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2023/10/15/introducing-block-hooks-for-dynamic-blocks/embed/#?secret=b142N7ijmc#?secret=uxDz0K4YaN\" data-secret=\"uxDz0K4YaN\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div><figcaption class=\"wp-element-caption\">La note de dveloppement suivante prsente quant  elle l&rsquo;API de dclaration de catgories de mdias&nbsp;:</figcaption></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"xU2p23JE2m\"><a href=\"https://make.wordpress.org/core/2023/10/16/new-registerinsertermediacategory-api/\">New`registerInserterMediaCategory`API</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;New`registerInserterMediaCategory`API&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2023/10/16/new-registerinsertermediacategory-api/embed/#?secret=fOaI0I9NYa#?secret=xU2p23JE2m\" data-secret=\"xU2p23JE2m\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>Un nombre important de modifications ont t apportes au paquet&nbsp;<code>@wordpress/components</code>&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"rQ4R0Nwdtj\"><a href=\"https://make.wordpress.org/core/2023/10/16/editor-components-updates-in-wordpress-6-4/\">Updates to user-interface components in WordPress 6.4</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Updates to user-interface components in WordPress 6.4&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2023/10/16/editor-components-updates-in-wordpress-6-4/embed/#?secret=n995KHt9nS#?secret=rQ4R0Nwdtj\" data-secret=\"rQ4R0Nwdtj\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>Il y a galement beaucoup d&rsquo;autres modifications de lditeur, comme une nouvelle prise en charge des images d&rsquo;arrire-plan pour les blocs, la typographie fluide, la possibilit de dsactiver globalement ou spcifiquement les options de mise en page des blocs  l&rsquo;aide du fichier <code>theme.json</code>, une API stabilise pour les <code>Innerblocks</code>, et bien plus encore&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"obNBTz6LA1\"><a href=\"https://make.wordpress.org/core/2023/10/17/miscellaneous-editor-changes-in-wordpress-6-4/\">Miscellaneous Editor changes in WordPress 6.4</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Miscellaneous Editor changes in WordPress 6.4&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2023/10/17/miscellaneous-editor-changes-in-wordpress-6-4/embed/#?secret=RaxEG3w1tL#?secret=obNBTz6LA1\" data-secret=\"obNBTz6LA1\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\">Notifications sur ladministration</h2>\n\n\n\n<p>Deux nouvelles fonctions permettent une abstraction de la gnration du balisage HTML afin de simplifier la maintenance, d&rsquo;encourager une plus grande cohrence et de permettre d&rsquo;activer le passage de paramtres et le fitrage des messages sur toutes les notifications employes sur l&rsquo;interface d&rsquo;administration de WordPress.</p>\n\n\n\n<p>Ces fonctions sont destines au cur du CMS lui-mme mais leur utilisation est aussi recommande aux personnes qui dveloppent des extensions&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"Eq3cLffnR8\"><a href=\"https://make.wordpress.org/core/2023/10/16/introducing-admin-notice-functions-in-wordpress-6-4/\">Introducing admin notice functions in WordPress 6.4</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Introducing admin notice functions in WordPress 6.4&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2023/10/16/introducing-admin-notice-functions-in-wordpress-6-4/embed/#?secret=8AMROYaiBK#?secret=Eq3cLffnR8\" data-secret=\"Eq3cLffnR8\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\">Gnral</h2>\n\n\n\n<p>Une note de dveloppement sera bientt publie afin de dtailler une nouvelle fonction <code>wp_trigger_error()</code> qui vient en complment de la fonction prexistante <code>_doing_it_wrong()</code> (voir le ticket #57686).</p>\n\n\n\n<h2 class=\"wp-block-heading\">API HTML</h2>\n\n\n\n<p>WordPress 6.4 poursuit le dveloppement de lAPI <code>HTML</code> en introduisant un premier processeur HTML minimaliste comprenant le concept de fil d&rsquo;Ariane, et rend par exemple possible de rechercher des images tant enfants directs de lment <code>div</code> donn.</p>\n\n\n\n<p>6.4 ajoute galement plusieurs fonctionnalits lies  CSS et aux classes dans le processeur de balises, ce qui rend possible de rechercher une balise contenant plus d&rsquo;un nom de classe, ou de rechercher une balise ne contenant pas un nom de classe spcifi.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"m2ICsrFjJx\"><a href=\"https://make.wordpress.org/core/2023/10/21/updates-to-the-html-api-in-6-4/\">Updates to the HTML API in 6.4</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Updates to the HTML API in 6.4&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2023/10/21/updates-to-the-html-api-in-6-4/embed/#?secret=MSkRvJarbL#?secret=m2ICsrFjJx\" data-secret=\"m2ICsrFjJx\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\">Mdias</h2>\n\n\n\n<p>Les nouvelles installations WordPress nauront dsormais plus de page de fichier attach par dfaut, la fonctionnalit tant maintenant dsactive compltement pour tous les nouveaux sites. Cela bnficiera au rfrencement des sites en vitant de faire perdre du temps aux moteurs d&rsquo;indexations qui doivent indexer ces pages par dfaut alors que ces pages ne sont souvent pas pertinentes pour les personnes visitant votre site.</p>\n\n\n\n<p>Cette modification introduit une nouvelle option<code> wp_attachment_pages_enabled</code>permettant de contrler le comportement des pages de fichiers attachs pour les sites existants: </p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"uhhUyk9GrB\"><a href=\"https://make.wordpress.org/core/2023/10/16/changes-to-attachment-pages/\">Changes to attachment pages</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Changes to attachment pages&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2023/10/16/changes-to-attachment-pages/embed/#?secret=F7Gjr3H3d0#?secret=uhhUyk9GrB\" data-secret=\"uhhUyk9GrB\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\">Amliorations des performances</h2>\n\n\n\n<p>Une grande partie des travaux sur WordPress 6.4 a tourn autour des amliorations de performances et d&rsquo;efficience du CMS, et en particulier sur la gestion du cache objet&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"Cwpo50WZVQ\"><a href=\"https://make.wordpress.org/core/2023/10/17/improvements-to-object-caching-in-wordpress-6-4/\">Improvements to Object Caching in WordPress 6.4</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Improvements to Object Caching in WordPress 6.4&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2023/10/17/improvements-to-object-caching-in-wordpress-6-4/embed/#?secret=F8G5s8zhaL#?secret=Cwpo50WZVQ\" data-secret=\"Cwpo50WZVQ\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>Les nouvelles fonctions <code>get_options()</code>, <code>wp_prime_option_caches()</code>, et <code>wp_set_option_autoload_values()</code>&nbsp;permettent de mettre en place des solutions plus performantes lorsque l&rsquo;on rcupre des options stockes en base de donnes&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"yo8Aqep8YQ\"><a href=\"https://make.wordpress.org/core/2023/10/17/new-option-functions-in-6-4/\">New option functions in 6.4</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;New option functions in 6.4&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2023/10/17/new-option-functions-in-6-4/embed/#?secret=wQUnabnZKH#?secret=yo8Aqep8YQ\" data-secret=\"yo8Aqep8YQ\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>Le chargement des fichiers modles a galement t amlior&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"Qr3mPFaUod\"><a href=\"https://make.wordpress.org/core/2023/10/17/improvements-to-template-loading-in-wordpress-6-4/\">Improvements to Template Loading in WordPress 6.4</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Improvements to Template Loading in WordPress 6.4&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2023/10/17/improvements-to-template-loading-in-wordpress-6-4/embed/#?secret=CMpYmT4uUJ#?secret=Qr3mPFaUod\" data-secret=\"Qr3mPFaUod\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 class=\"wp-block-heading\">Chargement des images</h3>\n\n\n\n<p>Plusieurs amliorations ont t faites sur la fonction <code>wp_get_loading_optimization_attributes()</code>, qui fournit un lieu unique pour grer l&rsquo;optimisation des attributs de gestion du chargement, tout spcialement concernant les images et les iframes.&nbsp; </p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"NtCoPqpfIf\"><a href=\"https://make.wordpress.org/core/2023/10/18/image-loading-optimization-enhancements-in-6-4/\">Image loading optimization enhancements in 6.4</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Image loading optimization enhancements in 6.4&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2023/10/18/image-loading-optimization-enhancements-in-6-4/embed/#?secret=DH7TQkisR5#?secret=NtCoPqpfIf\" data-secret=\"NtCoPqpfIf\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 class=\"wp-block-heading\">Chargement des scripts</h3>\n\n\n\n<p> partir de WordPress 6.4, des stratgies de chargement des scripts seront employes pour les scripts chargs par le cur du CMS ou par les thmes natifs de WordPress sur l&rsquo;interface publique (en anglais <em><bdo lang=\"en\" dir=\"ltr\">front-end</bdo></em>) de vos sites. La plupart du temps, la stratgie de chargement <code>defer</code>est utilise puisqu&rsquo;elle est la plus cohrente dans son comportement de chargement  partir du moment o lattribut <code>defer</code> s&rsquo;excute toujours une fois que le <abbr lang=\"en\" dir=\"ltr\" title=\"Document Object Model\">DOM</abbr> est charg. Un script utilisant l&rsquo;attribut <code>async</code> pourrait de son ct bloquer le rendu du script s&rsquo;il est dj mis en cache. Par ailleurs, le chargement  l&rsquo;aide de <code>defer</code>a t dplac du pied du document en direction de la partie <code>&lt;head&gt;</code> afin que les ressources concernes soient identifies le plus tt possible lors du chargement de la page, et que la stratgie de chargement soit applique le plus tt possible.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"icW3SWk68t\"><a href=\"https://make.wordpress.org/core/2023/10/17/script-loading-changes-in-wordpress-6-4/\">Script loading changes in WordPress 6.4</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Script loading changes in WordPress 6.4&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2023/10/17/script-loading-changes-in-wordpress-6-4/embed/#?secret=ihZMwddKfG#?secret=icW3SWk68t\" data-secret=\"icW3SWk68t\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 class=\"wp-block-heading\">Chargement des feuilles de styles</h3>\n\n\n\n<p>La note de dveloppement suivante dtaille les modifications faites sur le chargement des feuilles de styles. Le focus principal porte sur le remplacement des balises <code>style</code>&nbsp;affiches via l&rsquo;action <code>wp_head</code>&nbsp;avec des appels  la fonction&nbsp;<code>wp_add_inline_style()</code>&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"eTtiJVfjXN\"><a href=\"https://make.wordpress.org/core/2023/10/17/replacing-hard-coded-style-tags-with-wp_add_inline_style/\">Replacing hard-coded style tags with wp_add_inline_style()</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Replacing hard-coded style tags with wp_add_inline_style()&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2023/10/17/replacing-hard-coded-style-tags-with-wp_add_inline_style/embed/#?secret=sTAMgu1E44#?secret=eTtiJVfjXN\" data-secret=\"eTtiJVfjXN\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 class=\"wp-block-heading\">Autres amliorations concernant les performances</h3>\n\n\n\n<ul>\n<li>Des gains significatifs ont t obtenus en introduisant une gestion du cache objet dans la nouvelle mthode&nbsp;<code>WP_Theme::get_block_patterns()</code>.</li>\n\n\n\n<li>Des vrifications non indispensables ont t retires sur l&rsquo;API <code>Themes</code>. Ces vrifications portaient sur la correspondance entre le rpertoire de la feuille de styles du thme courant et le rpertoire des fichiers modles.</li>\n\n\n\n<li>Une nouvelle mthode <code>WP_Theme::get_block_template_folders()</code> amliore quand  elle les performances de la fonction <code>get_block_theme_folders()</code> et la gestion des erreurs. La vrification des modles de blocs au sein des thmes est ainsi plus rapide.</li>\n\n\n\n<li>Taxonomies&nbsp;: une double sanitisation de la fonction <code>get_term</code> a t retire. Ce changement retire des appels inutiles  <code>sanitize_term</code>, ce qui amliore les performances de la fonction (<a href=\"https://core.trac.wordpress.org/ticket/58329\">ticket #58329</a>).</li>\n\n\n\n<li>Thmes&nbsp;: les constantes&nbsp;<code>TEMPLATEPATH</code>&nbsp;et&nbsp;<code>STYLESHEETPATH</code>&nbsp;on t dprcies. Les fonctions&nbsp;<code>get_template_directory()</code>&nbsp;et&nbsp;<code>get_stylesheet_directory()</code>&nbsp;doivent maintenant tre utilises  la place (<a href=\"https://core.trac.wordpress.org/ticket/18298\">ticket #18298</a>).</li>\n</ul>\n\n\n\n<p>Globalement, WordPress 6.4 prsente de meilleures performances et les dveloppeureuses apprcieront la rduction de la charge pesant sur les processus d&rsquo;entre/sortie.</p>\n\n\n\n<h2 class=\"wp-block-heading\">Autres changements techniques</h2>\n\n\n\n<h3 class=\"wp-block-heading\">Comptes</h3>\n\n\n\n<p>WordPress 6.4 apporte plusieurs amliorations importantes au balisage HTML de la page <code>wp-login.php</code>&nbsp;pour rendre sa structure plus optimale et pour faciliter la mise en forme de cette page pour les personnes qui souhaitent la personnaliser (<a href=\"https://core.trac.wordpress.org/ticket/30685\">ticket #30685</a>).</p>\n\n\n\n<h3 class=\"wp-block-heading\">Clarification des liens <bdo lang=\"en\" dir=\"ltr\">Add New</bdo> pour une meilleure accessibilit de ladministration</h3>\n\n\n\n<p> partir de WordPress 6.4, les valeurs par dfaut du libell <code>add_new</code> utilis dans les types de publications personnaliss ont t modifies afin d&rsquo;y intgrer le nom du type de publication. Cela apporte une correspondance avec le libell <code>add_new_item</code> et fournit un meilleur contexte ce qui amliore l&rsquo;accessibilit des boutons et liens prsents dans l&rsquo;interface d&rsquo;administration (<a href=\"https://core.trac.wordpress.org/ticket/47125\">ticket #47125</a>).</p>\n\n\n\n<p>Si vous utilisiez auparavant la dclaration suivante&nbsp;: <br><code>\'add_new\' =&gt; _x( \'Add New\', \'Book\', \'my-plugin\' )</code><br><br>alors nous vous encourageons  la remplacer par :<br><code>\'add_new\' =&gt; __( \'Add New Book\', \'my-plugin\' )</code></p>\n\n\n\n<h3 class=\"wp-block-heading\">Modifications des prrequis pour les tests d&rsquo;intgration</h3>\n\n\n\n<p><bdo lang=\"en\" dir=\"ltr\">PHPUnit Polyfills</bdo> version 1.1.0 est requis pour faire tourner des tests d&rsquo;intgration sur WordPress 6.4 (<a href=\"https://core.trac.wordpress.org/ticket/59510\">ticket #59510</a>).</p>\n\n\n\n<h3 class=\"wp-block-heading\">API HTTP</h3>\n\n\n\n<p>Les classes, mthodes et filtres de <code>WP_Http_Curl</code>&nbsp;et&nbsp;<code>WP_Http_Streams</code>&nbsp;ont t dprcis car ces classes ne sont plus utilises dans le cur de WordPress depuis l&rsquo;implmentation de la bibliothque <code>Request</code> (<a href=\"https://core.trac.wordpress.org/ticket/58705\">ticket #58705</a>).</p>\n\n\n\n<h3 class=\"wp-block-heading\">Rvisions</h3>\n\n\n\n<p>Les rvisions sont maintenant utilisables sur les champs personnaliss des publications (<a href=\"https://core.trac.wordpress.org/ticket/20564\">ticket #20564</a>)&nbsp;: </p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"qdNn8rXeER\"><a href=\"https://make.wordpress.org/core/2023/10/24/framework-for-storing-revisions-of-post-meta-in-6-4/\">Framework for storing revisions of Post Meta in 6.4</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Framework for storing revisions of Post Meta in 6.4&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2023/10/24/framework-for-storing-revisions-of-post-meta-in-6-4/embed/#?secret=s95H1mGyHr#?secret=qdNn8rXeER\" data-secret=\"qdNn8rXeER\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p class=\"has-white-color has-text-color has-background has-link-color wp-elements-a89acf0ff37db7c1f07fac7756d30da0\" style=\"background:linear-gradient(135deg,rgb(0,0,0) 0%,rgb(57,57,131) 100%)\">Que vous dveloppiez des thmes ou des extensions, pensez  tester et retester votre code pour vous assurer de sa compatibilit avec ces changements. Vous pouvez utiliser&nbsp;<a href=\"https://wordpress.org/plugins/wordpress-beta-tester/\" target=\"_blank\" rel=\"noreferrer noopener\">lextension Beta Tester</a>&nbsp;sur un site de test pour vrifier la compatibilit de vos dveloppements avec la version de test <a href=\"https://wordpress.org/news/2023/10/wordpress-6-4-release-candidate-2/\">WordPress 6.4&nbsp;Release Candidate&nbsp;2</a>.&nbsp;Nous comptons sur vous pour vrifier que votre code fonctionne correctement avec le cur du CMS, pour le bien des millions dutilisateurs et utilisatrices de WordPress&nbsp;<img src=\"https://s.w.org/images/core/emoji/15.0.3/72x72/2665.png\" alt=\"\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p>Ce guide a t traduit et radapt  partir du <a href=\"https://make.wordpress.org/core/2023/07/18/wordpress-6-3-field-guide/\"><em>Field Guide</em> de WP 6.4</a> par <a href=\"https://profiles.wordpress.org/audrasjb/\">Jb Audras</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:91:\"https://fr.wordpress.org/2023/10/30/guide-des-changements-techniques-de-wordpress-6-4/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"Questionnaire annuel sur votre utilisation de WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:97:\"https://fr.wordpress.org/2023/10/10/questionnaire-annuel-sur-votre-utilisation-de-wordpress-2023/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:105:\"https://fr.wordpress.org/2023/10/10/questionnaire-annuel-sur-votre-utilisation-de-wordpress-2023/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 10 Oct 2023 13:03:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:23:\"Questionnaires/sondages\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=2852\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:392:\"Comme chaque anne, lquipe &#160;Community&#160; soumet un petit questionnaire  l&#8217;ensemble de la communaut WordPress. En effet, votre voix compte&#160;! Si vous tes un utilisateur ou une utilisatrice de WordPress, si vous concevez des sites avec ce CMS, si vous dveloppez des thmes ou des extensions, si vous contribuez  la traduction, si vous participez [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Jenny Dupuy\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:6401:\"\n<p>Comme chaque anne, lquipe &nbsp;<a href=\"https://make.wordpress.org/community/\" data-type=\"link\" data-id=\"https://make.wordpress.org/community/\">Community</a>&nbsp; soumet un petit questionnaire  l&rsquo;ensemble de la communaut WordPress.</p>\n\n\n\n<p><strong>En effet, votre voix compte&nbsp;!</strong> Si vous tes un utilisateur ou une utilisatrice de WordPress, si vous concevez des sites avec ce CMS, si vous dveloppez des thmes ou des extensions, si vous contribuez  la traduction, si vous participez au dveloppement du cur de WordPress ou  sa communaut, alors vous tes concernes par ce questionnaire.</p>\n\n\n\n<p>Les principales conclusions et tendances qui mergent de ce questionnaire sont communiques dans la confrence annuelle&nbsp;<em><strong>State of the Word</strong></em>, puis partages dans les blogs publics du projet et auront une influence sur la direction stratgique du projet dans les annes  venir.</p>\n\n\n\n<p>En dautres termes, cette enqute aidera celles et ceux qui construisent WordPress  mieux comprendre comment le logiciel est utilis et par qui. Lenqute permet galement aux responsables du projet open source WordPress den savoir plus sur les expriences des personnes qui contribuent au projet.</p>\n\n\n\n<div class=\"wp-block-buttons is-content-justification-center is-layout-flex wp-container-core-buttons-is-layout-4 wp-block-buttons-is-layout-flex\">\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link wp-element-button\" href=\"https://survey.alchemer.com/s3/7439442/2023-WordPress-Annual-Survey\" target=\"_blank\" rel=\"noreferrer noopener\">Cest parti! Je remplis le questionnaire 2023</a></div>\n</div>\n\n\n\n<p>Le questionnaire est disponible en diffrentes langues, dont le franais, merci aux contributeurs polyglotes pour leurs traductions.</p>\n\n\n\n<p>Lenqute est ouverte pour cinq semaines et les rsultats seront publis dbut dcembre sur le <a rel=\"noreferrer noopener\" href=\"https://wordpress.org/news/\" data-type=\"link\" data-id=\"https://wordpress.org/news/\" target=\"_blank\">blog News</a>.</p>\n\n\n\n<p>Cette anne, comme lanne dernire, lenqute a fait lobjet de quelques amliorations au niveau du droulement et de lensemble des questions. Une nouvelle plateforme est galement  lessai, offrant une interface actualise, un support multilingue amlior, des outils danalyse et de visualisation des rsultats largis, et bien plus encore. La nouvelle plateforme intgre galement des contrles daccessibilit et de confidentialit, ce qui garantit que lenqute rpond aux divers besoins de la communaut WordPress.</p>\n\n\n\n<h2 class=\"wp-block-heading\">Passez le mot</h2>\n\n\n\n<p>Aidez-nous  faire connatre lenqute en la partageant avec votre rseau, via Slack, ou sur vos comptes de mdias sociaux. Plus il y aura de personnes qui rpondront  lenqute et qui partageront leur exprience avec WordPress, plus le projet en bnficiera.</p>\n\n\n\n<h2 class=\"wp-block-heading\">Scurit et vie prive</h2>\n\n\n\n<p>La scurit et la confidentialit des donnes sont primordiales pour le projet et la communaut WordPress. Dans cette optique, toutes les donnes seront anonymises : aucune adresse e-mail ou adresse IP ne sera associe aux rsultats publis. Pour en savoir plus sur les pratiques de WordPress.org en matire de confidentialit, consultez la <a href=\"https://wordpress.org/about/privacy/\" data-type=\"link\" data-id=\"https://wordpress.org/about/privacy/\">politique de confidentialit (en anglais)</a>.</p>\n\n\n\n<h2 class=\"wp-block-heading\">Merci</h2>\n\n\n\n<p>Nous remercions les contributeurs WordPress suivants pour leur aide dans le projet denqute annuelle, y compris la cration des questions, la stratgie, llaboration de l&rsquo;enqute et la traduction :</p>\n\n\n\n<p><a href=\"https://profiles.wordpress.org/adamsilverstein/\">adamsilverstein</a>,<a href=\"https://profiles.wordpress.org/audrasjb/\">audrasjb</a>,<a href=\"https://profiles.wordpress.org/alvarogois/\">alvarogis</a>,<a href=\"https://profiles.wordpress.org/atachibana/\">atachibana</a>,<a href=\"https://profiles.wordpress.org/bjmcsherry/\">bjmcsherry</a>,<a href=\"https://profiles.wordpress.org/chanthaboune/\">chanthaboune</a>,<a href=\"https://profiles.wordpress.org/dansoschin/\">dansoschi</a>,<a href=\"https://profiles.wordpress.org/eidolonnight/\">eidolonnight</a>,<a href=\"https://profiles.wordpress.org/fierevere/\">fierevere</a>,<a href=\"https://profiles.wordpress.org/fxbenard/\">fxbnard</a>,<a href=\"https://profiles.wordpress.org/hassantafreshi/\">hassantafreshi</a>,<a href=\"https://profiles.wordpress.org/juliagasparyan/\">juliagasparyan</a>,<a href=\"https://profiles.wordpress.org/kittmedia/\">kittmedia</a>,<a href=\"https://profiles.wordpress.org/manudavidos/\">manudavidos</a>,<a href=\"https://profiles.wordpress.org/nao/\">nao</a>,<a href=\"https://profiles.wordpress.org/nilovelez/\">nilovelez</a>,<a href=\"https://profiles.wordpress.org/rmartinezduque/\">rmartinezduque</a> et <a href=\"https://profiles.wordpress.org/tobifjellner/\">tobifjellner</a>.</p>\n\n\n\n<p>Merci &nbsp;<a href=\"https://www.hostinger.com/\">Hostinger</a>,&nbsp;<a href=\"https://cloud.jetpack.com/\">Jetpack</a>, and&nbsp;<a href=\"http://wordpress.com/\">WordPress.com</a>, pour avoir contribu  la promotion de lenqute auprs de leurs clients respectifs.</p>\n\n\n\n<div class=\"wp-block-buttons is-content-justification-center is-layout-flex wp-container-core-buttons-is-layout-5 wp-block-buttons-is-layout-flex\">\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link wp-element-button\" href=\"https://survey.alchemer.com/s3/7439442/2023-WordPress-Annual-Survey\" target=\"_blank\" rel=\"noreferrer noopener\">Cest parti! Je remplis le questionnaire 2023</a></div>\n</div>\n\n\n\n<p>Lenqute sera close le <a href=\"https://www.timeanddate.com/worldclock/fixedtime.html?iso=20231031T1600\"><time datetime=\"2023-10-31T16:00:00-04:00\">mardi 31 octobre 2023  17:00 UTC+1</time></a>.</p>\n\n\n\n<p>Merci  <a href=\"https://profiles.wordpress.org/audrasjb\" data-type=\"link\" data-id=\"https://profiles.wordpress.org/audrasjb\">JB Audras</a> et <a href=\"https://profiles.wordpress.org/fxbenard/\" data-type=\"link\" data-id=\"https://profiles.wordpress.org/fxbenard/\">FX Bnard</a> pour leur relecture de cet article.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:102:\"https://fr.wordpress.org/2023/10/10/questionnaire-annuel-sur-votre-utilisation-de-wordpress-2023/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"WordPress 6.3 Lionel\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"https://fr.wordpress.org/2023/08/08/wordpress-6-3-lionel/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"https://fr.wordpress.org/2023/08/08/wordpress-6-3-lionel/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 08 Aug 2023 22:03:41 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Nouvelles versions de WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=2817\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:424:\"Nous vous prsentons WordPress 6.3 &#160;Lionel&#160;, nomm aprs la jazzman amricain&#160;Lionel Hampton. Il fut un vibraphoniste, pianiste et percussionniste de jazz prolifique et obtint sa notorit en jouant avec des grands du jazz comme&#160;Charles Mingus&#160;ou&#160;Quincy Jones, et en tant que leader du Lionel Hampton Orchestra. Ses travaux ont t rcompenss par un Grammy, une toile [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:66534:\"\n<figure class=\"wp-block-image size-large\"><a href=\"https://fr.wordpress.org/files/2023/08/6.3-Release-Edition-Main-Image.png\"><img loading=\"lazy\" decoding=\"async\" width=\"1024\" height=\"683\" src=\"https://fr.wordpress.org/files/2023/08/6.3-Release-Edition-Main-Image-1024x683.png\" alt=\"\" class=\"wp-image-2834\" srcset=\"https://fr.wordpress.org/files/2023/08/6.3-Release-Edition-Main-Image-1024x683.png 1024w, https://fr.wordpress.org/files/2023/08/6.3-Release-Edition-Main-Image-300x200.png 300w, https://fr.wordpress.org/files/2023/08/6.3-Release-Edition-Main-Image-768x512.png 768w, https://fr.wordpress.org/files/2023/08/6.3-Release-Edition-Main-Image-1536x1024.png 1536w, https://fr.wordpress.org/files/2023/08/6.3-Release-Edition-Main-Image-2048x1365.png 2048w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure>\n\n\n\n<p>Nous vous prsentons WordPress 6.3 &nbsp;Lionel&nbsp;, nomm aprs la jazzman amricain&nbsp;<a href=\"https://en.wikipedia.org/wiki/Lionel_Hampton\">Lionel Hampton</a>. Il fut un vibraphoniste, pianiste et percussionniste de jazz prolifique et obtint sa notorit en jouant avec des grands du jazz comme&nbsp;<a href=\"https://en.wikipedia.org/wiki/Charles_Mingus\">Charles Mingus</a>&nbsp;ou&nbsp;<a href=\"https://en.wikipedia.org/wiki/Quincy_Jones\">Quincy Jones</a>, et en tant que <bdo lang=\"en\" dir=\"ltr\">leader</bdo> du <em><bdo lang=\"en\" dir=\"ltr\">Lionel Hampton Orchestra</bdo></em>. Ses travaux ont t rcompenss par un <em><bdo lang=\"en\" dir=\"ltr\">Grammy</bdo></em>, une toile sur le <bdo lang=\"en\" dir=\"ltr\"><em>Hollywood Walk of Fame</em></bdo>, et la <em><bdo lang=\"en\" dir=\"ltr\">National Medal of Arts</bdo></em> amricaine.</p>\n\n\n\n<p>Avec WordPress 6.3, vous pourrez crer de beaux sites web plus efficacement que jamais. Que vous souhaitiez crer un site complet sans coder ou que vous cherchiez  personnaliser chaque dtail avec votre propre code, WordPress 6.3 a quelque chose  vous offrir.</p>\n\n\n\n<blockquote class=\"wp-block-quote is-layout-flow wp-block-quote-is-layout-flow\">\n<p>&nbsp;Lionel&nbsp; marque un chapitre majeur dans lvolution de WordPress. Cest le point culminant dannes de travail par des centaines de contributeurs et contributrices pour faire voluer lexprience ddition de votre site WordPress vers davantage de cohrence,  laide des blocs. Mais notre qute de vouloir dmocratiser la publication sur le web nest pas finie pour autant&nbsp;!</p>\n<cite><strong>Matas Ventura, Directeur de la version 6.3</strong></cite></blockquote>\n\n\n\n<div class=\"wp-block-buttons is-layout-flex wp-block-buttons-is-layout-flex\">\n<div class=\"wp-block-button has-custom-font-size is-style-fill has-medium-font-size\"><a class=\"wp-block-button__link has-vivid-cyan-blue-background-color has-background wp-element-button\" href=\"https://fr.wordpress.org/download/\" style=\"border-radius:0px;padding-top:var(--wp--preset--spacing--20);padding-bottom:var(--wp--preset--spacing--20)\">Tlcharger WordPress 6.3 &nbsp;Lionel&nbsp;</a></div>\n</div>\n\n\n\n<h2 class=\"wp-block-heading\">Bienvenue sur WordPress 6.3</h2>\n\n\n\n<h3 class=\"wp-block-heading\">Tout faire dans lditeur de site</h3>\n\n\n\n<figure class=\"wp-block-image\"><img decoding=\"async\" src=\"https://lh3.googleusercontent.com/ECKi32pUTHxKbtb7u2yXNt9VgtbETFiOhEXsmkTg-kwtTWz6Hors0QmayvKH57LONBPvrztSU29SIOYyUeMQJFfbZ3sHeml1bPGVyqHtMtgjCFv8yVkUhkxBYZhf2ZiKNW_GgbcT_SZ9tAkQjyxe1_c\" alt=\"\" /></figure>\n\n\n\n<p>WordPress 6.3 rassemble pour la premire fois votre contenu, vos modles et vos compositions dans lditeur de site. Ajoutez des pages, parcourez les variations de styles, crez des compositions synchronises et bnficiez dun contrle prcis sur vos menus de navigation. Vous ne perdrez plus de temps  passer dune zone de site  lautre, et vous pourrez vous concentrer sur ce qui compte le plus. De la cration  la publication, en un seul endroit.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Prvisualiser les thmes bass sur des blocs</h3>\n\n\n\n<figure class=\"wp-block-image\"><img decoding=\"async\" src=\"https://lh6.googleusercontent.com/tqCEcJeH36DRnaTb-clxC54AoEYEy-GVea8AGiDU8_F5Z98x_DdllvuYVLNacitS3uS4Oy3fEzs3u_ESELe2K5KF2tX_ikroxHe9sanJ5pYVhVnoAnG_mtcrRmUFXTx5ug1Bl2YwwPvnBRZj-fHrym8\" alt=\"\" /></figure>\n\n\n\n<p>Exprimentez les thmes bass sur des blocs avant de les choisir et prvisualisez lditeur de site, avec des options  personnaliser directement avant dactiver un nouveau thme.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Crez et synchronisez vos compositions</h3>\n\n\n\n<figure class=\"wp-block-image\"><img decoding=\"async\" src=\"https://lh3.googleusercontent.com/rdzZc0SGnFQ188wmNqBhUMpq3fStbcUlZzSM_DwWdNgM-0fALWPWEzMfjCuOsLqpw6uNcI1i1AAiiDiLnHWSSVO3TtliLD2QNkhGuQ1qpaogZ3RrNHAtSG_85ai4zqZk2fF2ae7AEnliDWxRpf1ocDA\" alt=\"\" /></figure>\n\n\n\n<p>Disposez les blocs avec un nombre infini de variantes et enregistrez-les en tant que compositions pour les utiliser sur lensemble de votre site. Vous pouvez mme indiquer si vous souhaitez synchroniser vos compositions (prcdemment appels &nbsp;blocs rutilisables&nbsp;) afin quune modification sapplique  toutes les parties de votre site. Vous pouvez galement garder la possibilit de personnaliser chaque instance.</p>\n\n\n\n<h2 class=\"wp-block-heading\">Travaillez plus rapidement avec la palette de commandes</h2>\n\n\n\n<figure class=\"wp-block-image\"><img decoding=\"async\" src=\"https://lh3.googleusercontent.com/IASpGRTrnrOzs4pvDPgEKqMQwuXNJRBqbDRHXlzLmvcsKvlIv_D2Iax_IzZ0eP15i2Xq8YDo288lB9WJGjbk_aceRQgDZGBMgMOzcPxG3L4xo92aGqlb9nbqdup6Qwt3vISHCz4wjylYAgGJwLdwbpw\" alt=\"\" /></figure>\n\n\n\n<p>Basculez sur un modle spcifique ou ouvrez les prfrences de votre diteur  laide dun nouvel outil qui vous aide  naviguer rapidement dans les fonctionnalits tendues. Grce  de simples raccourcis clavier (+k sur Mac ou CTRL+k sur Windows), en cliquant sur licne de recherche de la colonne latrale de lditeur de site, ou en cliquant sur la barre de titre, vous pouvez vous rendre o vous voulez et faire ce que vous voulez en quelques secondes.</p>\n\n\n\n<h3 class=\"wp-block-heading\"><br>Affinez vos designs avec de nouveaux outils</h3>\n\n\n\n<figure class=\"wp-block-image\"><img decoding=\"async\" src=\"https://lh3.googleusercontent.com/C44Qs_vplLP0rB_ZUERqipYWXuFzdnvu8nxmz6EpUW3vyXnWbfbfwbvYvzfaQyu24F7nxRjKossThzuXqJNKnUyQBjShITCVwhhKYUhwa14UyL2JwVn7D71zV0yyZVYm7ASyRO1whyHfOT4zgqFpizQ\" alt=\"\" /></figure>\n\n\n\n<p>Les nouveaux rglages de design offrent une plus grande polyvalence pour affiner vos mises en pages,  commencer par la possibilit de personnaliser les styles de vos lgendes  partir de linterface des styles, sans codage. Vous pouvez grer vos filtres duotone dans les rglages de style et choisir parmi les options fournies par votre thme, mais aussi les dsactiver compltement. Le bloc Bannire bnficie de rglages supplmentaires pour la couleur du texte, les rglages de mise en page et de bordure, ce qui rend ce bloc puissant encore plus pratique.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Suivez vos modifications de design avec les rvisions de styles</h3>\n\n\n\n<figure class=\"wp-block-image\"><img decoding=\"async\" src=\"https://lh3.googleusercontent.com/1al2dPJV09Plk8suFtnJI81L754Jl6QCq30_UTbGJ9ln0zJ3ig8BEIVU_BX8zRvZst8KUFxr6ny7Ohv3lNEgp4cZruSdrcuZjT8efmIifW1G3-lP4H4J1qWhby9RfCUSBaMmarBqwM3Kp22m-38hesc\" alt=\"\" /></figure>\n\n\n\n<p>Vous pouvez dsormais voir  quoi ressemblait votre site  un moment prcis. Visualisez ces rvisions sur une chronologie et accdez  une option de restauration des styles antrieurs en un seul clic.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Annotez vos publications avec le bloc &nbsp;Notes de bas de page&nbsp;</h3>\n\n\n\n<figure class=\"wp-block-image\"><img decoding=\"async\" src=\"https://lh4.googleusercontent.com/94NEMrm0MHPM8QtVzM1W61Pz452Jgp_xzDhHR-35QgOlkABny_gzjmTh-Z-ij8cAH8C_rp0ggLp2VB5AAOtCwJrTJ4Q6rUpehnL-tFxnTw75AaMVInZfChWg2VudW6yKUthshxnQLM3xmQmtmDnFexs\" alt=\"\" /></figure>\n\n\n\n<p>Les notes de bas de page ajoutent des annotations pratiques  votre contenu. Vous pouvez dsormais ajouter et lier des notes de bas de page  nimporte quel mot dun paragraphe.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Affichez ou masquez du contenu avec le bloc Dtails</h3>\n\n\n\n<figure class=\"wp-block-image\"><img decoding=\"async\" src=\"https://lh5.googleusercontent.com/Ed5esxwS6U5Z3sBWkeV7ZuNau-izTZQqwxzz6F0ww9qx4XnyqKVT8JZTP0eahDDO73psW7gOxz3KghGyBOeuNW5L3LKw0MJAeISUhAtvqNyThT1Or8gybCIJGhHFyh6njVun5_KumEkMoR5cgXBK_-Q\" alt=\"\" /></figure>\n\n\n\n<p>Utilisez ce bloc pour viter de divulgcher une surprise, pour crer une section de foire aux questions interactive, ou pour masquer un long paragraphe derrire un titre.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Amlioration des performances</h3>\n\n\n\n<p>WordPress 6.3 contient plus de <a href=\"https://make.wordpress.org/core/2023/08/07/wordpress-6-3-performance-improvements/\">170 mises  jour de performances (en anglais)</a>, comprenant la prise en charge des attributs&nbsp;<code>defer</code>&nbsp;et&nbsp;<code>async</code>&nbsp;pour lAPI Scripts et&nbsp;<code>fetchpriority</code>&nbsp;pour les images. Avec les volutions concernant la rsolution des modles de blocs, le chargement diffr des images et le chargement des emojis, ces amliorations peuvent diminuer le temps de chargement de votre site web tel quil est peru par les visiteurs.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Laccessibilit reste une priorit</h3>\n\n\n\n<p>Avec plus de 50 amliorations de laccessibilit sur lensemble de la plateforme, WordPress 6.3 est plus accessible que jamais. Lamlioration des libells, loptimisation de la navigation par onglets et par touches flches, la rvision de la hirarchie des titres et les nouveaux contrles dans lditeur dimages de ladministrateur permettent aux personnes qui utilisent des technologies dassistance dadministrer plus facilement leur site.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Autres amliorations</h3>\n\n\n\n<h4 class=\"wp-block-heading\">Dfinir les proportions de taille des images</h4>\n\n\n\n<p>Spcifiez vos proportions et assurez lintgrit de la conception, en particulier lorsque vous utilisez des images dans des compositions.</p>\n\n\n\n<h4 class=\"wp-block-heading\">Construire son site sans distraction</h4>\n\n\n\n<p>La conception sans distraction est dsormais disponible dans lditeur de site.</p>\n\n\n\n<h4 class=\"wp-block-heading\">Redcouvrez la barre doutils suprieure</h4>\n\n\n\n<p>La barre doutils suprieure remanie propose des slecteurs de parents pour les blocs imbriqus, des options pour la slection de plusieurs blocs, ainsi quune nouvelle interface intgre  la barre de titre avec de nouvelles fonctionnalits  lesprit.</p>\n\n\n\n<h4 class=\"wp-block-heading\">Amliorations de la vue de la liste</h4>\n\n\n\n<p>Faites un glisser-dposer vers un autre emplacement et supprimez les blocs de votre choix dans la vue en liste mise  jour en temps rel.</p>\n\n\n\n<h4 class=\"wp-block-heading\">Construire des modles grce aux compositions</h4>\n\n\n\n<p>Crez des compositions uniques pour acclrer la cration de modles grce  une nouvelle fentre modale permettant daccder  la slection des compositions.</p>\n\n\n\n<h2 class=\"wp-block-heading\">En savoir plus sur WordPress 6.3</h2>\n\n\n\n<p><a href=\"https://learn.wordpress.org/\">Learn WordPress (en anglais)</a>&nbsp;est une ressource gratuite pour les utilisateurs/utilisatrices de WordPress, quils/elles soient dbutantes ou exprimentes. Learn contient des vidos pratiques sur lutilisation de diverses fonctionnalits de WordPress, des&nbsp;<a href=\"https://learn.wordpress.org/online-workshops/\">vnements interactifs (en anglais)</a>&nbsp;pour explorer des sujets en profondeur, et des plans de cours pour approfondir des domaines spcifiques de WordPress.</p>\n\n\n\n<p>Consultez notre&nbsp;<a href=\"https://fr.wordpress.org/2023/07/18/guide-des-changements-techniques-de-wordpress-6-3/\">guide des changements techniques introduits par WordPress 6.3</a>. Il contient toutes les notes techniques que vous devez connatre si vous dveloppez sur WordPress.</p>\n\n\n\n<p><a href=\"https://wordpress.org/support/wordpress-version/version-6-3/\">Consultez les notes de version de WordPress 6.3 (en anglais)</a>&nbsp;pour obtenir plus dinformations sur les amliorations proposes et les anomalies corriges, les informations dinstallation, les notes et ressources  destination des dveloppeuses et des dveloppeurs, connatre les personnes ayant contribu  cette version et pour obtenir la liste des fichiers modifis.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Lquipe de direction de WordPress 6.3</h3>\n\n\n\n<p>Voici lquipe qui a coordonn le dveloppement et la sortie cette nouvelle version de WordPress&nbsp;:</p>\n\n\n\n<ul>\n<li><strong>Direction gnrale&nbsp;:</strong>&nbsp;<a href=\"https://profiles.wordpress.org/matveb/\">Matas Ventura</a></li>\n\n\n\n<li><strong>Coordination de la version&nbsp;:</strong>&nbsp;<a href=\"https://profiles.wordpress.org/francina/\">Francesca Marano</a>,&nbsp;<a href=\"https://profiles.wordpress.org/priethor/\">Hctor Prieto</a></li>\n\n\n\n<li><strong>Direction technique du cur WP&nbsp;:</strong>&nbsp;<a href=\"https://profiles.wordpress.org/azaozz/\">Andrew Ozz</a>,&nbsp;<a href=\"https://profiles.wordpress.org/mikeschroder/\">Mike Schroder</a></li>\n\n\n\n<li><strong>Direction technique de lditeur&nbsp;:</strong>&nbsp;&nbsp;<a href=\"https://profiles.wordpress.org/isabel_brison/\">Isabel Brison</a>,&nbsp;<a href=\"https://profiles.wordpress.org/ramonopoly/\">Ramon Dodd</a></li>\n\n\n\n<li><strong>Gestion de projet ct Cur WP&nbsp;:</strong>&nbsp;<a href=\"https://profiles.wordpress.org/audrasjb/\">Jb Audras</a>,&nbsp;<a href=\"https://profiles.wordpress.org/chaion07/\">Ahmed Kabir Chaion</a>,&nbsp;<a href=\"https://profiles.wordpress.org/mukesh27/\">Mukesh Panchal</a>,&nbsp;<a href=\"https://profiles.wordpress.org/oglekler/\">Olga Glecker</a></li>\n\n\n\n<li><strong>Gestion de projet ct diteur&nbsp;:</strong>&nbsp;<a href=\"https://profiles.wordpress.org/annezazu/\">Anne McCarthy</a>,&nbsp;<a href=\"https://profiles.wordpress.org/bph/\">Birgit Pauli-Haack</a>,&nbsp;<a href=\"https://profiles.wordpress.org/firoz2456/\">Firoz Sabaliya</a>,&nbsp;<a href=\"https://profiles.wordpress.org/ndiego/\">Nick Diego</a></li>\n\n\n\n<li><strong>Direction de la documentation&nbsp;:</strong>&nbsp;<a href=\"https://profiles.wordpress.org/femkreations/\">Femy Praseeth</a>,&nbsp;<a href=\"https://profiles.wordpress.org/stevenlinx/\">Steven Lin</a>,&nbsp;<a href=\"https://profiles.wordpress.org/leonnugraha/\">Leonardus Nugraha</a>,&nbsp;<a href=\"https://profiles.wordpress.org/611shabnam/\">Mushrit Shabnam</a></li>\n\n\n\n<li><strong>Direction marketing &amp; communication&nbsp;:</strong>&nbsp;<a href=\"https://profiles.wordpress.org/dansoschin/\">Dan Soschin</a>,&nbsp;<a href=\"https://profiles.wordpress.org/jpantani/\">Jonathan Pantani</a>,&nbsp;<a href=\"https://profiles.wordpress.org/meher/\">Meher Bala</a></li>\n\n\n\n<li><strong>Direction des tests&nbsp;:</strong>&nbsp;<a href=\"https://profiles.wordpress.org/ironprogrammer/\">Brian Alexander</a>,&nbsp;<a href=\"https://profiles.wordpress.org/webtechpooja/\">Pooja Derashri</a>,&nbsp;<a href=\"https://profiles.wordpress.org/chrismalone617/\">Chris Malone</a></li>\n\n\n\n<li><strong>Direction du design&nbsp;:</strong>&nbsp;<a href=\"https://profiles.wordpress.org/karmatosed/\">Tammie Lister</a>,&nbsp;<a href=\"https://profiles.wordpress.org/richtabor/\">Rich Tabor</a></li>\n\n\n\n<li><strong>Responsables des performances&nbsp;:</strong>&nbsp;<a href=\"https://profiles.wordpress.org/flixos90/\">Felix Arntz</a>,&nbsp;<a href=\"https://profiles.wordpress.org/clarkeemily/\">Emily Clarke</a></li>\n</ul>\n\n\n\n<h3 class=\"wp-block-heading\">Merci aux contributeurs et contributrices</h3>\n\n\n\n<p>WordPress 6.3 naurait pas pu sortir sans la contribution passionne de plus de 650 personnes provenant dau moins 52 pays diffrents. Un remerciement tout spcial pour les 207 personnes qui ont contribu au cur de WordPress pour la premire fois avec WP6.3 <img src=\"https://s.w.org/images/core/emoji/15.0.3/72x72/2665.png\" alt=\"\" c