/h3>\n\n\n\n<p>WordPress est un projet international et la version 6.3 est dj compltement disponible dans plus de 70 langues diffrentes.</p>\n\n\n\n<p>Nous souhaitons remercier ici les personnes ayant particip  la traduction de WordPress 6.3 en franais&nbsp;:</p>\n\n\n\n<p><a href=\"https://profiles.wordpress.org/antoinepaufichet\">Antoine Paufichet</a>, <a href=\"https://profiles.wordpress.org/beryldlg/\">beryldlg</a>, <a href=\"https://profiles.wordpress.org/clementpolito\">Clment Polito</a>, <a href=\"https://profiles.wordpress.org/btpub/\">Bruno Tritsch</a>, <a href=\"https://profiles.wordpress.org/coralietixeront/\">coralietixeront</a>, <a href=\"https://profiles.wordpress.org/dacobah/\">dacobah</a>, <a href=\"https://profiles.wordpress.org/wolforg\">Didier Demory</a>, <a href=\"https://profiles.wordpress.org/eddystile/\">Eddy</a>, <a href=\"https://profiles.wordpress.org/emlebrun/\">Emilie LEBRUN</a>, <a href=\"https://profiles.wordpress.org/este1/\">este1</a>, <a href=\"https://profiles.wordpress.org/fxbenard/\">FX</a>, <a href=\"https://profiles.wordpress.org/guillaumeturpin/\">Guillaume TURPIN</a>, <a href=\"https://profiles.wordpress.org/jaz_on/\">Jason Rouet</a>, <a href=\"https://profiles.wordpress.org/audrasjb/\">Jb Audras</a>, <a href=\"https://profiles.wordpress.org/jdy68/\">Jenny Dupuy</a>, <a href=\"https://profiles.wordpress.org/leprincenoir/\">Kantari Samy</a>, <a href=\"https://profiles.wordpress.org/oellin/\">Magali</a>, <a href=\"https://profiles.wordpress.org/nuryko/\">Marianna</a>, <a href=\"https://profiles.wordpress.org/chaton666/\">Marie Comet</a>, <a href=\"https://profiles.wordpress.org/marineevain/\">Marine EVAIN</a>, <a href=\"https://profiles.wordpress.org/maxpertici/\">Maxime Pertici</a>, <a href=\"https://profiles.wordpress.org/nandow/\">nandow</a>, <a href=\"https://profiles.wordpress.org/pasglop\">pasglop</a>, <a href=\"https://profiles.wordpress.org/petitphp\">petitphp</a>, <a href=\"https://profiles.wordpress.org/larrach/\">Rachel Peter</a>, <a href=\"https://profiles.wordpress.org/ravanh\">Rolf Allard van Hagen</a>,&nbsp;<a href=\"https://profiles.wordpress.org/sebastienserre\">Sbastien SERRE</a>, <a href=\"https://profiles.wordpress.org/simonjanin/\">Simon Janin</a>, <a href=\"https://profiles.wordpress.org/spaceshipone/\">Timothe Brosille</a>, <a href=\"https://profiles.wordpress.org/virgar/\">Virginie Garnier</a>, <a href=\"https://profiles.wordpress.org/whaze/\">whaze</a>, et <a href=\"https://profiles.wordpress.org/wplmillet/\">wplmillet</a>.</p>\n\n\n\n<p>Nhsitez pas  <a href=\"https://fr.wordpress.org/team/handbook/\">rejoindre les quipes de contribution francophones&nbsp;!</a></p>\n\n\n\n<h2 class=\"wp-block-heading\">Et pour la suite&nbsp;?</h2>\n\n\n\n<p>Il y a 20 ans, <a href=\"https://wordpress.org/news/2003/05/wordpress-now-available/\">WordPress sortait sa premire version, la version 0.7</a>. Ce qui a commenc par un article de blog de Matt Mullenweg et un commentaire enthousiaste du co-fondateur Mike Little a volu pour devenir la plateforme de publication web la plus populaire du monde&nbsp;!</p>\n\n\n\n<p>WordPress continue dvoluer et ditrer pour devenir toujours plus robuste et pour rpondre aux attentes de sa communaut. Cette version clture la <a href=\"https://make.wordpress.org/core/2023/02/04/phase-2-finale/\">Phase 2 (en anglais)</a>&nbsp;de notre <a href=\"https://wordpress.org/about/roadmap/\">feuille de route (en anglais)</a>. Tous les efforts vont maintenant se tourner vers la&nbsp;<a href=\"https://make.wordpress.org/core/2023/03/24/phase-3-collaboration/\">Phase 3</a>, qui vise a apporter une gestion collaborative au sein de votre CMS favori.</p>\n\n\n\n<p>Pour finir lanne 2023 en beaut, lquipe de direction de WordPress&nbsp;6.4 sera entirement compose de femmes et de personnes non-binaires, tout comme lavait t la version 5.6 en 2020.</p>\n\n\n\n<p class=\"has-text-align-right\" style=\"font-size:14px\">Article rdig/traduit par <a href=\"https://profiles.wordpress.org/audrasjb\">Jb Audras</a>, avec la relecture de <a href=\"https://profiles.wordpress.org/jdy68\">Jenny Dupuy</a> et <a href=\"https://profiles.wordpress.org/sebastienserre/\">Sbastien Serre</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"https://fr.wordpress.org/2023/08/08/wordpress-6-3-lionel/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:76:\"\n		\n		\n					\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"Guide des changements techniques de WordPress6.3\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:86:\"https://fr.wordpress.org/2023/07/18/guide-des-changements-techniques-de-wordpress-6-3/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:94:\"https://fr.wordpress.org/2023/07/18/guide-des-changements-techniques-de-wordpress-6-3/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 18 Jul 2023 18:07:59 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:5:\"Guide\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:31:\"Nouvelles versions de WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=2742\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:417:\"Ce guide dcrit les principaux changements techniques que vous trouverez sur WordPress&#160;6.3, dont la sortie est prvue le 8 aot 2023. Cette version implmente 345 tickets&#160;: 126 tickets correspondent  des amliorations et nouvelles fonctionnalits, tandis que 198 tickets sont des corrections de bugs, auxquels s&#8217;ajoutent 21 tches diverses. Cette version implmente par ailleurs 68 [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:39646:\"\n<p>Ce guide dcrit les principaux changements techniques que vous trouverez sur WordPress&nbsp;6.3, dont la sortie est prvue le 8 aot 2023.</p>\n\n\n\n<figure class=\"wp-block-image size-large\"><a href=\"https://fr.wordpress.org/files/2023/07/changements-techniques-wordpress-6-3.png\"><img loading=\"lazy\" decoding=\"async\" width=\"1024\" height=\"458\" src=\"https://fr.wordpress.org/files/2023/07/changements-techniques-wordpress-6-3-1024x458.png\" alt=\"WordPress 6.3 : le guide des changements techniques!\" class=\"wp-image-2745\" srcset=\"https://fr.wordpress.org/files/2023/07/changements-techniques-wordpress-6-3-1024x458.png 1024w, https://fr.wordpress.org/files/2023/07/changements-techniques-wordpress-6-3-300x134.png 300w, https://fr.wordpress.org/files/2023/07/changements-techniques-wordpress-6-3-768x343.png 768w, https://fr.wordpress.org/files/2023/07/changements-techniques-wordpress-6-3-1536x687.png 1536w, https://fr.wordpress.org/files/2023/07/changements-techniques-wordpress-6-3.png 1986w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure>\n\n\n\n<p>Cette version implmente <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;milestone=6.3&amp;group=component&amp;col=id&amp;col=summary&amp;col=owner&amp;col=type&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">345</a> tickets&nbsp;: <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=enhancement&amp;type=feature+request&amp;milestone=6.3&amp;max=500&amp;col=id&amp;col=summary&amp;col=type&amp;col=status&amp;col=milestone&amp;col=owner&amp;col=priority&amp;order=priority\">126 tickets correspondent  des amliorations et nouvelles fonctionnalits</a>, tandis que <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=defect+(bug)&amp;milestone=6.3&amp;max=500&amp;col=id&amp;col=summary&amp;col=type&amp;col=status&amp;col=milestone&amp;col=owner&amp;col=priority&amp;order=priority\">198 tickets sont des corrections de bugs</a>, auxquels s&rsquo;ajoutent <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=task+(blessed)&amp;milestone=6.3&amp;max=500&amp;col=id&amp;col=summary&amp;col=type&amp;col=status&amp;col=milestone&amp;col=owner&amp;col=priority&amp;order=priority\">21 tches diverses</a>.</p>\n\n\n\n<p>Cette version implmente par ailleurs <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;focuses=~performance&amp;milestone=6.3&amp;group=component&amp;col=id&amp;col=summary&amp;col=status&amp;col=focuses&amp;col=owner&amp;col=type&amp;col=priority&amp;order=priority\">68 tickets ayant un focus sur les performances</a> et <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;focuses=~accessibility&amp;milestone=6.3&amp;group=component&amp;col=id&amp;col=summary&amp;col=status&amp;col=focuses&amp;col=owner&amp;col=type&amp;col=priority&amp;order=priority\">23 sur l&rsquo;accessibilit</a>, tandis que <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;focuses=~coding-standards&amp;milestone=6.3&amp;group=component&amp;col=id&amp;col=summary&amp;col=status&amp;col=focuses&amp;col=owner&amp;col=type&amp;col=priority&amp;order=priority\">33 tickets sont lis  la modernisation du code du CMS.</a></p>\n\n\n\n<p>Le projet Gutenberg inclut quant  lui <a href=\"https://github.com/WordPress/gutenberg/commits/wp/6.3\">1737 <em>pull requests</em></a>, dont 307 correspondent  des amliorations, 481  des correctifs de bugs et 55  des amliorations d&rsquo;accessibilit.</p>\n\n\n\n<p>Les modifications de WordPress 6.3 se rpartissent dans 43 composants <em>Core</em>, et vous trouverez dans ce communiqu les modifications les plus impactantes, composant par composant.</p>\n\n\n\n<p class=\"has-text-align-center has-background\" style=\"background-color:#fee7af\">En route pour un petit tour dhorizon des<br>nouveauts techniques de WordPress&nbsp;6.3&nbsp;<img src=\"https://s.w.org/images/core/emoji/15.0.3/72x72/1f680.png\" alt=\"\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p>Tous les liens de cet article pointent vers des notes de dveloppement rdiges en anglais.</p>\n\n\n\n<p>Lobjectif est de fournir un panorama gnral des changements techniques apports par cette version, en franais, puis de diriger les personnes qui souhaitent en savoir plus vers les notes de dveloppement en anglais.</p>\n\n\n\n<p class=\"has-background\" style=\"background-color:#fee7af\"> noter&nbsp;: certaines modifications listes ici vont ncessiter des actions de la part des auteurs et autrices de thmes et dextensions, qui devront adapter ou modifier leur code. Si vous tes concerne, veuillez lire les notes de dveloppement listes dans cet article consciencieusement afin de vous assurer que votre code fonctionnera avec WordPress&nbsp;6.3 lorsque cette version sortira le 8&nbsp;aot 2023.</p>\n\n\n\n<h2 class=\"wp-block-heading\" id=\"Themes\">Lditeur de blocs</h2>\n\n\n\n<p>WordPress 6.3 n&rsquo;implmente pas moins de 10 versions de l&rsquo;extension Gutenberg&nbsp;: <a href=\"https://make.wordpress.org/core/2023/02/24/whats-new-in-gutenberg-15-2-22-february/\">15.2</a>, <a href=\"https://make.wordpress.org/core/2023/03/13/whats-new-in-gutenberg-15-3-13-march/\">15.3</a>, <a href=\"https://make.wordpress.org/core/2023/03/22/whats-new-in-gutenberg-15-4-22-march/\">15.4</a>, <a href=\"https://make.wordpress.org/core/2023/04/05/whats-new-in-gutenberg-15-5-05-april/\">15.5</a>, <a href=\"https://make.wordpress.org/core/2023/04/19/whats-new-in-gutenberg-15-6-19-april/\">15.6</a>, <a href=\"https://make.wordpress.org/core/2023/05/04/whats-new-in-gutenberg-15-7-03-may/\">15.7</a>, <a href=\"https://make.wordpress.org/core/2023/05/20/whats-new-in-gutenberg-15-8-may-17/\">15.8</a>, <a href=\"https://make.wordpress.org/core/2023/05/31/whats-new-in-gutenberg-15-9-31-may/\">15.9</a>, <a href=\"https://make.wordpress.org/core/2023/06/14/whats-new-in-gutenberg-16-0-14-june/\">16.0</a> et <a href=\"https://make.wordpress.org/core/2023/06/29/whats-new-in-gutenberg-16-1-29-june/\">16.1</a>. Vous trouverez de nouvelles API, de nouvelles proprits de blocs, un mode d&rsquo;dition de blocs, des classes de couleurs et de nombreuses autres modifications.</p>\n\n\n\n<p class=\"has-background\" style=\"background-color:#fee7af\"> noter&nbsp;: les blocs rutilisables ont t renomms en &nbsp;compositions synchronises&nbsp;.</p>\n\n\n\n<p>Pour en savoir plus, consultez les notes de dveloppement suivantes&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"fr4i2nQpWn\"><a href=\"https://make.wordpress.org/core/2023/07/17/introducing-the-block-selectors-api/\">Introducing the Block Selectors API</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Introducing the Block Selectors API&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2023/07/17/introducing-the-block-selectors-api/embed/#?secret=GXC8ahmhDc#?secret=fr4i2nQpWn\" data-secret=\"fr4i2nQpWn\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"H7Cqf5aQEs\"><a href=\"https://make.wordpress.org/core/2023/07/17/introducing-the-wordpress-command-palette-api/\">Introducing the WordPress Command Palette API</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Introducing the WordPress Command Palette API&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2023/07/17/introducing-the-wordpress-command-palette-api/embed/#?secret=YZpSTubUME#?secret=H7Cqf5aQEs\" data-secret=\"H7Cqf5aQEs\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"3eXohoIrwT\"><a href=\"https://make.wordpress.org/core/2023/07/14/layout-updates-in-the-editor-for-wordpress-6-3/\">Layout updates in the editor for WordPress 6.3</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Layout updates in the editor for WordPress 6.3&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2023/07/14/layout-updates-in-the-editor-for-wordpress-6-3/embed/#?secret=B0jyFQzmfc#?secret=3eXohoIrwT\" data-secret=\"3eXohoIrwT\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"ZwSuUmp9h4\"><a href=\"https://make.wordpress.org/core/2023/07/17/social-icons-block-applied-colors-now-dynamically-update-based-on-theme-json-and-global-styles/\">Social Icons block: Applied colors now dynamically update based on theme.json and Global Styles</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Social Icons block: Applied colors now dynamically update based on theme.json and Global Styles&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2023/07/17/social-icons-block-applied-colors-now-dynamically-update-based-on-theme-json-and-global-styles/embed/#?secret=IGM8s3Dy3Z#?secret=ZwSuUmp9h4\" data-secret=\"ZwSuUmp9h4\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"5EDPh16ZiE\"><a href=\"https://make.wordpress.org/core/2023/07/18/miscellaneous-editor-changes-in-wordpress-6-3/\">Miscellaneous Editor changes in WordPress 6.3</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Miscellaneous Editor changes in WordPress 6.3&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2023/07/18/miscellaneous-editor-changes-in-wordpress-6-3/embed/#?secret=eCx0Lr0Jgy#?secret=5EDPh16ZiE\" data-secret=\"5EDPh16ZiE\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\">Thmes natifs</h2>\n\n\n\n<p>Les thmes natifs ont abandonn le support du navigateur Internet Explorer et n&rsquo;incluent donc plus aucun script ou feuille de styles destine  ce navigateur. Les scripts HTML5 Shiv ne sont d&rsquo;ailleurs plus chargs non plus dans les thmes <em>Twenty Thirteen</em>, <em>Twenty Fifteen</em> et <em>Twenty Seventeen</em> (ticket <a href=\"https://core.trac.wordpress.org/ticket/56699\">#56699</a>).</p>\n\n\n\n<p>Les personnes qui souhaitent continuer  supporter IE peuvent cependant utiliser un bout de code pour restaurer ces fonctionnalits.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"Ktv8WMHYeS\"><a href=\"https://make.wordpress.org/core/2023/07/18/bundled-themes-dropping-internet-explorer-scripts-and-styles/\">Bundled themes dropping Internet Explorer scripts and styles</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Bundled themes dropping Internet Explorer scripts and styles&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2023/07/18/bundled-themes-dropping-internet-explorer-scripts-and-styles/embed/#?secret=jVh85wFtah#?secret=Ktv8WMHYeS\" data-secret=\"Ktv8WMHYeS\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\">API de gestion du cache</h2>\n\n\n\n<p>L&rsquo;API de gestion du cache a reu de nombreuses amliorations, notamment l&rsquo;introduction de nouveaux groupes de cache spcifiques aux requtes afin d&rsquo;offrir un meilleur contrle aux dveloppeureuses.</p>\n\n\n\n<p>Vous pouvez maintenant dfinir le moment d&rsquo;expiration du cache d&rsquo;un groupe, vider le cache de groupes spcifiques, modifier la dernire valeur d&rsquo;un groupe ou encore dclarer certains groupes d&rsquo;objets mis en cache comme n&rsquo;tant pas persistants. Avec ces changements, vous pouvez implmenter votre propre stratgie personnalise d&rsquo;invalidation du cache.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"43XhEmI04p\"><a href=\"https://make.wordpress.org/core/2023/07/17/improvements-to-the-cache-api-in-wordpress-6-3/\">Improvements to the Cache API in WordPress 6.3</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Improvements to the Cache API in WordPress 6.3&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2023/07/17/improvements-to-the-cache-api-in-wordpress-6-3/embed/#?secret=f581tEkEGQ#?secret=43XhEmI04p\" data-secret=\"43XhEmI04p\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\">API de gestion du systme de fichiers</h2>\n\n\n\n<p>Les fichiers masqus (prfixs par <code>.</code>) peuvent maintenant tre inclus dans la fonction <code>list_files()</code> avec un nouveau paramtre optionnel <code>$include_hidden</code>. Sa valeur par dfaut est <code>false</code> pour cause de rtrocompatibilit (ticket <a href=\"https://core.trac.wordpress.org/ticket/53659\">#53659</a>).</p>\n\n\n\n<h2 class=\"wp-block-heading\">Mode dveloppement</h2>\n\n\n\n<p>Une nouvelle constante <code>WP_DEVELOPMENT_MODE</code> a t introduite afin de dterminer un contexte de dveloppement spcifique. Les valeurs reconnues pour cette constante sont <code>core</code>, <code>plugin</code>, <code>theme</code>, <code>all</code>, ou une chane vide, valeur par dfaut indiquant que le site n&rsquo;est pas dans un contexte de dveloppement.</p>\n\n\n\n<p>Deux nouvelles fonctions ont t ajoutes pour interagir avec le mode dveloppement&nbsp;:  <code>wp_in_development_mode( $mode )</code> et <code>wp_get_development_mode()</code>.</p>\n\n\n\n<p>Les diffrents contextes de dveloppement affectent des fonctionnalits de mise en cache spcifiques. Par exemple, le cache est surcharg lorsque le site se situe en mode dveloppement de thme, mais pas si l&rsquo;on est en mode dveloppement <code>core</code> (ticket <a href=\"https://core.trac.wordpress.org/ticket/57487\">#57487</a>).</p>\n\n\n\n<p>La valeur actuelle de la constante <code>WP_DEVELOPMENT_MODE</code> est aussi accessible sur l&rsquo;cran <em>Outils &gt; Sant du site &gt; Informations</em>, dans la section listant les constantes WordPress (<a href=\"https://core.trac.wordpress.org/ticket/58646\">#58646</a>).</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"aDKovkv98w\"><a href=\"https://make.wordpress.org/core/2023/07/14/configuring-development-mode-in-6-3/\">Configuring development mode in 6.3</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Configuring development mode in 6.3&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2023/07/14/configuring-development-mode-in-6-3/embed/#?secret=cBE03rlq9a#?secret=aDKovkv98w\" data-secret=\"aDKovkv98w\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\">Prise en charge de PHP</h2>\n\n\n\n<p>La prise en charge de PHP 5 a t abandonne dans WordPress 6.3.</p>\n\n\n\n<p>La nouvelle version minimale prise en charge est PHP 7.0.</p>\n\n\n\n<p>La version recommande de PHP demeure toujours 7.4 ou plus (ticket <a href=\"https://core.trac.wordpress.org/ticket/57345\">#57345</a>).</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"s9AIYWhNfT\"><a href=\"https://make.wordpress.org/core/2023/07/05/dropping-support-for-php-5/\">Dropping support for PHP 5</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Dropping support for PHP 5&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2023/07/05/dropping-support-for-php-5/embed/#?secret=5vdOVwMIW0#?secret=s9AIYWhNfT\" data-secret=\"s9AIYWhNfT\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\">Internationalisation</h2>\n\n\n\n<p>Plusieurs amliorations, dont la possibilit de court-circuiter le filtre <code>load_textdomain</code> et de rduire le temps de chargement des traductions en temps rel.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"XR1aBIdf1z\"><a href=\"https://make.wordpress.org/core/2023/07/14/i18n-improvements-in-6-3/\">I18N Improvements in 6.3</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;I18N Improvements in 6.3&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2023/07/14/i18n-improvements-in-6-3/embed/#?secret=d9bcL97SGO#?secret=XR1aBIdf1z\" data-secret=\"XR1aBIdf1z\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\">Mdias</h2>\n\n\n\n<p>Le composant Mdias a reu plusieurs amliorations destines  diminuer le temps de chargement des contenus comprenant des images. WordPress ajoute maintenant automatiquement l&rsquo;attribut <code>fetchpriority</code> avec la valeur <code>high</code>  l&rsquo;image qui est la plus susceptible dtre considre comme l&rsquo;image LCP (<em>Largest Contentful Paint</em>).</p>\n\n\n\n<p>D&rsquo;autres amliorations ont t faites sur la gestion automatique du chargement diffr des images afin de mieux dtecter les moments o l&rsquo;attribut doit tre omis, sur certaines images.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"chnuuSxod7\"><a href=\"https://make.wordpress.org/core/2023/07/13/image-performance-enhancements-in-wordpress-6-3/\">Image performance enhancements in WordPress 6.3</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Image performance enhancements in WordPress 6.3&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2023/07/13/image-performance-enhancements-in-wordpress-6-3/embed/#?secret=8ckMyzrFCS#?secret=chnuuSxod7\" data-secret=\"chnuuSxod7\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\">API de gestion des mtadonnes</h2>\n\n\n\n<p>Les performances de la gestion des mtadonnes ont t grandement amliores en dveloppant la capacit de WordPress a charger de faon conditionnelle certaines mtadonnes des termes de taxonomies, des commentaires ou encore des sites d&rsquo;un multisite. Ce chargement conditionnel permet d&rsquo;viter de demander la rcupration de donnes alors qu&rsquo;elles ne sont pas utilises dans l&rsquo;cran. Cela rduit les requtes inutiles en base de donnes et amliore les performances d&rsquo;ensemble de votre site.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"8QRJ9Cis0Y\"><a href=\"https://make.wordpress.org/core/2023/07/13/improvements-to-the-metadata-api-in-wordpress-6-3/\">Improvements to the metadata API in WordPress 6.3</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Improvements to the metadata API in WordPress 6.3&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2023/07/13/improvements-to-the-metadata-api-in-wordpress-6-3/embed/#?secret=qWCiCPtWTi#?secret=8QRJ9Cis0Y\" data-secret=\"8QRJ9Cis0Y\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\">Gestion des publications</h2>\n\n\n\n<p>La fonction <code>get_pages()</code> a t refactorise afin d&rsquo;utiliser <code>WP_Query</code>. Cette amlioration rduit significativement la complexit de la fonction historique <code>get_pages()</code> en dchargeant la responsabilit des performances et de la gestion du cache sur la classe <code>WP_Query</code> (tickets <a href=\"https://core.trac.wordpress.org/ticket/55806\">#55806</a> et <a href=\"https://core.trac.wordpress.org/ticket/12821\">#12821</a>).</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"I2CHfgCEuA\"><a href=\"https://make.wordpress.org/core/2023/07/14/wp_query-used-internally-in-get_pages/\">WP_Query used internally in get_pages()</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;WP_Query used internally in get_pages()&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2023/07/14/wp_query-used-internally-in-get_pages/embed/#?secret=VMCWOsj8lb#?secret=I2CHfgCEuA\" data-secret=\"I2CHfgCEuA\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\">Chargement des scripts</h2>\n\n\n\n<p>La prise en charge des attributs HTML5 <code>async</code> et <code>defer</code> a t ajoute, ce qui permet aux dveloppeureuses de dfinir une stratgie de chargement de leurs scripts. La stratgie de chargement peut tre active en modifiant le paramtre <code>$in_footer</code> pour lui fournir un tableau contenant une stratgie de chargement pour les fonctions <code>wp_register_script()</code> et <code>wp_enqueue_script()</code>. Si elle est prsente, la stratgie de chargement sera ajoute  la balise <code>script</code> associe.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"WgaxlKR7ax\"><a href=\"https://make.wordpress.org/core/2023/07/14/registering-scripts-with-async-and-defer-attributes-in-wordpress-6-3/\">Registering scripts with `async` and `defer` attributes in WordPress 6.3</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Registering scripts with `async` and `defer` attributes in WordPress 6.3&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2023/07/14/registering-scripts-with-async-and-defer-attributes-in-wordpress-6-3/embed/#?secret=fqKullarzx#?secret=WgaxlKR7ax\" data-secret=\"WgaxlKR7ax\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\">Gestion des mises  jour des extensions et des thmes</h2>\n\n\n\n<p>WordPress 6.3 propose une nouvelle fonctionnalit de restauration. Cela permettra  WordPress de restaurer automatiquement la version prcdente d&rsquo;un thme ou d&rsquo;une extension si la mise  jour automatique associe a fait planter le site.</p>\n\n\n\n<ul>\n<li>Lorsqu&rsquo;un thme ou une extension est mise  jour, la version prcdente est dplace dans un rpertoire de sauvegarde temporaire&nbsp;:\n<ul>\n<li><code>wp-content/upgrade-temp-backup/plugins/[slug]</code> pour les extensions&nbsp;;</li>\n\n\n\n<li><code>wp-content/upgrade-temp-backup/themes/[slug]</code> pour les thmes.</li>\n</ul>\n</li>\n\n\n\n<li>Si la mise  jour choue, alors la sauvegarde est restaure dans son emplacement d&rsquo;origine.</li>\n\n\n\n<li>Si la mise  jour russit, la sauvegarde temporaire est supprime.</li>\n</ul>\n\n\n\n<p>Deux nouveaux tests sont galement ajouts  l&rsquo;cran de Sant du site&nbsp;:</p>\n\n\n\n<ul>\n<li>Vrification que le rpertoire <code>upgrade-temp-backup</code> est accessible en criture&nbsp;;</li>\n\n\n\n<li>Vrification qu&rsquo;il y a assez d&rsquo;espace disque disponible pour effectuer les mises  jour sans risque.</li>\n</ul>\n\n\n\n<p class=\"has-background\" style=\"background-color:#fee7af\">Veuillez noter que cette fonctionnalit de restauration ne peut pas tre utilise pour remettre en place la version prcdente d&rsquo;un thme ou d&rsquo;une extension aprs une mise  jour russie. Cela ne fonctionne que si le site a rencontr une erreur fatale et que le site est donc considr comme tant non fonctionnel.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"KlkvgbdaA4\"><a href=\"https://make.wordpress.org/core/2023/07/11/new-in-6-3-rollback-for-failed-manual-plugin-and-theme-updates/\">New in 6.3: Rollback for failed manual plugin and theme updates</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;New in 6.3: Rollback for failed manual plugin and theme updates&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2023/07/11/new-in-6-3-rollback-for-failed-manual-plugin-and-theme-updates/embed/#?secret=BLhsK1JJ2l#?secret=KlkvgbdaA4\" data-secret=\"KlkvgbdaA4\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\">Gestion des comptes</h2>\n\n\n\n<p>La classe <code>WP_User_Query</code> tait la dernire classe de ce type qui ne permettait pas encore la mise en cache des rsultats, c&rsquo;est maintenant chose faite. Chaque appels  la classe <code>WP_User_Query</code> sera maintenant automatiquement mis en cache par dfaut,  moins qu&rsquo;un paramtre n&rsquo;indique de ne pas le faire. Il est aussi possible de dsactiver la mise en cache globalement en utilisant un filtre.</p>\n\n\n\n<p>Les rsultats des requtes sont placs dans le groupe de cache <code>user-queries</code>. La mise en cache est dsactive pour les requtes utilisant le paramtre <code>field</code> et pour les requtes comprenant plus de 3 champs.</p>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"13zqhWUf4N\"><a href=\"https://make.wordpress.org/core/2023/07/14/improved-caching-for-database-queries-in-wp_user_query/\">Improved Caching for Database Queries in WP_User_Query</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Improved Caching for Database Queries in WP_User_Query&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2023/07/14/improved-caching-for-database-queries-in-wp_user_query/embed/#?secret=skGzL7TdyL#?secret=13zqhWUf4N\" data-secret=\"13zqhWUf4N\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2 class=\"wp-block-heading\">Autres changements techniques</h2>\n\n\n\n<figure class=\"wp-block-embed is-type-wp-embed is-provider-make-wordpress-core wp-block-embed-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"5koxx2lcPh\"><a href=\"https://make.wordpress.org/core/2023/07/18/miscellaneous-developer-changes-in-wordpress-6-3/\">Miscellaneous developer changes in WordPress 6.3</a></blockquote><iframe class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" title=\"&#8220;Miscellaneous developer changes in WordPress 6.3&#8221; &#8212; Make WordPress Core\" src=\"https://make.wordpress.org/core/2023/07/18/miscellaneous-developer-changes-in-wordpress-6-3/embed/#?secret=QphWX7aeRe#?secret=5koxx2lcPh\" data-secret=\"5koxx2lcPh\" width=\"500\" height=\"282\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3 class=\"wp-block-heading\">API CRON</h3>\n\n\n\n<p>La limite de la mmoire CRON a t agrandie sur la constante <code>WP_MAX_MEMORY_LIMIT</code> (par dfaut de 256&nbsp;Mo). Un nouveau filtre <code>cron_memory_limit</code> a t ajout  pour ajuster cette valeur si ncessaire (ticket <a href=\"https://core.trac.wordpress.org/ticket/56628\">#56628</a>).</p>\n\n\n\n<h3 class=\"wp-block-heading\">diteur</h3>\n\n\n\n<p>Un nouvel attribut <code>source</code> a t ajout sur les compositions de blocs afin de permettre de les filtrer  partir de cette source (ticket <a href=\"https://core.trac.wordpress.org/ticket/58622\">#58622</a>).</p>\n\n\n\n<h3 class=\"wp-block-heading\">Contenus embarqus</h3>\n\n\n\n<ul>\n<li>Anghami a t ajout en tant que fournisseur oEmbed de confiance (ticket <a href=\"https://core.trac.wordpress.org/ticket/49850\">#49850</a>)&nbsp;;</li>\n\n\n\n<li>La prise en charge des profils de crateurice TikTok a t ajoute (ticket <a href=\"https://core.trac.wordpress.org/ticket/55784\">#55784</a>).</li>\n</ul>\n\n\n\n<h3 class=\"wp-block-heading\">Formatage</h3>\n\n\n\n<ul>\n<li>Ajout des attributs ARIA suivants aux attributs autoriss dans les fonctions KSES&nbsp;: <code>aria-controls</code>, <code>aria-expanded</code>, and <code>aria-current</code> (ticket <a href=\"https://core.trac.wordpress.org/ticket/55370\">#55370</a>)&nbsp;;</li>\n\n\n\n<li>La fonction CSS <code>repeat()</code> a t ajoute aux lments autoriss dans les fonctions KSES (ticket <a href=\"https://core.trac.wordpress.org/ticket/58551\">#58551</a>).</li>\n</ul>\n\n\n\n<h3 class=\"wp-block-heading\">Divers</h3>\n\n\n\n<ul>\n<li>Dans les fonctions KSES, la fonction <code>safecss_filter_attr()</code> a t revue afin d&rsquo;autoriser la proprit <code>filter</code>  recevoir une URL en rfrence  un lment SVG (ticket <a href=\"https://core.trac.wordpress.org/ticket/57780\">#57780</a>)&nbsp;;</li>\n\n\n\n<li><code>strpos()</code> a t remplac par diffrentes fonctions PHP modernes afin de faire voluer le code du CMS (tickets <a href=\"https://core.trac.wordpress.org/ticket/58012\">#58012</a>, <a href=\"https://core.trac.wordpress.org/ticket/58206\">#58206</a> et <a href=\"https://core.trac.wordpress.org/ticket/58220\">#58220</a>)&nbsp;;</li>\n\n\n\n<li>Dans la classe WP_Comments_List_Table, lorsque la fonction <code>get_comments()</code> est appele, le paramtre <code>update_comment_post_cache</code> est pass avec la valeur <code>true</code>, afin d&rsquo;amliorer les performances (<a href=\"https://core.trac.wordpress.org/ticket/57802\">#57802</a>)&nbsp;;</li>\n\n\n\n<li>La fonction <code>_wp_array_get()</code> est la fonction la plus appele sur l&rsquo;interface publique de tous les sites WordPress, puisqu&rsquo;elle est appele environ 23&nbsp;000 fois sur chaque chargement de page sur un thme bas sur des blocs. WordPress 6.3 ajoute quelques amliorations de performances sur cette fonction (ticket <a href=\"https://core.trac.wordpress.org/ticket/58376\">#58376</a>)&nbsp;;</li>\n\n\n\n<li>Un nouveau crochet d&rsquo;action <code>bulk_edit_posts</code> a t ajout afin de permettre de dclencher une action aprs que les donnes d&rsquo;une dition par lot aient t traites et avant de renvoyer les rsultats. Cela permet notamment aux dveloppeurs et dveloppeuses d&rsquo;ajouter d&rsquo;autres modifications sans avoir besoin de greffer des appels AJAX supplmentaires (ticket <a href=\"https://core.trac.wordpress.org/ticket/28112\">#28112</a>).</li>\n</ul>\n\n\n\n<h3 class=\"wp-block-heading\">API REST</h3>\n\n\n\n<ul>\n<li>L&rsquo;API REST <code>Themes</code> permet maintenant de savoir si un thme prend en charge l&rsquo;diteur de site, grce  la proprit <code>is_block_theme </code>situe dans la rponse API du point de terminaison <code>wp/v2/themes</code> (ticket <a href=\"https://core.trac.wordpress.org/ticket/58123\">#58123</a>);</li>\n\n\n\n<li>Un point de terminaison a t ajout afin d&rsquo;obtenir les rvisions des styles globaux, accessible sur <code>/wp/v2/global-styles/revisions</code> (ticket <a href=\"https://core.trac.wordpress.org/ticket/58524\">#58524</a>);</li>\n\n\n\n<li><code>WP_REST_Templates_Controller</code> a t modifi afin d&rsquo;inclure un champ <code>modified</code> pour connatre la date de modification des modles et des lments de modles (ticket <a href=\"https://core.trac.wordpress.org/ticket/58540\">#58540</a>).</li>\n</ul>\n\n\n\n<h3 class=\"wp-block-heading\">Thmes</h3>\n\n\n\n<p>La nouvelle fonction publique <code>wp_get_remote_theme_patterns()</code> a t ajoute afin d&rsquo;effectuer des requtes sur les <code>patterns</code> provenant du <code>theme.json</code> et se substitue aux prcdents usages d&rsquo;API prives (<a href=\"https://core.trac.wordpress.org/ticket/58460\">#58460</a>).</p>\n\n\n\n<h3 class=\"wp-block-heading\">Nouveaux crochets d&rsquo;actions</h3>\n\n\n\n<ul>\n<li><code>bulk_edit_posts</code> (<a href=\"https://core.trac.wordpress.org/ticket/28112\">#28112</a>)</li>\n\n\n\n<li><code>wp_update_user</code> (<a href=\"https://core.trac.wordpress.org/ticket/57843\">#57843</a>)</li>\n\n\n\n<li><code>wp_cache_set_last_changed</code> (<a href=\"https://core.trac.wordpress.org/ticket/57905\">#57905</a>)</li>\n</ul>\n\n\n\n<h3 class=\"wp-block-heading\">Nouveaux filtres</h3>\n\n\n\n<ul>\n<li><code>plugins_list</code> (<a href=\"https://core.trac.wordpress.org/ticket/57278\">#57278</a>)</li>\n\n\n\n<li><code>pre_load_textdomain</code> (<a href=\"https://core.trac.wordpress.org/ticket/58035\">#58035</a>)</li>\n\n\n\n<li><code>wp_get_attachment_image_context</code> (<a href=\"https://core.trac.wordpress.org/ticket/58212\">#58212</a>)</li>\n\n\n\n<li><code>get_pages_query_args</code> (<a href=\"https://core.trac.wordpress.org/ticket/12821\">#12821</a>)</li>\n\n\n\n<li><code>cron_memory_limit</code> (<a href=\"https://core.trac.wordpress.org/ticket/56628\">56628</a>)</li>\n\n\n\n<li><code>nav_menu_item_attributes</code> (<a href=\"https://core.trac.wordpress.org/ticket/57140\">#57140</a>)</li>\n\n\n\n<li><code>nav_menu_link_attributes</code> (<a href=\"https://core.trac.wordpress.org/ticket/57140\">#57140</a>)</li>\n\n\n\n<li><code>nav_menu_submenu_attributes</code> (<a href=\"https://core.trac.wordpress.org/ticket/57140\">#57140</a>)</li>\n\n\n\n<li><code>pre_wp_setup_nav_menu_item</code> (<a href=\"https://core.trac.wordpress.org/ticket/56577\">#56577</a>)</li>\n\n\n\n<li><code>site_editor_no_javascript_message</code> (<a href=\"https://core.trac.wordpress.org/ticket/56228\">#56228</a>)</li>\n\n\n\n<li><code>image_edit_thumbnails_separately</code> (<a href=\"https://core.trac.wordpress.org/ticket/57685\">#57685</a>)</li>\n\n\n\n<li><code>wp_navigation_should_create_fallback</code> (<a href=\"https://core.trac.wordpress.org/ticket/58750\">#58750</a>)</li>\n\n\n\n<li><code>wp_min_priority_img_pixels</code> (<a href=\"https://core.trac.wordpress.org/ticket/58235\">#58235</a>)</li>\n</ul>\n\n\n\n<h3 class=\"wp-block-heading\">Crochets d&rsquo;actions et filtres modifis</h3>\n\n\n\n<ul>\n<li><code>rest_allowed_cors_headers</code> (<a href=\"https://core.trac.wordpress.org/ticket/57752\">#57752</a>) et <code>rest_exposed_cors_headers</code> (<a href=\"https://core.trac.wordpress.org/ticket/57752\">#57752</a>)</li>\n\n\n\n<li><code>edit_custom_thumbnail_sizes</code> a t dprci et remplac par <code>image_edit_thumbnails_separately</code> (<a href=\"https://core.trac.wordpress.org/ticket/57685\">#57685</a>)</li>\n</ul>\n\n\n\n<h3 class=\"wp-block-heading\">Fichiers dprcis</h3>\n\n\n\n<ul>\n<li>Le fichier <code>wp-admin/media.php</code> a t dprci. Les personnes visitant cette page seront rediriges sur la mdiathque, avec une notification (ticket <a href=\"https://core.trac.wordpress.org/ticket/57612\">#57612</a>).</li>\n</ul>\n\n\n\n<h3 class=\"wp-block-heading\">Mise  jour de bibliothques externes</h3>\n\n\n\n<p>Les bibliothques externes suivantes ont t mises  jour&nbsp;:</p>\n\n\n\n<ul>\n<li><code>PHPMailer</code> vers la version 6.8.0 (<a href=\"https://core.trac.wordpress.org/ticket/57873\">#57873</a>)</li>\n\n\n\n<li><code>Requests library</code> vers la version 2.0.6 (<a href=\"https://core.trac.wordpress.org/ticket/58079\">#58079</a>)</li>\n\n\n\n<li><code>jQuery</code> vers la version 3.7.0 (<a href=\"https://core.trac.wordpress.org/ticket/58083\">#58083</a>)</li>\n\n\n\n<li><code>Sodium Compat</code> vers la version 1.20.0 (<a href=\"https://core.trac.wordpress.org/ticket/58224\">#58224</a>)</li>\n\n\n\n<li><code>jQuery Migrate</code> vers la version 3.4.1 (<a href=\"https://core.trac.wordpress.org/ticket/58451\">#58451</a>)</li>\n\n\n\n<li><code>npm</code> vers la dernire version disponible (<a href=\"https://core.trac.wordpress.org/ticket/58623\">#58623</a>)</li>\n</ul>\n\n\n\n<p class=\"has-background\" style=\"background-color:#fee7af\">Que vous dveloppiez des thmes ou des extensions, pensez  tester et retester votre code pour vous assurer de sa compatibilit avec ces changements. Vous pouvez utiliser&nbsp;<a rel=\"noreferrer noopener\" href=\"https://wordpress.org/plugins/wordpress-beta-tester/\" target=\"_blank\">lextension Beta Tester</a>&nbsp;sur un site de test pour vrifier la compatibilit de vos dveloppements avec <a href=\"https://wordpress.org/news/2023/07/wordpress-6-3-release-candidate-1/\">WordPress 6.3&nbsp;Release Candidate&nbsp;1</a>.&nbsp;Nous comptons sur vous pour vrifier que votre code fonctionne correctement avec le cur du CMS, pour le bien des millions dutilisateurs et utilisatrices de WordPress&nbsp;<img src=\"https://s.w.org/images/core/emoji/15.0.3/72x72/2665.png\" alt=\"\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p class=\"has-text-color has-background has-link-color wp-elements-5acaa46e2d74f2d9514c81b671321f78\" style=\"color:#feffff;background-color:#0f29a9\">Ce guide a t traduit puis adapt  partir du <a href=\"https://make.wordpress.org/core/2023/07/18/wordpress-6-3-field-guide/\"><em>Field Guide</em> de WP 6.3</a> par <a href=\"https://profiles.wordpress.org/audrasjb/\">Jb Audras</a>.<br>Merci  <a href=\"https://profiles.wordpress.org/jdy68/\">Jenny Dupuy</a> pour sa relecture attentive.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:91:\"https://fr.wordpress.org/2023/07/18/guide-des-changements-techniques-de-wordpress-6-3/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"WordPress 6.2 Dolphy\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"https://fr.wordpress.org/2023/03/30/wordpress-6-2-dolphy/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"https://fr.wordpress.org/2023/03/30/wordpress-6-2-dolphy/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 30 Mar 2023 08:32:41 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Nouvelles versions de WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=2659\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:401:\"Surnomme &#160;Dolphy&#160; en l&#8217;honneur du jazzman amricain Eric Allan Dolphy Jr, WordPress&#160;6.2 est la premire version majeure de 2023, et contient plus de 900 amliorations et corrections de bugs. Cette version marque une transition dans la feuille de route gnrale du projet open-source WordPress, car la focalisation va dsormais passer de lditeur et de la [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:64876:\"\n<figure class=\"wp-block-image size-large\"><a href=\"https://fr.wordpress.org/files/2023/03/dolphy.png\"><img loading=\"lazy\" decoding=\"async\" width=\"1024\" height=\"683\" src=\"https://fr.wordpress.org/files/2023/03/dolphy-1024x683.png\" alt=\"\" class=\"wp-image-2721\" srcset=\"https://fr.wordpress.org/files/2023/03/dolphy-1024x683.png 1024w, https://fr.wordpress.org/files/2023/03/dolphy-300x200.png 300w, https://fr.wordpress.org/files/2023/03/dolphy-768x512.png 768w, https://fr.wordpress.org/files/2023/03/dolphy.png 1200w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure>\n\n\n\n<p>Surnomme &nbsp;Dolphy&nbsp; en l&rsquo;honneur du jazzman amricain Eric Allan Dolphy Jr,  WordPress&nbsp;6.2 est la premire version majeure de 2023, et contient plus de 900 amliorations et corrections de bugs. Cette version marque une transition dans la feuille de route gnrale du projet open-source WordPress, car la focalisation va dsormais passer de lditeur et de la personnalisation de sites  l&rsquo;exploration des flux de travail et de la collaboration.</p>\n\n\n\n<div class=\"wp-block-media-text alignwide is-stacked-on-mobile is-image-fill\" style=\"grid-template-columns:30% auto\"><figure class=\"wp-block-media-text__media\" style=\"background-image:url(https://fr.wordpress.org/files/2023/03/about-site-editor.png);background-position:25% 48%\"><img loading=\"lazy\" decoding=\"async\" width=\"872\" height=\"872\" src=\"https://fr.wordpress.org/files/2023/03/about-site-editor.png\" alt=\"\" class=\"wp-image-2662 size-full\" srcset=\"https://fr.wordpress.org/files/2023/03/about-site-editor.png 872w, https://fr.wordpress.org/files/2023/03/about-site-editor-300x300.png 300w, https://fr.wordpress.org/files/2023/03/about-site-editor-150x150.png 150w, https://fr.wordpress.org/files/2023/03/about-site-editor-768x768.png 768w\" sizes=\"(max-width: 872px) 100vw, 872px\" /></figure><div class=\"wp-block-media-text__content\">\n<h3 class=\"wp-block-heading\" style=\"font-size:20px\">Explorez et modifiez tout votre site  partir de lditeur</h3>\n\n\n\n<p>Linterface de l&rsquo;dition de site a t revue afin de vous donner plus de contrle sur lexprience ddition de votre site. Vous trouverez une prvisualisation complte de vos modles et lments de modles, et pourrez passer  lditeur de site depuis nimporte quel cran.</p>\n</div></div>\n\n\n\n<div class=\"wp-block-media-text alignwide is-stacked-on-mobile is-image-fill\" style=\"grid-template-columns:30% auto\"><figure class=\"wp-block-media-text__media\" style=\"background-image:url(https://fr.wordpress.org/files/2023/03/about-navigation.png);background-position:25% 47%\"><img loading=\"lazy\" decoding=\"async\" width=\"872\" height=\"872\" src=\"https://fr.wordpress.org/files/2023/03/about-navigation.png\" alt=\"\" class=\"wp-image-2663 size-full\" srcset=\"https://fr.wordpress.org/files/2023/03/about-navigation.png 872w, https://fr.wordpress.org/files/2023/03/about-navigation-300x300.png 300w, https://fr.wordpress.org/files/2023/03/about-navigation-150x150.png 150w, https://fr.wordpress.org/files/2023/03/about-navigation-768x768.png 768w\" sizes=\"(max-width: 872px) 100vw, 872px\" /></figure><div class=\"wp-block-media-text__content\">\n<h3 class=\"wp-block-heading\" style=\"font-size:20px\">Amliorations du bloc de navigation</h3>\n\n\n\n<p>La nouvelle colonne latrale de rglages facilite la modification de la navigation de votre site. Ajoutez, supprimez et rordonnez vos lments de menus plus rapidement, peu importe la complexit de vos menus.</p>\n</div></div>\n\n\n\n<div class=\"wp-block-media-text alignwide is-stacked-on-mobile is-image-fill\" style=\"grid-template-columns:30% auto\"><figure class=\"wp-block-media-text__media\" style=\"background-image:url(https://fr.wordpress.org/files/2023/03/about-block-inserter.png);background-position:33% 52%\"><img loading=\"lazy\" decoding=\"async\" width=\"872\" height=\"872\" src=\"https://fr.wordpress.org/files/2023/03/about-block-inserter.png\" alt=\"\" class=\"wp-image-2664 size-full\" srcset=\"https://fr.wordpress.org/files/2023/03/about-block-inserter.png 872w, https://fr.wordpress.org/files/2023/03/about-block-inserter-300x300.png 300w, https://fr.wordpress.org/files/2023/03/about-block-inserter-150x150.png 150w, https://fr.wordpress.org/files/2023/03/about-block-inserter-768x768.png 768w\" sizes=\"(max-width: 872px) 100vw, 872px\" /></figure><div class=\"wp-block-media-text__content\">\n<h3 class=\"wp-block-heading\" style=\"font-size:20px\">Une exprience plus fluide pour loutil dinsertion de blocs</h3>\n\n\n\n<p>Longlet &nbsp;mdia&nbsp; permet de glisser et dposer du contenu depuis votre mdiathque rapidement. La vue partage facilite la navigation parmi les catgories et la prvisualisation des compositions.</p>\n</div></div>\n\n\n\n<div class=\"wp-block-media-text alignwide is-stacked-on-mobile is-image-fill\" style=\"grid-template-columns:30% auto\"><figure class=\"wp-block-media-text__media\" style=\"background-image:url(https://fr.wordpress.org/files/2023/03/about-split-controls-fixed.png);background-position:24% 50%\"><img loading=\"lazy\" decoding=\"async\" width=\"872\" height=\"872\" src=\"https://fr.wordpress.org/files/2023/03/about-split-controls-fixed.png\" alt=\"\" class=\"wp-image-2665 size-full\" srcset=\"https://fr.wordpress.org/files/2023/03/about-split-controls-fixed.png 872w, https://fr.wordpress.org/files/2023/03/about-split-controls-fixed-300x300.png 300w, https://fr.wordpress.org/files/2023/03/about-split-controls-fixed-150x150.png 150w, https://fr.wordpress.org/files/2023/03/about-split-controls-fixed-768x768.png 768w\" sizes=\"(max-width: 872px) 100vw, 872px\" /></figure><div class=\"wp-block-media-text__content\">\n<h3 class=\"wp-block-heading\" style=\"font-size:20px\">Une meilleure interface pour les rglages des blocs</h3>\n\n\n\n<p>La colonne latrale de rglages de vos blocs est mieux organise, avec des onglets pour les rglages et pour les styles. Les outils dont vous avez besoin sont identifiables et facile daccs.</p>\n</div></div>\n\n\n\n<div class=\"wp-block-media-text alignwide is-stacked-on-mobile is-image-fill\" style=\"grid-template-columns:30% auto\"><figure class=\"wp-block-media-text__media\" style=\"background-image:url(https://fr.wordpress.org/files/2023/03/about-headers.png);background-position:20% 46%\"><img loading=\"lazy\" decoding=\"async\" width=\"872\" height=\"872\" src=\"https://fr.wordpress.org/files/2023/03/about-headers.png\" alt=\"\" class=\"wp-image-2666 size-full\" srcset=\"https://fr.wordpress.org/files/2023/03/about-headers.png 872w, https://fr.wordpress.org/files/2023/03/about-headers-300x300.png 300w, https://fr.wordpress.org/files/2023/03/about-headers-150x150.png 150w, https://fr.wordpress.org/files/2023/03/about-headers-768x768.png 768w\" sizes=\"(max-width: 872px) 100vw, 872px\" /></figure><div class=\"wp-block-media-text__content\">\n<h3 class=\"wp-block-heading\" style=\"font-size:20px\">Des en-ttes et des pieds de page prts  l&#8217;emploi</h3>\n\n\n\n<p>Dcouvrez une nouvelle collection de compositions den-ttes et de pieds de page. Utilisez-les avec nimporte quel thme bas sur des blocs pour en faire un point de dpart rapide et de qualit pour les modles de pages de votre site.</p>\n</div></div>\n\n\n\n<div class=\"wp-block-media-text alignwide is-stacked-on-mobile is-image-fill\" style=\"grid-template-columns:30% auto\"><figure class=\"wp-block-media-text__media\" style=\"background-image:url(https://fr.wordpress.org/files/2023/03/about-openverse.png);background-position:27% 48%\"><img loading=\"lazy\" decoding=\"async\" width=\"872\" height=\"872\" src=\"https://fr.wordpress.org/files/2023/03/about-openverse.png\" alt=\"\" class=\"wp-image-2667 size-full\" srcset=\"https://fr.wordpress.org/files/2023/03/about-openverse.png 872w, https://fr.wordpress.org/files/2023/03/about-openverse-300x300.png 300w, https://fr.wordpress.org/files/2023/03/about-openverse-150x150.png 150w, https://fr.wordpress.org/files/2023/03/about-openverse-768x768.png 768w\" sizes=\"(max-width: 872px) 100vw, 872px\" /></figure><div class=\"wp-block-media-text__content\">\n<h3 class=\"wp-block-heading\" style=\"font-size:20px\">Explorez les mdias Openverse directement depuis lditeur</h3>\n\n\n\n<p>La bibliothque dOpenverse rpertorie plus de 600 millions dimages et de fichiers audio gratuits sous licence ouverte, et elle est dsormais directement intgre  lditeur.</p>\n</div></div>\n\n\n\n<div class=\"wp-block-media-text alignwide is-stacked-on-mobile is-image-fill\" style=\"grid-template-columns:30% auto\"><figure class=\"wp-block-media-text__media\" style=\"background-image:url(https://fr.wordpress.org/files/2023/03/about-distraction-free.png);background-position:50% 50%\"><img loading=\"lazy\" decoding=\"async\" width=\"872\" height=\"872\" src=\"https://fr.wordpress.org/files/2023/03/about-distraction-free.png\" alt=\"\" class=\"wp-image-2668 size-full\" srcset=\"https://fr.wordpress.org/files/2023/03/about-distraction-free.png 872w, https://fr.wordpress.org/files/2023/03/about-distraction-free-300x300.png 300w, https://fr.wordpress.org/files/2023/03/about-distraction-free-150x150.png 150w, https://fr.wordpress.org/files/2023/03/about-distraction-free-768x768.png 768w\" sizes=\"(max-width: 872px) 100vw, 872px\" /></figure><div class=\"wp-block-media-text__content\">\n<h3 class=\"wp-block-heading\" style=\"font-size:20px\">Un nouveau mode sans distraction</h3>\n\n\n\n<p>De temps en temps, il est bon de pouvoir se concentrer sur son travail. Vous pouvez maintenant masquer tous les panneaux et rglages pour vous concentrer sur lcriture de votre contenu.</p>\n</div></div>\n\n\n\n<div class=\"wp-block-media-text alignwide is-stacked-on-mobile is-image-fill\" style=\"grid-template-columns:30% auto\"><figure class=\"wp-block-media-text__media\" style=\"background-image:url(https://fr.wordpress.org/files/2023/03/about-out-of-beta.png);background-position:44% 50%\"><img loading=\"lazy\" decoding=\"async\" width=\"872\" height=\"872\" src=\"https://fr.wordpress.org/files/2023/03/about-out-of-beta.png\" alt=\"\" class=\"wp-image-2670 size-full\" srcset=\"https://fr.wordpress.org/files/2023/03/about-out-of-beta.png 872w, https://fr.wordpress.org/files/2023/03/about-out-of-beta-300x300.png 300w, https://fr.wordpress.org/files/2023/03/about-out-of-beta-150x150.png 150w, https://fr.wordpress.org/files/2023/03/about-out-of-beta-768x768.png 768w\" sizes=\"(max-width: 872px) 100vw, 872px\" /></figure><div class=\"wp-block-media-text__content\">\n<h3 class=\"wp-block-heading\" style=\"font-size:20px\">Lditeur de site nest officiellement plus en version bta&nbsp;!</h3>\n\n\n\n<p>La version 6.2 est une invitation  dcouvrir le potentiel de la prochaine gnration de thmes WordPress.</p>\n</div></div>\n\n\n\n<div class=\"wp-block-media-text alignwide has-media-on-the-right is-stacked-on-mobile\" style=\"grid-template-columns:auto 23%\"><div class=\"wp-block-media-text__content\">\n<h3 class=\"wp-block-heading\" style=\"font-size:20px\">Un nouveau guide de styles  votre disposition</h3>\n\n\n\n<p>Utilisez le guide de style pour obtenir une vue densemble de lapparence de chaque bloc de votre site. Tout vos blocs sont affichs en un seul endroit, accessible en un clin dil.</p>\n</div><figure class=\"wp-block-media-text__media\"><img loading=\"lazy\" decoding=\"async\" width=\"560\" height=\"560\" src=\"https://fr.wordpress.org/files/2023/03/about-style-book.png\" alt=\"\" class=\"wp-image-2671 size-full\" srcset=\"https://fr.wordpress.org/files/2023/03/about-style-book.png 560w, https://fr.wordpress.org/files/2023/03/about-style-book-300x300.png 300w, https://fr.wordpress.org/files/2023/03/about-style-book-150x150.png 150w\" sizes=\"(max-width: 560px) 100vw, 560px\" /></figure></div>\n\n\n\n<div class=\"wp-block-media-text alignwide has-media-on-the-right is-stacked-on-mobile\" style=\"grid-template-columns:auto 23%\"><div class=\"wp-block-media-text__content\">\n<h3 class=\"wp-block-heading\" style=\"font-size:20px\">Copier / coller les styles en un clin dil</h3>\n\n\n\n<p>Travaillez votre design sur un type de bloc, puis copiez et collez ces styles sur dautres blocs pour obtenir exactement laspect que vous souhaitez.</p>\n</div><figure class=\"wp-block-media-text__media\"><img loading=\"lazy\" decoding=\"async\" width=\"560\" height=\"560\" src=\"https://fr.wordpress.org/files/2023/03/about-copy-paste.png\" alt=\"\" class=\"wp-image-2672 size-full\" srcset=\"https://fr.wordpress.org/files/2023/03/about-copy-paste.png 560w, https://fr.wordpress.org/files/2023/03/about-copy-paste-300x300.png 300w, https://fr.wordpress.org/files/2023/03/about-copy-paste-150x150.png 150w\" sizes=\"(max-width: 560px) 100vw, 560px\" /></figure></div>\n\n\n\n<div class=\"wp-block-media-text alignwide has-media-on-the-right is-stacked-on-mobile\" style=\"grid-template-columns:auto 23%\"><div class=\"wp-block-media-text__content\">\n<h3 class=\"wp-block-heading\" style=\"font-size:20px\">CSS personnalis</h3>\n\n\n\n<p>Amliorez votre site  votre guise en ajoutant votre propre CSS sur votre site ou sur vos blocs, pour un niveau de contrle encore plus important sur lapparence de votre site.</p>\n</div><figure class=\"wp-block-media-text__media\"><img loading=\"lazy\" decoding=\"async\" width=\"560\" height=\"560\" src=\"https://fr.wordpress.org/files/2023/03/about-custom-css.png\" alt=\"\" class=\"wp-image-2673 size-full\" srcset=\"https://fr.wordpress.org/files/2023/03/about-custom-css.png 560w, https://fr.wordpress.org/files/2023/03/about-custom-css-300x300.png 300w, https://fr.wordpress.org/files/2023/03/about-custom-css-150x150.png 150w\" sizes=\"(max-width: 560px) 100vw, 560px\" /></figure></div>\n\n\n\n<h3 class=\"wp-block-heading\" style=\"font-size:20px\">Positionnement pingl</h3>\n\n\n\n<p>Maintenez certains blocs important en haut de page lorsque les internautes la font dfiler.</p>\n\n\n\n<h3 class=\"wp-block-heading\" style=\"font-size:20px\">Importation des widgets</h3>\n\n\n\n<p>Options pour importer vos widgets prfrs depuis les thmes classiques vers les thmes bass sur des blocs.</p>\n\n\n\n<h3 class=\"wp-block-heading\" style=\"font-size:20px\">Polices embarques depuis les thmes</h3>\n\n\n\n<p>Les thmes par dfaut proposs par WordPress offrent un meilleur respect des donnes personnelles en embarquant les polices Google en local.</p>\n\n\n\n<h3 class=\"wp-block-heading\">En savoir plus sur WordPress 6.2</h3>\n\n\n\n<p>Visitez&nbsp;<a href=\"https://learn.wordpress.org/\">learn.wordpress.org</a>&nbsp;pour des tutoriels vidos, des ateliers en ligne, des cours et des plans de cours pour les personnes organisant des vnements, et pour des contenus prsentant les nouvelles fonctionnalits de WordPress.</p>\n\n\n\n<p>Consultez notre&nbsp;<a href=\"https://fr.wordpress.org/2023/03/10/guide-des-changements-techniques-de-wordpress-6-2/\">guide des changements techniques introduits par WordPress 6.2</a>. Il contient toutes les notes techniques que vous devez connatre si vous dveloppez sur WordPress.</p>\n\n\n\n<p><a href=\"https://wordpress.org/support/wordpress-version/version-6-2/\">Lire les notes de dveloppement de WordPress 6.2 (en anglais)</a>&nbsp;pour obtenir plus dinformations sur les amliorations proposes et les anomalies corriges, les informations dinstallation, les notes et ressources  destination des dveloppeuses et des dveloppeurs, connatre les personnes ayant contribu  cette version et pour obtenir la liste des fichiers modifis.</p>\n\n\n\n<h2 class=\"wp-block-heading\">Lquipe de direction de WP 6.2</h2>\n\n\n\n<p>Voici lquipe qui a coordonn le dveloppement et la sortie cette nouvelle version de WordPress&nbsp;:</p>\n\n\n\n<ul>\n<li>Direction gnrale&nbsp;: <a href=\"https://profiles.wordpress.org/matt/\">Matt Mullenweg</a></li>\n\n\n\n<li>Coordination de la version&nbsp;: <a href=\"https://profiles.wordpress.org/francina/\">Francesca Marano</a>, <a href=\"https://profiles.wordpress.org/priethor/\">Hctor Prieto</a></li>\n\n\n\n<li>Direction technique du cur WP&nbsp;: <a href=\"https://profiles.wordpress.org/hellofromtonya/\">Tonya Mork</a>, <a href=\"https://profiles.wordpress.org/audrasjb/\">Jb Audras</a></li>\n\n\n\n<li>Direction technique Gutenberg&nbsp;: <a href=\"https://profiles.wordpress.org/mamaduka/\">George Mamadashvili</a>, <a href=\"https://profiles.wordpress.org/ntsekouras/\">Nik Tsekouras</a></li>\n\n\n\n<li>Gestion de projet ct cur WP : <a href=\"https://profiles.wordpress.org/costdev/\">Colin Stewart</a>, <a href=\"https://profiles.wordpress.org/mukesh27/\">Mukesh Panchal</a></li>\n\n\n\n<li>Gestion de projet ct Gutenberg&nbsp;: <a href=\"https://profiles.wordpress.org/annezazu/\">Anne McCarthy</a>, <a href=\"https://profiles.wordpress.org/ndiego/\">Nick Diego</a></li>\n\n\n\n<li>Responsable du design&nbsp;: <a href=\"https://profiles.wordpress.org/richtabor/\">Rich Tabor</a></li>\n\n\n\n<li>Coordination de la documentation&nbsp;: <a href=\"https://profiles.wordpress.org/bph/\">Birgit Pauli-Haack</a>, <a href=\"https://profiles.wordpress.org/femkreations/\">Femy Praseet</a>, <a href=\"https://profiles.wordpress.org/milana_cap/\">Milana Cap</a>, <a href=\"https://profiles.wordpress.org/webcommsat/\">Abha Thakor</a></li>\n\n\n\n<li>Coordination de la communication&nbsp;: <a href=\"https://profiles.wordpress.org/jpantani/\">Jonathan Pantani</a>, <a href=\"https://profiles.wordpress.org/laurlittle/\">Lauren Stein</a>, <a href=\"https://profiles.wordpress.org/marybaum/\">Mary Baum</a></li>\n\n\n\n<li>Coordination des tests&nbsp;: <a href=\"https://profiles.wordpress.org/robinwpdeveloper/\">Robin</a>, <a href=\"https://profiles.wordpress.org/adeltahri/\">Adel Tahri</a></li>\n\n\n\n<li>Responsable de l&rsquo;optimisation des performances&nbsp;: <a href=\"https://profiles.wordpress.org/flixos90/\">Felix Arntz</a></li>\n</ul>\n\n\n\n<h2 class=\"wp-block-heading\">Merci aux contributeurs et contributrices</h2>\n\n\n\n<p>WordPress 6.2 n&rsquo;aurait pas pu sortir sans la contribution passionne de plus de 600 personnes provenant d&rsquo;au moins 50 pays diffrents. Un remerciement tout spcial pour les 178 personnes qui ont contribu au cur de WordPress pour la premire fois avec WP&nbsp;6.2 <img src=\"https://s.w.org/images/core/emoji/15.0.3/72x72/2665.png\" alt=\"\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> </p>\n\n\n\n<p>Les personnes listes ci-dessous dmontrent la vitalit et le dynamisme de notre belle communaut open-source, merci  elles&nbsp;!</p>\n\n\n\n<p style=\"font-size:12px\"><a href=\"https://profiles.wordpress.org/10upsimon/\">10upsimon</a>  <a href=\"https://profiles.wordpress.org/254volkan/\">254volkan</a>  <a href=\"https://profiles.wordpress.org/mercime/\">@mercime</a>  <a href=\"https://profiles.wordpress.org/aaroncampbell/\">Aaron D. Campbell</a>  <a href=\"https://profiles.wordpress.org/aeg0125/\">Aaron Graham</a>  <a href=\"https://profiles.wordpress.org/jorbin/\">Aaron Jorbin</a>  <a href=\"https://profiles.wordpress.org/aaronrobertshaw/\">Aaron Robertshaw</a>  <a href=\"https://profiles.wordpress.org/webcommsat/\">Abha Thakor</a>  <a href=\"https://profiles.wordpress.org/abidhasan112/\">Abid Hasan</a>  <a href=\"https://profiles.wordpress.org/abitofmind/\">abitofmind</a>  <a href=\"https://profiles.wordpress.org/abtop/\