6155fea9a6b8\">\n  <div class=\"p-4 flex flex-col\">\n    <div class=\"flex-col items-center mobile:flex tablet:hidden\">\n      \n      \n       \n    </div>\n\n    <div class=\"tablet:flex flex-grow\">\n      <div class=\"w-full\">\n        <div class=\"hidden tablet:block\">\n          <div class=\"flex justify-between items-center\">\n            <div>\n              \n              \n            </div>\n          </div>\n          \n        </div>\n        <div class=\"flex w-full items-center justify-center\">\n          \n          \n          \n          \n        </div>\n      </div>\n    </div>\n  </div>\n  \n\n</div>\n            \n              document.addEventListener(\"DOMContentLoaded\", function() {\n                var player = document.getElementById(\"player-66155fea9a6b8\");\n                podlovePlayerCache.add([{\"url\":\"https://www.wppodcast.fr/wp-json/podlove-web-player/shortcode/publisher/1520\",\"data\":{\"version\":5,\"show\":{\"title\":\"Podcast WordPress (franu00e7ais)\",\"subtitle\":\"Informations sur la Communautu00e9 WordPress\",\"summary\":\"Informations, actualitu00e9s et interviews sur la communautu00e9 WordPress.\",\"poster\":\"https://www.wppodcast.fr/podlove/image/68747470733a2f2f7777772e7770706f64636173742e6e65742f77702d636f6e74656e742f75706c6f6164732f73697465732f352f323032302f30382f7770706f64636173742d7371756172652e706e67/500/0/0/podcast-wordpress-francais\",\"link\":\"https://www.wppodcast.fr\"},\"title\":\"WordPress 6.5 Regina\",\"subtitle\":\"Plus de 700 contributeurs, avec plus de 2 500 changements, ont permis la sortie de la derniu00e8re version : WordPress 6.5, alias Regina.\",\"summary\":\"\",\"publicationDate\":\"2024-04-09T00:00:00+00:00\",\"duration\":\"00:06:38.930\",\"poster\":\"https://www.wppodcast.fr/podlove/image/68747470733a2f2f7777772e7770706f64636173742e66722f77702d636f6e74656e742f75706c6f6164732f73697465732f352f323032312f30372f7770706f6463617374626c75652e706e67/500/0/0/21-wordpress-6-5-regina\",\"link\":\"https://www.wppodcast.fr/podcast/wordpress-6-5-regina/\",\"chapters\":[],\"audio\":[{\"url\":\"https://www.wppodcast.fr/podlove/file/251/s/webplayer/c/website/wordpress-podcast-fr-e021.mp3\",\"size\":\"9344016\",\"title\":\"MP3 Audio (mp3)\",\"mimeType\":\"audio/mpeg\"}],\"files\":[{\"url\":\"https://www.wppodcast.fr/podlove/file/251/s/webplayer/wordpress-podcast-fr-e021.mp3\",\"size\":\"9344016\",\"title\":\"WordPress Podcast\",\"mimeType\":\"audio/mpeg\"}],\"contributors\":[{\"id\":\"6\",\"name\":\"Jenny Dupuy\",\"avatar\":\"data:image/svg+xml;base64,\",\"role\":{\"id\":\"1\",\"slug\":\"presentateur\",\"title\":\"Pru00e9sentateur\"},\"group\":null,\"comment\":null}]}}, {\"url\":\"https://www.wppodcast.fr/wp-json/podlove-web-player/shortcode/config/default/theme/wppodcast-blocks\",\"data\":{\"activeTab\":\"chapters\",\"subscribe-button\":null,\"share\":{\"channels\":[],\"outlet\":null,\"sharePlaytime\":false},\"related-episodes\":{\"source\":\"podcast\",\"value\":null},\"version\":5,\"playlist\":\"https://www.wppodcast.fr/wp-json/podlove-web-player/shortcode/podcast\",\"theme\":{\"tokens\":{\"brand\":\"#000\",\"brandDark\":\"#14B8A6\",\"brandDarkest\":\"#0F766E\",\"brandLightest\":\"#E8FAF6\",\"shadeDark\":\"#807E7C\",\"shadeBase\":\"#807E7C\",\"contrast\":\"#000\",\"alt\":\"#fff\"},\"fonts\":{\"ci\":{\"name\":\"sans-serif\",\"family\":[\"sans-serif\"],\"src\":[],\"weight\":800},\"regular\":{\"name\":\"sans-serif\",\"family\":[\"sans-serif\"],\"src\":[],\"weight\":300},\"bold\":{\"name\":\"sans-serif\",\"family\":[\"sans-serif\"],\"src\":[],\"weight\":700}}},\"base\":\"https://www.wppodcast.fr/wp-content/plugins/podlove-web-player/web-player/\"}}]);\n                podlovePlayer(player, \"https://www.wppodcast.fr/wp-json/podlove-web-player/shortcode/publisher/1520\", \"https://www.wppodcast.fr/wp-json/podlove-web-player/shortcode/config/default/theme/wppodcast-blocks\").then(function() {\n                  player &amp;&amp; player.classList.remove(\"podlove-web-player-loading\");\n                });\n              });\n            \n            \n              .podlove-web-player.podlove-web-player-loading {\n                opacity: 0;\n              }\n            \n        \n\n\n<p>N&rsquo;oubliez pas que vous pouvez couter les pisodes sur <a href=\"https://www.wppodcast.fr/pocketcasts/\" data-type=\"link\" data-id=\"https://www.wppodcast.fr/pocketcasts/\" target=\"_blank\" rel=\"noreferrer noopener\">Pocket Casts</a>, <a href=\"https://www.wppodcast.fr/spotify/\" data-type=\"link\" data-id=\"https://www.wppodcast.fr/spotify/\" target=\"_blank\" rel=\"noreferrer noopener\">Spotify</a>, et <a href=\"https://www.wppodcast.fr/apple/\" data-type=\"link\" data-id=\"https://www.wppodcast.fr/apple/\" target=\"_blank\" rel=\"noreferrer noopener\">Apple Podcasts</a> ou <a href=\"https://www.wppodcast.fr/feed/podcast/\" data-type=\"link\" data-id=\"https://www.wppodcast.fr/feed/podcast/\" target=\"_blank\" rel=\"noreferrer noopener\">vous abonner directement au flux</a>.</p>\n\n\n\n<span id=\"more-1520\"></span>\n\n\n\n<h2 class=\"wp-block-heading\" id=\"transcripcion-del-programa\">Transcript de l&rsquo;pisode</h2>\n\n\n\n<p>Bonjour, je suis <a href=\"https://profiles.wordpress.org/jdy68/\">Jenny</a>, et vous coutez <a href=\"https://www.wppodcast.fr/\">WordPress Podcast</a>, le bulletin dinformation de la communaut WordPress. Ce programme est la traduction en franais de la <a href=\"https://www.wppodcast.es/\">version originale en espagnol</a>.</p>\n\n\n\n<p>Dans cet pisode, vous trouverez <strong>les informations du 1er au 7 avril 2024</strong>.</p>\n\n\n\n<p>Avec une semaine de retard sur la date prvue, <a href=\"https://wordpress.org/news/2024/04/regina/\">WordPress 6.5, surnomme Regina</a>, est sortie, inspire par la violoniste <a href=\"https://en.wikipedia.org/wiki/Regina_Carter\">Regina Carter</a>, artiste de jazz et ducatrice prime. Les bases techniques de Regina en musique classique et sa profonde comprhension du jazz lui ont valu la rputation d&rsquo;aller audacieusement au-del de ce qu&rsquo;il est possible de faire avec un violon.</p>\n\n\n\n<p>C&rsquo;est ce que reflte cette nouvelle version, qui va plus loin avec un seul instrument&nbsp;: WordPress.</p>\n\n\n\n<p>WordPress 6.5 introduit plusieurs fonctionnalits et amliorations significatives. Tout dabord, la bibliothque de polices qui facilite la gestion des polices sans ncessiter de code. Vient ensuite lintroduction de rvisions plus dtailles pour les modles et les compositions. Ainsi que des outils amliors pour les arrire-plans et les ombres dans certains blocs. Enfin, cette version propose aussi de nouvelles interfaces de visualisation de donnes, permettant laccs rapide aux informations, des amliorations dans le glisser-dposer et des contrles de liens plus intuitifs.</p>\n\n\n\n<p>Pour les dveloppeurs, les API <em>Interactivity</em> et <em>Block Bindings</em> sont mises en avant, largissant les possibilits de crer des expriences interactives, et de connecter des blocs avec du contenu dynamique.</p>\n\n\n\n<p>Plus de 110 mises  jour des performances ont t effectues, offrant une exprience plus rapide et plus efficace.<br>Pour laccessibilit, ce sont 65 amliorations qui ont t ralises pour rendre WordPress plus inclusif.<br>Au final, cette version est le fruit du travail de 702 contributeurs et comprend 2 500 amliorations et corrections.</p>\n\n\n\n<p>Passons maintenant aux nouvelles des quipes</p>\n\n\n\n<p>L&rsquo;quipe <strong>Performance</strong> a ouvert une discussion sur l&rsquo;importance de la recherche sur le terrain pour comprendre l&rsquo;utilisation relle des sites WordPress, en se concentrant sur la collecte et l&rsquo;analyse des donnes de performance.<br>Un <a href=\"https://make.wordpress.org/core/2024/04/05/conducting-wordpress-performance-research-in-the-field/\">tutoriel collaboratif et guide de rfrence</a> a t prsent pour ceux qui ne sont pas familiers avec <em>BigQuery</em>, <em>HTTP Archive</em>, et <em>Chrome User Experience Report</em>. Ainsi cette ressource pourra aider les dveloppeurs et dveloppeuses WordPress  collecter et  analyser les donnes de performance, quel que soit leur niveau d&rsquo;exprience avec ces technologies.</p>\n\n\n\n<p>Sur le <strong>Developer Blog</strong>, deux nouvelles publications cette semaine, il sagit dune part de <a href=\"https://developer.wordpress.org/news/2024/04/01/how-to-register-custom-font-collections-for-the-font-library/\">comment enregistrer une collection de polices pour la Bibliothque de polices</a>, et dautre part dune <a href=\"https://developer.wordpress.org/news/2024/04/05/introduction-to-playground-running-wordpress-in-the-browser/\">introduction  Playground</a>, l&rsquo;outil qui permet dexcuter WordPress directement dans le navigateur.</p>\n\n\n\n<p>L&rsquo;quipe <strong>CLI</strong> nous informe quelle organise un nouveau <a href=\"https://make.wordpress.org/cli/2024/04/02/save-the-date-wp-cli-hack-day-on-friday-april-26th/\">WP-CLI Hack Day le 26 avril 2024</a>, avec l&rsquo;objectif de fermer au moins 20 tickets pendant l&rsquo;vnement.</p>\n\n\n\n<p>L&rsquo;quipe <strong>Hosting</strong> a publi un article sur la <a href=\"https://make.wordpress.org/hosting/2024/04/05/wordpress-6-5-php-compatibility/\">compatibilit entre WordPress 6.5 et PHP</a>. En plus de documenter les exigences minimales, des messages d&rsquo;avertissement ont t dfinis pour les ventuelles erreurs de compatibilit connues avec PHP 8.0, 8.1, 8.2, et 8.3.<br>La recommandation finale pour les nouvelles installations avec WordPress 6.5 est la suivante&nbsp;: PHP 8.2 et MySQL 8.0 ou MariaDB 10.11.</p>\n\n\n\n<p>L&rsquo;quipe <strong>Accessibility</strong> prpare dj <a href=\"https://make.wordpress.org/accessibility/2024/04/01/accessibility-team-meeting-notes-march-15-2024/\">plusieurs amliorations pour WordPress 6.6 lies  Gutenberg</a>, comme&nbsp;:</p>\n\n\n\n<ul>\n<li>la vue agrandie des compositions,</li>\n\n\n\n<li>des modifications dans la conception des interfaces de visualisation de donnes (tels que les rglages de blocs ou encore les dtails des publications),</li>\n\n\n\n<li>une rorganisation des crans Pages et Modles de lditeur de site,</li>\n\n\n\n<li>un audit sur laccessibilit des interfaces de visualisation de donnes. Et ce, en recueillant les commentaires formuls sur la version 6.5 afin daider  tablir les prochaines tapes de la version 6.6.</li>\n</ul>\n\n\n\n<p>L&rsquo;quipe <strong>Documentation</strong> annonce le dmarrage du <a href=\"https://make.wordpress.org/docs/2024/04/04/translation-of-end-user-documentation-project-started-at-wordcamp-torrelodones-spain/\">projet de traduction de la documentation</a> en espagnol avec la mise en place dune quipe initiale, de runions, et dun processus de traduction, en particulier la dfinition dune liste darticles de <em>HelpHub</em>  traduire en priorit.</p>\n\n\n\n<p>L&rsquo;quipe <strong>Polyglots</strong> a ajout une nouvelle option pour les retours faits par lquipe de validation dans le cas o la traduction <a href=\"https://make.wordpress.org/polyglots/2024/04/03/new-bad-quality-ai-checkbox-for-the-changes-requested-status/\">a t faite avec l&rsquo;intelligence artificielle</a> et quelle n&rsquo;a pas t revue ni corrige pour respecter les rgles de traduction.<br>Ce nouveau motif de demande de modification sera alors automatiquement ajout dans le commentaire adress au contributeur.</p>\n\n\n\n<p>L&rsquo;quipe <strong>Meta</strong> a prsent une <a href=\"https://make.wordpress.org/meta/2024/04/04/homepage-updates/\">mise  jour de la page principale de WordPress.org</a>. Mise  jour destine  mieux cibler les nouvelles personnes utilidant WordPress, ou celles qui reviennent sur la plateforme aprs un certain temps d&rsquo;absence, en mettant en avant les informations sur les dernires versions, sur la communaut et les vnements, ainsi que les diverses possibilits pour apprendre  utiliser WordPress.</p>\n\n\n\n<p>L&rsquo;quipe <strong>Learning</strong> <a href=\"https://make.wordpress.org/training/2024/04/05/looking-for-feedback-thumbnails-for-the-learn-redesign/\">travaille sur les miniatures pour la refonte du site Learn WordPress</a>. Des modles de miniatures ont t crs pour tre utiliss sur plusieurs types de mdias. Il sagit des images de prsentation des cours et leons, des miniatures des vidos YouTube et des ateliers en ligne sur Meetup.</p>\n\n\n\n<p>L&rsquo;quipe <strong>Community</strong> va demander <a href=\"https://make.wordpress.org/community/2024/04/05/suggested-updates-based-on-feedback-of-the-events-wordpress-org-site/\">l&rsquo;ajout d&rsquo;un nouveau menu appel Events</a> sur tous les sites WordPress.org qui pointent vers le site regroupanr lensemble des vnements officiels autour de WordPress, site lanc il y a quelques mois.<br>Par ailleurs, ils souhaitent tudier laudience du site, et travailler sur loptimisation de l&rsquo;exprience utilisateur, via lajout de filtres pour la recherche d&rsquo;vnements.</p>\n\n\n\n<p>Enfin, l&rsquo;quipe de <strong>BuddyPress</strong> a publi la version de maintenance 12.4, lance avant WordPress 6.5, et a communiqu sur la ncessit de supprimer loutil de rparation de la dernire activit car il tait devenu obsolte.<br>En ce qui concerne <a href=\"https://bpdevel.wordpress.com/2024/04/01/bp-dev-chat-summary-march-20-2024/\">la future version BuddyPress 14.0</a>, elle se concentrera sur des amliorations telles que&nbsp;:</p>\n\n\n\n<ul>\n<li>les notifications pour les administrateurs,</li>\n\n\n\n<li>lutilisation de lditeur de blocs pour crer les activits,</li>\n\n\n\n<li>l&rsquo;exportation et l&rsquo;importation de donnes,</li>\n\n\n\n<li>la dsactivation des flux dinscription,</li>\n\n\n\n<li>et l&rsquo;amlioration des rles, en particulier celui de modrateur de groupe.</li>\n</ul>\n\n\n\n<p>Notez que ce podcast est distribu sous <a href=\"https://creativecommons.org/licenses/by-nc-sa/4.0/\">licence Creative Commons</a> en tant que version drive du <a href=\"https://www.wppodcast.es/\">WordPress Podcast en espagnol</a> ; vous trouverez tous les liens pour plus d&rsquo;informations sur <a href=\"https://www.wppodcast.fr/\">WordPressPodcast.fr</a>.</p>\n\n\n\n<p>Ce contenu existe galement en <a href=\"https://www.wppodcast.org/\">anglais</a>, en <a href=\"https://www.wppodcast.es/\">espagnol</a>, en <a href=\"https://www.wppodcast.cat/\">catalan</a> et en <a href=\"https://www.wppodcast.de/\">allemand</a></p>\n\n    \";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:4:\"type\";s:4:\"html\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:6:\"author\";a:1:{i:0;a:6:{s:4:\"data\";s:46:\"\n            \n                                \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:27:\"http://www.w3.org/2005/Atom\";a:1:{s:4:\"name\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Patricia BT\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}s:6:\"source\";a:1:{i:0;a:6:{s:4:\"data\";s:67:\"\n                    \n                            \n                \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:27:\"http://www.w3.org/2005/Atom\";a:2:{s:2:\"id\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://www.wppodcast.fr/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"WP Podcast\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}i:1;a:6:{s:4:\"data\";s:70:\"\n    \n    \n    \n    \n    \n    \n    \n            \n                \n    \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:27:\"http://www.w3.org/2005/Atom\";a:9:{s:2:\"id\";a:1:{i:0;a:5:{s:4:\"d