:1:{s:0:\"\";a:1:{s:4:\"type\";s:4:\"html\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:2:{s:4:\"href\";s:68:\"https://wpfr.net/wordpress-rachete-par-microsoft-et-rebaptise-press/\";s:3:\"rel\";s:9:\"alternate\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"updated\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"2024-04-01T08:30:36.000+02:00\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:9:\"published\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"2024-04-01T08:30:36.000+02:00\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"summary\";a:1:{i:0;a:5:{s:4:\"data\";s:364:\"WordPress, la plateforme de publication de contenu la plus populaire sur le web, a t rachete par le gant de la technologie, Microsoft. Microsoft renomme le logiciel WordPress en  Press  Avec ce changement de propritaire, WordPress sera dsormais rebaptis  Press . Une annonce qui a pris de nombreux utilisateurs au dpourvu, maisLire la suite\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"content\";a:1:{i:0;a:5:{s:4:\"data\";s:4272:\"\n        <p>WordPress, la plateforme de publication de contenu la plus populaire sur le web, a t rachete par le gant de la technologie, Microsoft.</p>\n<p><span id=\"more-2470315\"></span></p>\n<h2 id=\"microsoft-renomme-le-logiciel-wordpress-en-press\">Microsoft renomme le logiciel WordPress en  Press </h2>\n<p>Avec ce changement de propritaire, WordPress sera dsormais rebaptis  Press .</p>\n<p>Une annonce qui a pris de nombreux utilisateurs au dpourvu, mais qui, selon les reprsentants de Microsoft, vise  clarifier le nom vis--vis de leur logiciel de traitement de texte bien connu, Word.</p>\n<p>Si vous tes un habitu de WordPress, cette nouvelle doit vous sembler incomprhensible. WordPress est devenu un pilier du paysage numrique depuis son lancement en 2003, permettant  des millions de personnes  travers le monde de crer et de grer leurs sites web et leurs blogs avec facilit. Et la socit Automattic, fonde par son co-fondateur, paraissait solide.</p>\n<h2 id=\"pourquoi-ce-rachat\">Pourquoi ce rachat ?</h2>\n<p>Cependant, avec ce changement de nom, la plateforme sera aligne plus troitement avec l&rsquo;cosystme logiciel de Microsoft. Selon Satya Nadella, PDG de Microsoft, ce rachat s&rsquo;inscrit dans la volont de l&rsquo;entreprise de renforcer sa prsence dans le domaine de la publication en ligne et de simplifier son offre de produits pour ses utilisateurs.</p>\n<p>En mtant la main sur Automattic, c&rsquo;est toute une suite de produit que Microsoft s&rsquo;offre : Tumblr, WordPress.com, WooCommerce, WP VIP, DayOne, Jetpack, etc. Mais surtout, Microsoft met la main sur l&rsquo;actif le plus prcieux de Matt Mullenweg, le CEO d&rsquo;Automattic : la WordPress Foundation propritaire de la marque WordPress. Par extension, Microsoft devient l&rsquo;acteur majeur du dveloppement du logiciel Open Source WordPress.</p>\n<h2 id=\"wordpress-sous-lere-microsoft-des-changements-a-venir\">WordPress sous l&rsquo;re Microsoft : des changements  venir ?</h2>\n<p>En renommant le CMS, Microsoft espre viter toute confusion avec son logiciel Word, tout en intgrant de nouvelles fonctionnalits et amliorations  la plateforme. Les ractions  cette annonce ont t varies. Certains utilisateurs de longue date de WordPress se montrent sceptiques quant  l&rsquo;impact que ce rachat pourrait avoir sur l&rsquo;avenir de la plateforme, craignant une perte d&rsquo;indpendance ou des changements drastiques dans son fonctionnement.</p>\n<p>Plusieurs observateurs voient cependant cette acquisition comme une opportunit d&rsquo;intgrer de nouvelles fonctionnalits et d&rsquo;amliorer l&rsquo;exprience utilisateur. Pour l&rsquo;instant, les dtails sur les changements concrets  venir avec ce rachat restent limits.</p>\n<p>Nous avons interrog des reprsentants de Microsoft qui nous assurent que l&rsquo;objectif principal est de maintenir la qualit et la convivialit de  Press  . La nouvelle quipe de direction souhaite explorer de nouvelles faons d&rsquo;innover dans le domaine de la publication en ligne.</p>\n<p><strong> Cela inclura l&rsquo;intgration pousse de Word dans  Press  pour revenir aux origines de l&rsquo;dition de contenus suite au fiasco du projet Gutenberg </strong>nous a indiqu notre contact.</p>\n<p>L&rsquo;diteur de Word rintroduira donc une version modernise de l&rsquo;diteur Classique, non plus bas sur TinyMCE, mais sur Word. Ce projet interne pour le moment se nommera  diteur rubans  bas sur la technologie de Word.</p>\n<h2 id=\"conclusion\">Conclusion</h2>\n<p>Cette nouvelle du rachat et du changement de nom de WordPress qui devient  Press  est sans aucun doute l&rsquo;une des annonces les plus surprenantes de l&rsquo;anne dans le monde de la technologie.</p>\n<p>Restez  l&rsquo;coute pour plus de mises  jour sur cette volution passionnante !</p>\n<hr //>\n<p><img class=\"aligncenter wp-image-2470320 size-large\" style=\"margin-bottom: -1ex\" src=\"https://wpfr.net/files/2024/03/Design-sans-titre-1024x599.png\" alt=\"\" width=\"840\" height=\"491\" //></p>\n<p style=\"text-align: center\"><em>Beta test de l&rsquo;intgration de Word dans Press en exclusivit.</em></p>\n\n    \";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:4:\"type\";s:4:\"html\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:6:\"author\";a:1:{i:0;a:6:{s:4:\"data\";s:46:\"\n            \n                                \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:27:\"http://www.w3.org/2005/Atom\";a:1:{s:4:\"name\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Jason ROUET\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\