";s:3:\"rel\";s:9:\"alternate\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"updated\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"2024-03-28T09:16:03.000+01:00\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:9:\"published\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"2024-03-28T09:16:03.000+01:00\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"summary\";a:1:{i:0;a:5:{s:4:\"data\";s:532:\"Dans cet pisode de notre podcast, Eddy, votre coach WordPress, explore le thme crucial de laccessibilit web. Dcouvrez pourquoi rendre votre site WordPress accessible est non seulement un acte conscient et inclusif, mais galement une dmarche bnfique pour tous. Nous plongeons dans les dernires mises  jour de WordPress, notamment la trs attendue version 6.5, []\nLarticle Les cl essentielles pour entamer une dmarche accessibilit avec WordPress est apparu en premier sur Agence WordPress Whodunit.\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"content\";a:1:{i:0;a:5:{s:4:\"data\";s:11518:\"\n        \n<p>Dans cet pisode de notre podcast, <a href=\"https://whodunit.academy/equipe/eddy-boels/\">Eddy, votre coach WordPress</a>, explore le thme crucial de l&#8217;accessibilit web. Dcouvrez pourquoi rendre votre site WordPress accessible est non seulement un acte conscient et inclusif, mais galement une dmarche bnfique pour tous. Nous plongeons dans les dernires mises  jour de WordPress, notamment la trs attendue version 6.5, et comment elles peuvent impacter l&#8217;accessibilit de votre site.</p>\n\n\n\n\n\n\n\n<h2 class=\"wp-block-heading\" data-block-type=\"core\">Dans cet pisode :</h2>\n\n\n\n<div class=\"wp-block-stackable-icon-list stk-block-icon-list stk-block stk-acab05a\" data-block-id=\"acab05a\"><ul class=\"stk-block-icon-list__ul stk-block-icon-list--column\">\n<li class=\"wp-block-stackable-icon-list-item stk-block-icon-list-item stk-block stk-a54b442\" data-block-id=\"a54b442\"><div class=\"stk-block-icon-list-item__content\"><span class=\"stk--svg-wrapper\"><div class=\"stk--inner-svg\"></div></span><span class=\"stk-block-icon-list-item__text\">00:00:06 &#8211; Introduction </span></div></li>\n\n\n\n<li class=\"wp-block-stackable-icon-list-item stk-block-icon-list-item stk-block stk-f6c43ec\" data-block-id=\"f6c43ec\"><div class=\"stk-block-icon-list-item__content\"><span class=\"stk--svg-wrapper\"><div class=\"stk--inner-svg\"></div></span><span class=\"stk-block-icon-list-item__text\">00:00:33 &#8211; Pourquoi l&#8217;accessibilit sur votre site WordPress est cruciale </span></div></li>\n\n\n\n<li class=\"wp-block-stackable-icon-list-item stk-block-icon-list-item stk-block stk-9eb3e78\" data-block-id=\"9eb3e78\"><div class=\"stk-block-icon-list-item__content\"><span class=\"stk--svg-wrapper\"><div class=\"stk--inner-svg\"></div></span><span class=\"stk-block-icon-list-item__text\">00:01:28 &#8211; Zoom sur la dernire mise  jour de WordPress 6.5 </span></div></li>\n\n\n\n<li class=\"wp-block-stackable-icon-list-item stk-block-icon-list-item stk-block stk-053fac9\" data-block-id=\"053fac9\"><div class=\"stk-block-icon-list-item__content\"><span class=\"stk--svg-wrapper\"><div class=\"stk--inner-svg\"></div></span><span class=\"stk-block-icon-list-item__text\">00:02:18 &#8211; L&#8217;accessibilit web : principes des 3 P et importance du design inclusif </span></div></li>\n\n\n\n<li class=\"wp-block-stackable-icon-list-item stk-block-icon-list-item stk-block stk-3da3c0f\" data-block-id=\"3da3c0f\"><div class=\"stk-block-icon-list-item__content\"><span class=\"stk--svg-wrapper\"><div class=\"stk--inner-svg\"></div></span><span class=\"stk-block-icon-list-item__text\">00:08:15 &#8211; Les cls d&#8217;une accessibilit russie sur WordPress</span></div></li>\n</ul></div>\n\n\n\n<p>Navigant entre les nouveauts de WordPress 6.5 et l&#8217;importance capitale de rendre nos sites accessibles  tous, nous avons abord des astuces et des insights prcieux qui, je l&#8217;espre, sauront vous inspirer dans votre dmarche d&#8217;accessibilit.</p>\n\n\n\n<h2 class=\"wp-block-heading\" data-block-type=\"core\">L&#8217;Accessibilit : un engagement vers plus d&#8217;inclusivit</h2>\n\n\n\n<p>D&#8217;emble, l&#8217;accessibilit peut sembler tre un concept technique rserv aux initis. Pourtant, l&#8217;enjeu est des plus humains. Un site accessible s&#8217;apparente  une maison accueillante : tout le monde doit pouvoir y entrer et s&#8217;y sentir  l&#8217;aise, quelle que soit sa condition.</p>\n\n\n\n<p>Cette dmarche n&#8217;est pas seulement une question d&#8217;thique ; elle est aussi en harmonie avec une conscience cologique. En effet, rendre un site accessible, c&#8217;est penser  tous, sans exception, ce qui s&#8217;inscrit dans une logique de dveloppement durable et d&#8217;co-responsabilit.</p>\n\n\n\n<blockquote class=\"wp-block-quote\" data-block-type=\"core\">\n<p>&#8220;Se lancer dans l&#8217;accessibilit, c&#8217;est faire deux victoires en une : on pense aux gens et, en mme temps, on prend soin de notre environnement.&#8221;</p>\n</blockquote>\n\n\n\n<h2 class=\"wp-block-heading\" data-block-type=\"core\">Les volutions WordPress et leurs impacts sur l&#8217;accessibilit</h2>\n\n\n\n<p>La version 6.5 de WordPress introduit des nouveauts, comme la gestion des polices de caractres, qui peuvent significativement influencer l&#8217;accessibilit de nos sites. Pouvoir intgrer des polices locales sans recourir  des tiers est un pas vers plus de contrle sur notre contenu et son accessibilit.</p>\n\n\n\n<h2 class=\"wp-block-heading\" data-block-type=\"core\">Actions concrtes pour une accessibilit renforce</h2>\n\n\n\n<p>Des solutions existent pour amliorer l&#8217;accessibilit sur WordPress, notamment grce aux critres lists dans le RGAA et les WCAG. Voici quelques pistes explores durant notre discussion :</p>\n\n\n\n<ul data-block-type=\"core\">\n<li data-block-type=\"core\"><strong>La Navigation au Clavier</strong> : Offrir une navigation pertinente sans recourir  la souris est crucial. L&#8217;intgration d&#8217;un lien d&#8217;vitement permet de faciliter l&#8217;accs direct au contenu principal.</li>\n\n\n\n<li data-block-type=\"core\"><strong>Le Contraste et les Typographies</strong> : Choisir des contrastes adquats et des polices sans serif contribue grandement  une meilleure lisibilit pour tous.</li>\n\n\n\n<li data-block-type=\"core\"><strong>Contenus Textuels Structurs</strong> : Utiliser les balises de titre (H1, H2, H3) pour structurer le contenu permet une navigation plus intuitive via les lecteurs d&#8217;cran.</li>\n\n\n\n<li data-block-type=\"core\"><strong>Images et Mdias</strong> : Les textes alternatifs descriptifs (attribut ALT) pour les images sont essentiels, tout comme les transcriptions pour les contenus audio et les sous-titres pour les vidos.</li>\n</ul>\n\n\n\n<h3 class=\"wp-block-heading\" data-block-type=\"core\">Le Cas Particulier des Formulaires</h3>\n\n\n\n<p>Un point souvent dlicat lorsqu&#8217;on parle d&#8217;accessibilit est la gestion des formulaires. Notre discussion a mis en lumire l&#8217;importance de choisir des extensions compatibles avec les critres d&#8217;accessibilit. Gravity Forms se dmarque dans ce domaine, bien quil soit payant, prouvant que l&#8217;accessibilit peut parfois demander un investissement supplmentaire.</p>\n\n\n\n<h2 class=\"wp-block-heading\" data-block-type=\"core\">Les liens de l&#8217;pisode :</h2>\n\n\n\n<ul data-block-type=\"core\">\n<li data-block-type=\"core\">Le comparatif des extensions de formulaire par Temesis :&nbsp;<a href=\"https://www.temesis.com/blog/comparatif-de-laccessibilite-de-5-plugins-de-formulaire-pour-wordpress/\">https://www.temesis.com/blog/comparatif-de-laccessibilite-de-5-plugins-de-formulaire-pour-wordpress/</a></li>\n\n\n\n<li data-block-type=\"core\">Outil de contraste :&nbsp;<a href=\"https://contrast-finder.tanaguru.com/\">https://contrast-finder.tanaguru.com/</a></li>\n\n\n\n<li data-block-type=\"core\">Extension navigateur daudit par Empreinte digitale :&nbsp;<a href=\"https://assistant-rgaa.empreintedigitale.fr/\">https://assistant-rgaa.empreintedigitale.fr/</a></li>\n\n\n\n<li data-block-type=\"core\">Outil danalyse automatique pour dgrossir :&nbsp;<a href=\"https://wave.webaim.org/\">https://wave.webaim.org/</a></li>\n\n\n\n<li data-block-type=\"core\"><a href=\"https://la-va11ydette.orange.com/?list=wcag-web&amp;lang=fr\">https://la-va11ydette.orange.com/?list=wcag-web&amp;lang=fr</a>&nbsp;pour faire un audit en ligne</li>\n</ul>\n\n\n\n<h2 class=\"wp-block-heading\" data-block-type=\"core\">En Conclusion : Un Appel  l&#8217;Action</h2>\n\n\n\n<p>Je vous invite  couter l&#8217;pisode complet pour plonger plus profondment dans ces discussions et dcouvrir d&#8217;autres aspects cruciaux de l&#8217;accessibilit web. Parce que chaque action compte, et qu&#8217;amliorer l&#8217;accessibilit de nos sites WordPress est un pas vers un web plus inclusif et respectueux de toutes les diffrences.</p>\n\n\n\n<p>Et vous, quelles sont vos astuces pour rendre vos sites plus accessibles ? Partagez vos expriences et continuons ensemble  contribuer  un internet ouvert  tous.</p>\n\n\n\n<p>N&#8217;oubliez pas, votre feedback est prcieux ; laissez un commentaire ou une note sur votre plateforme d&#8217;coute favorite. Ensemble, illuminons le chemin vers un web plus accessible pour tous.</p>\n\n\n\n<h2 class=\"wp-block-heading\" data-block-type=\"core\">Ecoutez le podcast sur </h2>\n\n\n\n<div class=\"wp-block-columns is-layout-flex wp-container-core-columns-layout-1 wp-block-columns-is-layout-flex\" data-block-type=\"core\">\n<div class=\"wp-block-column is-layout-flow wp-block-column-is-layout-flow\" data-block-type=\"core\">\n<figure class=\"wp-block-image size-large\" data-block-type=\"core\"><a href=\"https://podcasts.apple.com/fr/podcast/woa-wordpress-on-air/id1482779414\" target=\"_blank\" rel=\"noopener noreferrer\"><img src=\"https://www.whodunit.fr/wp-content/uploads/2019/10/apple-podcasts-e1571142591535.jpg\" alt=\"\" class=\"wp-image-66447\" //></a></figure>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow wp-block-column-is-layout-flow\" data-block-type=\"core\">\n<figure class=\"wp-block-image size-large\" data-block-type=\"core\"><a href=\"https://open.spotify.com/show/5rEMqG2cyoKYxpTTUAKSPp\" target=\"_blank\" rel=\"noopener noreferrer\"><img src=\"https://www.whodunit.fr/wp-content/uploads/2019/10/unknown.png\" alt=\"\" class=\"wp-image-66448\" //></a></figure>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow wp-block-column-is-layout-flow\" data-block-type=\"core\">\n<figure class=\"wp-block-image size-large\" data-block-type=\"core\"><a href=\"https://www.deezer.com/fr/show/586602\" target=\"_blank\" rel=\"noopener noreferrer\"><img src=\"https://www.whodunit.fr/wp-content/uploads/2019/10/deezer-1024x196.png\" alt=\"\" class=\"wp-image-66449\" //></a></figure>\n</div>\n\n\n\n<div class=\"wp-block-column is-layout-flow wp-block-column-is-layout-flow\" data-block-type=\"core\">\n<figure class=\"wp-block-image size-large\" data-block-type=\"core\"><a href=\"http://podplayer.net/?podId=2447675\" target=\"_blank\" rel=\"noopener noreferrer\"><img src=\"https://www.whodunit.fr/wp-content/uploads/2019/10/podcast-addict-for-windows-pc.jpg\" alt=\"\" class=\"wp-image-66450\" //></a></figure>\n</div>\n</div>\n\n\n\n<hr data-block-type=\"core\"/>\n\n\n\n<h2 class=\"wp-block-heading\" id=\"h-j-attends-vos-retours-avec-impatience\" data-block-type=\"core\">J&#8217;attends vos retours avec impatience&nbsp;!</h2>\n\n\n\n<div class=\"wp-block-media-text alignwide is-stacked-on-mobile\" style=\"grid-template-columns:20% auto\" data-block-type=\"core\"><figure class=\"wp-block-media-text__media\"><img width=\"1080\" height=\"1080\" src=\"https://www.whodunit.fr/wp-content/uploads/2023/05/template-carre-1080x1080.jpg\" alt=\"\" class=\"wp-image-75791 size-full\" //></figure><div class=\"wp-block-media-text__content\">\n<p>Je vous invite  couter, partager et surtout  laisser vos commentaires et valuations. Votre feedback est non seulement prcieux pour moi, mais il aide aussi le podcast  toucher un public plus large. </p>\n\n\n\n<p>Vous souhaitez intervenir ? Envoyez un mail  eddy@whodunit.fr ou rejoignez-moi sur LinkedIn <a href=\"https://www.linkedin.com/in/eddy-boels/\" target=\"_blank\" rel=\"noreferrer noopener\">https://www.linkedin.com/in/eddy-boels/</a> pour en discuter.</p>\n</div></div>\n<p>Larticle <a href=\"https://www.whodunit.fr/les-cle-essentielles-pour-entamer-une-demarche-accessibilite-avec-wordpress/\">Les cl essentielles pour entamer une dmarche accessibilit avec WordPress</a> est apparu en premier sur <a href=\"https://www.whodunit.fr\">Agence WordPress Whodunit</a>.</p>\n\n    \";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:4:\"type\";s:4:\"html\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:6:\"author\";a:1:{i:0;a:6:{s:4:\"data\";s:46:\"\n            \n                                \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:27:\"http://www.w3.org/2005/Atom\";a:1:{s:4:\"name\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Eddy Boels\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}s:6:\"source\";a:1:{i:0;a:6:{s:4:\"data\";s:67:\"\n                    \n                            \n                \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:27:\"http://www.w3.org/2005/Atom\";a:2:{s:2:\"id\";a:1:{i:0;a:5:{s:4:\"data\";s:38:\"https://www.whodunit.fr/podcasts/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\