ttribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"summary\";a:1:{i:0;a:5:{s:4:\"data\";s:464:\"Le bon compromis entre flexibilit et prcision Quest-ce quun thme hybride ? Un thme hybride est un thme qui possde une structure classique mais supporte galement certaines fonctionnalits du FSE (Full Site Editing ou diteur de site en franais). Au sein dun thme hybride, on retrouve donc  la fois des templates PHP, des templates []\nThe post WordPress : le thme hybride Gutenberg appeared first on Agence WordPress Be API.\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"content\";a:1:{i:0;a:5:{s:4:\"data\";s:10004:\"\n        \n<h2 class=\"wp-block-heading\">Le bon compromis entre flexibilit et prcision</h2>\n\n\n\n<h3 class=\"wp-block-heading\">Quest-ce quun thme hybride ?</h3>\n\n\n\n<p>Un <strong>thme hybride</strong> est un thme qui possde une structure classique mais supporte galement certaines fonctionnalits du <strong>FSE</strong> (Full Site Editing ou diteur de site en franais). Au sein dun thme hybride, on retrouve donc  la fois des templates PHP, des templates HTML, un fichier theme.json et du style CSS personnalis. Mais on retrouve galement un accs partiel  lditeur de site ainsi quaux anciens crans, comme les Menus par exemple. Dans un thme bas sur les blocs (FSE), plus de fichiers PHP ou de styles personnaliss : tout est fait dans les fichiers HTML pour les templates, et dans le theme.json pour le style et la configuration. Il ny a galement plus daccs aux anciens crans (menus, widgets, customizer, etc).</p>\n\n\n\n<h3 class=\"wp-block-heading\">Les avantages du thme hybride pour les agences et leurs clients</h3>\n\n\n\n<p>Le thme hybride offre une combinaison astucieuse de <strong>flexibilit, de prcision et d&rsquo;interface unifie</strong>, bnficiant aux agences web ainsi qu leurs clients.</p>\n\n\n\n<h4 class=\"wp-block-heading\">Flexibilit</h4>\n\n\n\n<p>Le thme hybride accorde une <strong>souplesse remarquable</strong>, permettant aux utilisateurs d&rsquo;acqurir davantage d&rsquo;<strong>autonomie</strong>. Les clients peuvent prendre en main des parties spcifiques de leurs sites via l&rsquo;diteur de site au cours des dveloppements, gagnant ainsi en indpendance pour personnaliser des zones particulires de leur site &#8211; une sidebar, un footer ou une section spcifique.</p>\n\n\n\n<h4 class=\"wp-block-heading\">Prcision</h4>\n\n\n\n<p>Pour autant, lors de la <strong>cration dun thme sur mesure</strong>, il peut y avoir des modles qui nont pas vocation  tre modifis via le tableau de bord, ou encore des fonctionnalits avances  mettre en place. Le thme hybride rpond parfaitement  ce besoin en offrant une gestion prcise des parties modifiables dans l&rsquo;diteur de site tout en conservant un contrle sur les modles principaux, administrs en PHP. Un exemple typique serait la gestion de l&rsquo;en-tte du site et du bloc Navigation, qui, bien que proposant de plus en plus d&rsquo;options, reste limit pour la mise en place de navigations avances, comme un mga menu par exemple. Dans ce contexte, il est prfrable de grer cette partie de manire plus traditionnelle, avec des menus classiques, personnalisables, dans un fichier PHP.</p>\n\n\n\n<h4 class=\"wp-block-heading\">Interface unifie</h4>\n\n\n\n<p>Fini les pages d&rsquo;options peu lgantes (faites maison ou avec ACF) pour la gestion des lments d&rsquo;un footer, ou encore les zones de widgets pour l&rsquo;dition d&rsquo;une sidebar. C&rsquo;tait bien l l&rsquo;un des objectifs du projet Gutenberg : offrir une interface d&rsquo;dition unifie. Le thme hybride, tout comme un thme bas sur les blocs, permet de tirer parti de cette interface, offrant  nos clients le confort d&rsquo;utiliser la mme interface et les mmes blocs pour diter leurs publications ainsi que les zones du site telles que le footer ou une sidebar.</p>\n\n\n\n<h2 class=\"wp-block-heading\">Cas dtude : la refonte du site beapi.fr avec un thme hybride</h2>\n\n\n\n<p>En 2023, le thme du site de l<a href=\"/\">agence WordPress</a> beapi.fr a t refondu, adoptant un thme hybride.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Objectifs</h3>\n\n\n\n<p>La transformation visait  rendre plus flexible un thme classique vieillissant, facilitant ainsi la modification d&rsquo;lments spcifiques par les contributeurs et contributrices du site &#8211; tels que le footer, les enttes des pages darchives du blog, et celles des cas clients. Des enjeux de performance et daccessibilit taient galement pris en compte.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Limitations</h3>\n\n\n\n<p>Nous devions conserver une navigation sous forme de mga menu, et quelle soit accessible. Par ailleurs, bien que la flexibilit ct contribution soit ncessaire, l&rsquo;dition complte des modles darchives depuis le tableau de bord n&rsquo;tait pas exige. Ainsi, le thme hybride s&rsquo;est rapidement impos comme la solution la plus adapte  notre cas dusage.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Mise en place technique</h3>\n\n\n\n<p>Notre thme hybride devait nous permettre dditer des lments de modles dans lditeur de site, sans pourtant autant donner accs  ldition des modles dans leur ensemble, qui eux, sont grs en PHP. Notre thme hybride a t conu pour permettre l&rsquo;dition des lments de modles dans lditeur de site, tout en limitant l&rsquo;accs  l&rsquo;dition complte des modles dans leur ensemble, grs eux en PHP.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Support des lments de modles</h3>\n\n\n\n<p>Pour activer le support des lments de modles uniquement, l&rsquo;ajout du support de block-template-parts au niveau du thme, avec dclaration dans le fichier theme.json, tait ncessaire. Cela permet que les lments de modles placs dans le dossier du thme /parts/xxx.html soient reconnus, et ditable dans Apparence &gt; lments de modles. Le fichier theme.json contiendra galement <a href=\"https://developer.wordpress.org/block-editor/how-to-guides/themes/global-settings-and-styles/\">les autres rglages</a> et styles du thme.</p>\n\n\n\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"https://beapi.fr/app/uploads/2024/02/1-1024x835.png\" alt=\"\" class=\"wp-image-4750\" width=\"660\" height=\"538\" //></figure>\n\n\n\n<h3 class=\"wp-block-heading\">Affichage des lments de modles</h3>\n\n\n\n<p>Les lments de modles tant dclars, il a fallu ensuite les afficher dans les modles PHP. WordPress propose une fonction native, <a href=\"https://developer.wordpress.org/reference/functions/block_template_part/\">block_template_part</a>, o le nom de llment de modle est simplement pass.</p>\n\n\n\n<figure class=\"wp-block-image size-full\"><img width=\"808\" height=\"514\" src=\"https://beapi.fr/app/uploads/2024/02/capture-decran-2024-02-14-a-11.22.17.png\" alt=\"\" class=\"wp-image-4751\" //><figcaption class=\"wp-element-caption\"><em>Par exemple, dans notre fichier footer.php</em></figcaption></figure>\n\n\n\n<h3 class=\"wp-block-heading\">dition des lments de modles</h3>\n\n\n\n<p>Les diffrents lments de modles sont ainsi contribuables dans lditeur :</p>\n\n\n\n<ul>\n<li>404</li>\n\n\n\n<li>Header des archives</li>\n\n\n\n<li>Header du blog</li>\n\n\n\n<li>Footer</li>\n</ul>\n\n\n\n<figure class=\"wp-block-image size-large\"><img width=\"1024\" height=\"582\" src=\"https://beapi.fr/app/uploads/2024/02/capture-decran-2024-02-14-a-11.23.24-1024x582.png\" alt=\"\" class=\"wp-image-4752\" //><figcaption class=\"wp-element-caption\"><em>La liste des lments de modles</em></figcaption></figure>\n\n\n\n<figure class=\"wp-block-image size-large\"><img width=\"1024\" height=\"582\" src=\"https://beapi.fr/app/uploads/2024/02/capture-decran-2024-02-14-a-11.23.24-1-1024x582.png\" alt=\"\" class=\"wp-image-4754\" //><figcaption class=\"wp-element-caption\"><em>Ldition du modle Footer</em></figcaption></figure>\n\n\n\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"https://beapi.fr/app/uploads/2024/02/capture-decran-2024-02-14-a-11.23.24-2-1024x582.png\" alt=\"\" class=\"wp-image-4755\" width=\"660\" height=\"375\" //><figcaption class=\"wp-element-caption\"><em>Ldition du modle Header project</em></figcaption></figure>\n\n\n\n<h3 class=\"wp-block-heading\">Et  lavenir ?</h3>\n\n\n\n<p>Si ncessaire dans le futur, rien ne nous empchera de transformer ce thme hybride en thme 100% FSE. Dans tous les cas, les thmes classiques, y compris les hybrides, resteront fonctionnels grce  la rtrocompatibilit de WordPress.</p>\n\n\n\n<h2 class=\"wp-block-heading\">Quand ne pas utiliser un thme hybride?</h2>\n\n\n\n<p>Si vous aspirez  matriser la cration d&rsquo;un thme bas sur les blocs, plongez-vous pleinement dans cette dmarche, sans recourir aux fichiers PHP. D&rsquo;ailleurs, des <a href=\"https://fullsiteediting.com/block-theme-generator/\">gnrateurs de thmes</a> sont disponibles pour faciliter ce processus, vitant ainsi de partir de zro. Considrez le recours  un thme hybride uniquement en cas de blocage dans votre dmarche.</p>\n\n\n\n<h2 class=\"wp-block-heading\">Conclusion</h2>\n\n\n\n<p>Le thme hybride reprsente un compromis judicieux entre flexibilit et prcision dans la conception de sites WordPress. En offrant une combinaison astucieuse de fonctionnalits traditionnelles et des capacits de l&rsquo;diteur de site, il rpond aux besoins des agences et de leurs clients en matire de personnalisation et de contrle. La refonte du site de notre agence Be API en utilisant un thme hybride illustre parfaitement ces avantages, en permettant une plus grande flexibilit pour les quipes de contribution, tout en conservant une gestion prcise des lments critiques du site.  l&rsquo;avenir, la transition vers des thmes entirement bass sur les blocs reste une option, mais les thmes hybrides continueront de jouer un rle important grce  leur rtrocompatibilit et  leur adaptabilit aux besoins spcifiques des projets. Cependant, il est essentiel de reconnatre que les thmes hybrides ne conviennent pas  tous les cas et qu&rsquo;il est important de choisir la solution la mieux adapte aux besoins et aux objectifs de chaque projet WordPress.</p>\n<p>The post <a href=\"https://beapi.fr/blog/wordpress-le-theme-hybride-gutenberg/\">WordPress : le thme hybride Gutenberg</a> appeared first on <a href=\"https://beapi.fr\">Agence WordPress Be API</a>.</p>\n\n    \";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:4:\"type\";s:4:\"html\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:6:\"author\";a:1:{i:0;a:6:{s:4:\"data\";s:46:\"\n            \n                                \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:27:\"http://www.w3.org/2005/Atom\";a:1:{s:4:\"name\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Marie Comet\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}s:6:\"source\";a:1:{i:0;a:6:{s:4:\"data\";s:67:\"\n                    \n                            \n                \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:27:\"http://www.w3.org/2005/Atom\";a:2:{s:2:\"id\";a:1:{i:0;a:5:{s:4:\"data\";s:48:\"https://beapi.fr/blog/categories/wordpress/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"BeAPI\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}}}}}}}}s:4:\"type\";i:512;s:7:\"headers\";O:48:\"WpOrg\\Requests\\Utility\\CaseInsensitiveDictionary\":1:{s:7:\"\0*\0data\";a:11:{s:6:\"server\";s:12:\"nginx/1.21.4\";s:4:\"date\";s:29:\"Wed, 10 Apr 2024 18:26:11 GMT\";s:12:\"content-type\";s:20:\"application/atom+xml\";s:12:\"x-powered-by\";s:10:\"PHP/8.0.13\";s:13:\"last-modified\";s:29:\"Fri, 01 Dec 2023 22:13:18 GMT\";s:4:\"etag\";s:34:\"\"c11b85e08f9a55c369b83cdc4e5e720f\"\";s:4:\"link\";s:57:\"<https://rss.wpfr.net/wp-json/>; rel=\"https://api.w.org/\"\";s:13:\"cache-control\";s:35:\"no-cache, no-store, must-revalidate\";s:6:\"pragma\";s:8:\"no-cache\";s:7:\"expires\";s:1:\"0\";s:25:\"strict-transport-security\";s:16:\"max-age=63072000\";}}s:5:\"build\";s:14:\"20211220193300\";}','no');
